return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2019-06-10 16:18:28+0000','plural-forms'=>'nplurals=1; plural=0;','project-id-version'=>'WordPress - 5.2.x - Administration','language'=>'km_KH','messages'=>['Header updated. <a href="%s">Visit your site</a> to see how it looks.'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព​ក្បាលទំព័រ។ <a href="%s">ទៅ​វេបសាយ​របស់​អ្នក</a> ដើម្បី​មើល​ការ​ផ្លាស់​ប្ដូរ។','Image Processing Error'=>'មាន​កំហុស​ក្នុង​ដំណើរការ​រៀបចំ​រូបភាព','Choose the part of the image you want to use as your header.'=>'រើស​ផ្នែក​ណាមួយ​របស់​រូបភាព​ដើម្បី​បង្ហាញ​ក្នុង​ក្បាលទំព័រ​របស់​អ្នក។','Retro (Generated)'=>'Retro (បាន​បង្កើត)','%s post updated.'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព %s ប្រកាស។','%s block not updated, somebody is editing it.'=>'ប្លុក %s ពុំត្រូវបានអាប់ដេតឡើយ,  មានអ្នកផ្សេងកំពុងតែកែ។','Export'=>'នាំចេញ','When you click the button below WordPress will create an XML file for you to save to your computer.'=>'នៅ​ពេល​អ្នក​ចុច​ប៊ូតុង​ខាង​ក្រោម WordPress នឹង​បង្កើត​ឯកសារ XML មួយ​សម្រាប់​អ្នក ដើម្បី​រក្សាទុក​ទៅ​ក្នុង​កុំព្យូទ័រ។','This format, which we call WordPress eXtended RSS or WXR, will contain your posts, pages, comments, custom fields, categories, and tags.'=>'ទ្រង់ទ្រាយ​មួយ​នេះ ដែល​យើង​ហៅ​វា​ថា WordPress eXtended RSS ឬ WXR នឹង​ផ្ទុក​ប្រកាស ទំព័រ មតិ វាល​ផ្ទាល់​ខ្លួន ចំណាត់ក្រុម និង​ស្លាក របស់​អ្នក។','Download Export File'=>'ទាញយក​ឯកសារ​នាំចេញ','You can select an image to be shown at the top of your site by uploading from your computer or choosing from your media library. After selecting an image you will be able to crop it.'=>'អ្នក​អាច​រើស​រូបភាព​ណាមួយ​ដើម្បី​បង្ហាញ​នៅ​ផ្នែក​ខាង​លើ​នៃ​វេបសាយ​របស់​អ្នក ដោយ​ការ​ផ្ទុកឡើង​ពី​កុំព្យូទ័រ​របស់​អ្នក ឬ​ក៏​រើស​ពី​បណ្ណាល័យ​មេឌា​របស់​អ្នក។ ក្រោយ​ពី​ការរើស​រូបភាព​មួយ​ហើយ​នោះ អ្នក​នឹង​អាច​ច្រិប​វា​បាន។','WordPress &rsaquo; Database Repair'=>'WordPress &rsaquo; ការជួសជុល​មូលដ្ឋាន​ទិន្នន័យ','Some database problems could not be repaired. Please copy-and-paste the following list of errors to the <a href="%s">WordPress support forums</a> to get additional assistance.'=>'បញ្ហា​មូលដ្ឋានទិន្នន័យ​ខ្លះ មិន​អាច​ជួសជុល​បាន​ទេ។ សូម​ចម្លង​ហើយ​បិទ​ភ្ជាប់​បញ្ជី​កំហុស​ទាំងនេះ​ទៅ​កាន់ <a href="%s">វេទិកា​គាំទ្រ WordPress</a> ដើម្បី​ទទួល​បាន​ជំនួយ​បន្ថែម។','Repair Database'=>'ជួសជុល​មូលដ្ឋាន​ទិន្នន័យ','Repair and Optimize Database'=>'ជួសជុល​និង​ធ្វើ​ឲ្យ​មូលដ្ឋាន​ទិន្នន័យ​ប្រសើរ​ឡើង','Library'=>'បណ្ណាល័យ','Comments %s'=>'មតិ %s','Appearance'=>'ទិដ្ឋភាព','Your Profile'=>'ប្រវត្តិរូប​របស់​អ្នក','settings screenGeneral'=>'ទូទៅ','Writing'=>'ការសរសេរ','Reading'=>'ការអាន','Permalinks'=>'តំណ​ជាក់លាក់','Users must be registered and logged in to comment'=>'អ្នកប្រើ​ត្រូវ​តែ​បាន​ចុះឈ្មោះ ហើយ​កត់ឈ្មោះ​ចូល​ដើម្បី​បញ្ចេញមតិ','Automatically close comments on articles older than %s days'=>'បិទ​ការ​បញ្ចេញ​មតិ​ដោយ​ស្វ័យ​ប្រវត្តិ​លើ​អត្ថបទ​ដែល​ចាស់​ជាង %s ថ្ងៃ','Enable threaded (nested) comments %s levels deep'=>'បើកឲ្យមានការបញ្ចេញមតិយោបល់ជាទម្រង់ប្រទាក់ក្រឡាដោយមានជម្រៅ %s ថ្នាក់។','last'=>'ចុង​ក្រោយ','first'=>'ដំបូង','Break comments into pages with %1$s top level comments per page and the %2$s page displayed by default'=>'បំបែកមតិយោបល់ជាទំព័រៗ ដោយចែកជាចំនួន %1$s មតិយោបល់ក្នុងមួយទំព័រ និងចំនួន %2$s ទំព័រដែលបានបង្ហាញតាមលំនាំដើម។','older'=>'ចាស់​ជាង','newer'=>'ថ្មី​ជាង','Comments should be displayed with the %s comments at the top of each page'=>'មតិយោបល់គួរតែត្រូវបង្ហាញជាមួយចំនួន %s នៅផ្នែកខាងលើនៃទំព័រនីមួយនីមួយៗ','Email me whenever'=>'ផ្ញើ​អ៊ីមែល​ទៅ​ខ្ញុំ​​ពេល​ណា​ក៏បាន','Anyone posts a comment'=>'នរណា​ក៏​អាច​បញ្ចេញ​មតិ','A comment is held for moderation'=>'មតិ​មួយ​កំពុង​រង់ចាំ​ការ​សម្រប​សម្រួល','Before a comment appears'=>'មុន​ពេល​មតិ​មួយ​លេច​ឡើង','Comment author must have a previously approved comment'=>'អ្នក​បញ្ចេញ​មតិ​ត្រូវ​តែ​ធ្លាប់​ទទួល​បាន​ការ​យល់​ព្រម​ចំពោះ​មតិ​មុនៗ','Comment Moderation'=>'ការ​សម្របសម្រួល​មតិ','Hold a comment in the queue if it contains %s or more links. (A common characteristic of comment spam is a large number of hyperlinks.)'=>'ដាក់​មតិ​មួយ​ទៅ​ក្នុង​ជួយ​រង់ចាំ ប្រសិន​បើ​វា​មាន​ផ្ទុក %s ឬ​ក៏​តំណ​ច្រើន។ (លក្ខណៈ​ទូទៅ​នៃ​មតិ​ស្ប៉ាម​គឺ​មាន​ផ្ទុក​តំណ​ជា​ច្រើន។)','Comment Blacklist'=>'មញ្ជីខ្មៅនៃការបញ្ចេញមតិ','Avatars'=>'អវតារ','Avatar Display'=>'ការ​បង្ហាញ​អវតារ','Show Avatars'=>'បង្ហាញ​អវតារ','Maximum Rating'=>'ការវាយតម្លៃ​អតិបរមា','G &#8212; Suitable for all audiences'=>'G &#8212; សមរម្យ​សម្រាប់​អ្នក​មើល​ទាំង​អស់','PG &#8212; Possibly offensive, usually for audiences 13 and above'=>'PG &#8212; ទំនងជាអាសគ្រាម ជាធម្មតាសម្រាប់ទស្សនិកជនដែលមានអាយុចាប់ពី ១៣ឆ្នាំប៉ុណ្ណោះ','R &#8212; Intended for adult audiences above 17'=>'R &#8212; សម្រាប់តែទស្សនិកជនដែលមានវ័យចាប់ពី ១៧ឆ្នាំប៉ុណ្ណោះ','X &#8212; Even more mature than above'=>'X &#8212; ពេញលក្ខណៈជាងខាងលើទៅទៀត','Default Avatar'=>'អវតារ​លំនាំដើម','Blank'=>'ទទេ','Gravatar Logo'=>'រូប​តំណាង Gravatar','Identicon (Generated)'=>'Identicon (បាន​បង្កើត)','Wavatar (Generated)'=>'Wavatar (បាន​បង្កើត)','MonsterID (Generated)'=>'MonsterID (បាន​បង្កើត)','Categories:'=>'ចំណាត់ក្រុម:','<strong>ERROR</strong>: "Table Prefix" can only contain numbers, letters, and underscores.'=>'<strong>ERROR</strong>: "Table Prefix" អាចផ្ទុកបានត្រឹមតែ លេខ, អក្សរ, និងសញ្ញាគូសក្រោម ប៉ុណ្ណោះ។','Default Images'=>'រូប​លំនាំ​ដើម','Crop Header Image'=>'ច្រិប​រូប​ក្បាលទំព័រ','This will remove the header image. You will not be able to restore any customizations.'=>'នេះ​នឹង​ដក​រូបភាព​ក្បាលទំព័រ​ចេញ។ អ្នក​នឹង​មិន​អាច​ស្ដារ​ការកែតម្រូវ​ណាមួយ​មក​វិញ​បាន​ទេ។','Start date:'=>'ពេល​ចាប់ផ្ដើម:','Remove Header Image'=>'ដក​រូប​ឋមកថា​ចេញ','Reset Image'=>'កំណត់​រូប​ម្ដង​ទៀត','This will restore the original header image. You will not be able to restore any customizations.'=>'នេះ​នឹង​ស្ដារ​រូបភាព​ក្បាលទំព័រ​ដើម​មក​វិញ។  អ្នក​នឹង​មិន​អាច​ស្ដារ​ការកែតម្រូវ​ណាមួយ​មក​វិញ​បាន​ទេ។ ','Restore Original Header Image'=>'ស្ដារ​រូបភាព​ដើម​របស់​ក្បាលទំព័រ','Image Upload Error'=>'កំហុស​ក្នុង​ការ​ផ្ទុក​រូបភាព​ឡើង','You need JavaScript to choose a part of the image.'=>'អ្នក​ត្រូវ​ការ Javascript ដើម្បី​រើស​ផ្នែក​របស់​រូបភាព។','Crop and Publish'=>'ច្រិប​និង​ផ្សាយ','(Signup has been disabled. Only members of this site can comment.)'=>'(ការ​ចុះឈ្មោះ​ត្រូវ​បាន​បិទ។ មាន​តែ​សមាជិក​វេបសាយ​នេះ​ទេ ដែលល​អាច​បញ្ចេញ​មតិ។)','Date range:'=>'ចន្លោះ​កាល​បរិច្ឆេទ:','This will contain all of your posts, pages, comments, custom fields, terms, navigation menus, and custom posts.'=>'ការនេះនឺងមានផ្ទុកនូវរាល់ប្រកាស, ទំព័រ, មតិយោបល់, ប្រអប់ផ្ទាល់ខ្លួន ,សព្ទ, បញ្ចីរុករក,​ និងប្រកាសផ្ទាល់ខ្លួន។','Choose what to export'=>'រើស​អ្វី​ដែល​ត្រូវ​នាំចេញ','Authors:'=>'អ្នក​និពន្ធ:','All content'=>'មាតិកា​ទាំងអស់','<strong>Random:</strong> Show a different image on each page.'=>'<strong>ចៃដន្យ:</strong> បង្ហាញ​រូបភាព​ផ្សេងៗ​គ្នា​នៅ​លើ​ទំព័រ​និមួយៗ។','Uploaded Images'=>'រូប​ដែល​បាន​ផ្ទុក​ឡើង','You can use one of these cool headers or show a random one on each page.'=>'អ្នក​អាច​ប្រើ​រូប​បឋមកថា​ទាំង​នេះ ឬ​ក៏​បង្ហាញ​រូប​ចៃដន្យ​លើ​ទំព័រ​និមួយៗ។','If you don&lsquo;t want to upload your own image, you can use one of these cool headers, or show a random one.'=>'ប្រសិន​បើ​អ្នក​មិន​ចង់​ផ្ទុក​រូបភាព​ឡើង​នោះ​ទេ អ្នក​អាច​ប្រើ​រូប​ក្បាលទំព័រ​ទាំង​នេះ ឬ​ក៏​ប្រើ​រូប​ចៃដន្យ។','You can choose one of your previously uploaded headers, or show a random one.'=>'អ្នក​អាច​រើស​រូបភាព​ក្បាលទំព័រ​ដែល​អ្នក​ធ្លាប់​បាន​ផ្ទុកឡើង​ពីពេល​មុនៗ ឬ​ក៏​បង្ហាញ​វា​ដោយ​ចៃដន្យ។','All Comments'=>'មតិ​ទាំងអស់','Available Tools'=>'ឧបករណ៍​ដែល​មាន','Network Setup'=>'ការរៀបចំ​ដំឡើង​បណ្ដាញ','Updates %s'=>'បច្ចុប្បន្នភាព %s','Successfully repaired the %s table.'=>'បាន​ជួសជុល​តារាង %s ដោយ​ជោគជ័យ។','Installed Plugins'=>'កម្មវិធី​បន្ថែម​ដែល​បាន​ដំឡើង','The %s table is already optimized.'=>'តារាង %s ត្រូវ​បាន​ធ្វើ​ឲ្យ​ប្រសើរ​ឡើង។','All Users'=>'អ្នក​ប្រើ​ទាំងអស់','Plugins %s'=>'កម្មវិធី​បន្ថែម %s','Delete Site'=>'លុប​វេបសាយ','The %s table is okay.'=>'តារាង %s គឺ​មិនអីទេ។','Managing pages is very similar to managing posts, and the screens can be customized in the same way.'=>'ការគ្រប់​គ្រង​ទំព័រ ក៏​ដូច​ទៅ​នឹង​ការ​គ្រប់គ្រង​ប្រកាស​ដែរ ហើយ​ទំព័រ​គ្រប់គ្រង​អាច​កែ​តម្រូវ​បាន​តាម​វិធី​ដូចគ្នា។','You can also edit or move multiple posts to the trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk Actions menu and click Apply.'=>'អ្នក​អាច​កែប្រែ ឬ​ផ្លាស់​ទី​ប្រកាស​ច្រើន​ទៅ​ធុង​សំរាម​ក្នុង​ពេល​តែ​មួយ​បាន។ ជ្រើស​យក​ប្រកាស​ដែល​អ្នក​ចង់​ធ្វើ ដោយ​ប្រើ​ប្រអប់​ធីក បន្ទាប់​មក​ជ្រើស​យក​សកម្មភាព​ណា​មួយ​ពី​ម៉ឺនុយ សកម្មភាព​ជា​បណ្ដុំ ហើយ​ចុច​អនុវត្ត។','Adding Plugins'=>'ការបន្ថែម​កម្មវិធី​បន្ថែម','You can customize the display of this screen&#8217;s contents in a number of ways:'=>'អ្នក​អាច​កែតម្រូវ​ការបង្ហាញមាតិកា​នៃ​អេក្រង់​នេះ តាមរយៈ​វិធី​មួយ​ចំនួន:','Managing Pages'=>'ការ​គ្រប់គ្រង​ទំព័រ','<strong>Trash</strong> removes your post from this list and places it in the trash, from which you can permanently delete it.'=>'<strong>បោះចោល</strong> ធ្វើ​ការ​ដក​ប្រកាស​របស់​អ្នក​ចេញ​ពី​បញ្ជី​នេះ ហើយ​ដាក់​វា​ទៅ​ក្នុង​ធុង​សំរាម ជា​ទីកន្លែង​ដែល​អ្នក​អាច​ធ្វើ​ការ​លុប​វា​ចោល​ជា​អចិន្ត្រៃយ៍។','I\'m sure I want to permanently disable my site, and I am aware I can never get it back or use %s again.'=>'ខ្ញុំ​ប្រាកដ​ថា​បិទ​វេបសាយ​របស់​ខ្ញុំ​ជា​អចិន្ត្រៃយ៍ ហើយ​ខ្ញុំ​ដឹង​ថា​ខ្ញុំ​មិន​អាច​យក​វា​ត្រឡប់​មក​វិញ ឬ​ក៏​ប្រើ %s ជាថ្មី​ម្ដង​ទៀត​ទេ។','Delete My Site Permanently'=>'លុប​វេបសាយ​ខ្ញុំ​ជា​អចិន្ត្រៃយ៍','<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.'=>'<strong>កែប្រែ</strong> នាំ​អ្នក​ទៅ​ទំព័រ​កែប្រែ​ប្រកាស​ណាមួយ។ អ្នក​អាច​ទៅ​ដល់​ទី​នោះ​បាន ដោយ​ចុច​លើ​ចំណងជើង​ប្រកាស។','admin menuAll Links'=>'តំណ​ទាំងអស់','Delete My Site'=>'លុប​វេបសាយ​របស់​ខ្ញុំ','Image could not be processed. Please go back and try again.'=>'មិន​អាច​ធ្វើ​ការ​លើ​រូបភាព​បាន។ សូម​ត្រឡប់​ក្រោយ ហើយ​ព្យាយាម​ម្ដង​ទៀត។','Repairs complete. Please remove the following line from wp-config.php to prevent this page from being used by unauthorized users.'=>'ជួសជុល​បាន​បញ្ចប់។ សូម​លុប​បន្ទាត់​ទាំង​នេះ​ចេញ​ពី wp-config.php ដើម្បី​បង្ការ​កុំ​ឲ្យ​អ្នកប្រើ​ខុស​ច្បាប់​ណាមួយ​អាច​ប្រើ​ទំព័រ​នេះ​បាន។','WordPress can automatically look for some common database problems and repair them. Repairing can take a while, so please be patient.'=>'WordPress អាច​ពិនិត្យ​រក​មើល​បញ្ហា​ទូទៅ​ដែល​អាច​កើត​មាន​នៅ​ក្នុង​មូលដ្ឋាន​ទិន្នន័យ ហើយ​និង​ជួសជុល​ពួកវា។ ការ​ជួសជុល​អាច​ចំណាយ​ពេល​យូរ​បន្តិច ដូច្នេះ​ហើយ សូម​មេត្តា​រង់ចាំ។','Failed to repair the %1$s table. Error: %2$s'=>'បាន​បរាជ័យ​ក្នុង​ការ​ជួសជុល​តារាង %1$s ។ កំហុស៖ %2$s','WordPress &rsaquo; Setup Configuration File'=>'WordPress &rsaquo; រៀបចំ​ឯកសារ​កំណត់​រចនាសម្ព័ន្ធ','Welcome to WordPress. Before getting started, we need some information on the database. You will need to know the following items before proceeding.'=>'ស្វាគមន៍​មក​កាន់ WordPress។ មុន​ពេល​ចាប់​ផ្ដើម យើង​ត្រូវការ​ព័ត៌មាន​ខ្លះ​អំពី​មូលដ្ឋាន​ទិន្នន័យ។ អ្នក​ត្រូវ​ដឹង​អំពី​របស់​ទាំង​ប៉ុន្មាន​នេះ មុន​ពេល​បន្ត​ទៅ​មុខ​ទៀត។','Database username'=>'ឈ្មោះ​អ្នក​ប្រើ​មូលដ្ឋាន​ទិន្នន័យ','Database password'=>'ពាក្យសម្ងាត់​មូលដ្ឋាន​ទិន្នន័យ','Table prefix (if you want to run more than one WordPress in a single database)'=>'បុព្វប​ទ​តារាង (បើ​អ្នក​ចង់​ប្រើ WordPress ច្រើន​ជាង​មួយ​នៅ​ក្នុង​មូលដ្ឋាន​ទិន្នន័យ)','Let&#8217;s go!'=>'តោះ! ចាប់​ផ្ដើម','Database Name'=>'ឈ្មោះ​មូលដ្ឋាន​ទិន្នន័យ','example usernameusername'=>'ឈ្មោះ​អ្នក​ប្រើ','example passwordpassword'=>'ពាក្យ​សម្ងាត់','Database Host'=>'ម៉ាស៊ីន​មូលដ្ឋាន​ទិន្នន័យ','Table Prefix'=>'បុព្វបទ​តារាង','If you want to run multiple WordPress installations in a single database, change this.'=>'បើ​អ្នក​ធ្វើ​ការ​ដំឡើង WordPress ច្រើន​ក្នុង​មូលដ្ឋានទិន្នន័យ​តែមួយ​នោះ សូម​ប្ដូរ​ត្រង់​នេះ។','Remember, once deleted your site cannot be restored.'=>'សូម​ចងចាំ​ថា អ្នក​មិន​អាច​ស្ដារ​វេបសាយ​ដែល​បាន​លុប​មក​វិញ​ទេ។','Sorry, the link you clicked is stale. Please select another option.'=>'សូមទោស តំណ​ដែល​អ្នក​បាន​ចុច​គឺ​ជា​តំណ​ចាស់។ សូម​ជ្រើសរើស​ជម្រើស​មួយ​ទៀត។','Thank you for using %s, your site has been deleted. Happy trails to you until we meet again.'=>'អរគុណ​សម្រាប់​ការ​ប្រើ​ប្រាស់ %s, វេបសាយ​របស់​អ្នក​ត្រូវ​បាន​លុប​ហើយ។ ជូន​ពរ​ឲ្យ​អ្នក​រីករាយ។','If you do not want to use your %s site any more, you can delete it using the form below. When you click <strong>Delete My Site Permanently</strong> you will be sent an email with a link in it. Click on this link to delete your site.'=>'ប្រសិនបើ​អ្នក​មិន​ចង់​ប្រើ​វេបសាយ %s របស់​អ្នក​ទៀតទេ អ្នក​អាច​លុប​វា​បាន​ដោយ​ប្រើ​បែបបទ​ខាងក្រោម។ នៅ​ពេល​អ្នក​ចុច <strong>លុប​វេបសាយ​របស់​ខ្ញុំ​ជា​អចិន្ត្រៃយ៍</strong> អ្នក​នឹង​ទទួល​បាន​អ៊ីមែល​មួយ​ដែល​មាន​តំណ​ក្នុង​នោះ។ ចុច​លើ​តំណ​នោះ ដើម្បី​លុប​វេបសាយ​របស់​អ្នក។','Thank you. Please check your email for a link to confirm your action. Your site will not be deleted until this link is clicked.'=>'សូម​អរគុណ។ សូម​ពិនិត្យ​មើល​អ៊ីមែល​របស់​អ្នក​សម្រាប់ តំណភ្ជាប់ ​បញ្ជាក់​សកម្មភាព​របស់​អ្នក។ វេបសាយ​របស់​អ្នក​នឹង​មិន​ត្រូវ​បាន​លុប​ទេ រហូត​ដល់​ពេល​តំណ​នេះ​ត្រូវ​បាន​ចុច។','Header Text'=>'អក្សរ​ក្បាល​ទំព័រ','Show header text with your image.'=>'បង្ហាញ​អក្សរ​ក្បាលទំព័រ​ជាមួយ​រូបភាព​របស់​អ្នក។','Set as header'=>'កំណត់​ជា​ក្បាល​ទំព័រ','This screen is used to customize the header section of your theme.'=>'ទំព័រ​នេះ​ត្រូវ​បាន​ប្រើ ដើម្បី​កែតម្រូវ​ផ្នែក​ក្បាល​ទំព័រ​នៃ​រូបរាង​របស់​អ្នក។','You can choose from the theme&#8217;s default header images, or use one of your own. You can also customize how your Site Title and Tagline are displayed.'=>'អ្នក​អាច​រើស​ពី​រូប​ក្បាលទំព័រ​លំនាំ​ដើម​របស់​ស្បែក​រូបរាង ឬ​ក៏​ប្រើ​រូប​របស់​អ្នក។ អ្នក​ក៏​អាច​កែតម្រូវ​ការបង្ហាញ​នៃ ឈ្មោះ​វេបសាយ និង ពាក្យ​ស្លោក របស់​អ្នក​បាន​ដែរ។','Some themes come with additional header images bundled. If you see multiple images displayed, select the one you&#8217;d like and click the &#8220;Save Changes&#8221; button.'=>'ស្បែក​ខ្លះ​មាន​ភ្ជាប់​មក​ជាមួយ​នឹង​កញ្ចប់​រូបភាព​ក្បាល​ទំព័រ​ហើយ​ស្រាប់។ ប្រសិនបើ​អ្នក​ឃើញ​មាន​រូបភាព​ច្រើន​ត្រូវបាន​បង្ហាញ សូម​រើស​រូប​ណាមួយ​ដែល​អ្នក​ចូលចិត្ត ហើយ​ចុច​លើ​ប៊ូតុង &#8220;រក្សាទុក​បន្លាស់ប្ដូរ&#8221; ។','If your theme has more than one default header image, or you have uploaded more than one custom header image, you have the option of having WordPress display a randomly different image on each page of your site. Click the &#8220;Random&#8221; radio button next to the Uploaded Images or Default Images section to enable this feature.'=>'ប្រសិន​បើ​ស្បែក​រូបរាង​របស់​អ្នក​មាន​រូបភាព​ក្បាលទំព័រ​ដើម​ច្រើន​ជាង​មួយ ឬ​ក៏​អ្នក​បាន​ផ្ទុកឡើង​រូបភាព​ក្បាលទំព័រ​ច្រើន​ជាង​មួយ ដូច្នេះ​អ្នក​មាន​ជម្រើស​ដែល​អាច​ឲ្យ WordPress ធ្វើ​ការបង្ហាញ​រូបភាព​ទាំងនោះ​ខុសៗ​គ្នា​លើ​ទំព័រ​និមួយៗ​នៃ​វេបសាយ​របស់​អ្នក។ ចុច​ប៊ូតុង​មូល &#8220;ចៃដន្យ&#8221; ដែល​ស្ថិត​នៅ​ក្បែរ​ផ្នែក រូបភាព​ដែល​បាន​ផ្ទុក​ឡើង ឬ រូបភាព​លំណាំ​ដើម ដើម្បី​បើក​ដំណើរការ​លក្ខណៈពិសេស​នេះ។','For most themes, the header text is your Site Title and Tagline, as defined in the <a href="%1$s">General Settings</a> section.'=>'សម្រាប់​ស្បែក​ជាច្រើន អក្សរ​ក្បាលទំព័រ​គឺជា ឈ្មោះ​វេបសាយ និង ពាក្យស្លោក ដែល​មាន​កំណត់​នៅ​ក្នុង​ផ្នែក <a href="%1$s">ការកំណត់​ទូទៅ</a> ។','Skip Cropping, Publish Image as Is'=>'រំលង​ការ​ច្រិប, បោះ​ផ្សាយ​រូប​ភាព​តែ​ម្ដង','If you don&#8217;t want a header image to be displayed on your site at all, click the &#8220;Remove Header Image&#8221; button at the bottom of the Header Image section of this page. If you want to re-enable the header image later, you just have to select one of the other image options and click &#8220;Save Changes&#8221;.'=>'ប្រសិន​បើ​អ្នក​មិន​ចង់​ឲ្យ​រូបភាព​ក្បាលទំព័រ​ត្រូវបាន​បង្ហាញ​លើ​វេបសាយ​របស់​អ្នក​ទេ​នោះ សូម​ចុច​ប៊ូតុង &#8220;ដក​រូបភាព​ក្បាលទំព័រ​ចេញ&#8221; ដែល​ស្ថិត​នៅ​បាតក្រោម​នៃ​ផ្នែក រូបភាព​ក្បាលទំព័រ ក្នុង​ទំព័រ​នេះ។ ប្រសិនបើ​អ្នក​ចង់​បើក​រូបភាព​ក្បាលទំព័រ​នៅ​ពេល​ក្រោយ​ទៀត​នោះ អ្នក​អាច​ធ្វើបាន​ដោយ​គ្រាន់​តែ​រើស​រូបភាព​ណាមួយ ហើយ​ចុច &#8220;រក្សាទុក​បន្លាស់​ប្ដូរ&#8221; ។','You can set a custom image header for your site. Simply upload the image and crop it, and the new header will go live immediately. Alternatively, you can use an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button.'=>'អ្នក​អាច​កំណត់​រូបភាព​ក្បាលទំព័រ​ផ្ទាល់ខ្លួន សម្រាប់​វេបសាយ​របស់​អ្នក។ ដោយ​គ្រាន់តែ​ផ្ទុក​ឡើង ហើយ​ច្រិប​រូបភាព​នោះ បន្ទាប់​មក​ក្បាលទំព័រ​ថ្មី​នឹង​បង្ហាញ​ភ្លាមៗ។ ម្យ៉ាង​វិញ​ទៀត អ្នក​ក៏​អាច​ប្រើ​រូបភាព​ណាមួយ​ដែល​ធ្លាប់​បាន​ផ្ទុក​ឡើង​ទៅ​ក្នុង បណ្ណាល័យ​មេឌា របស់​អ្នក ដោយ​ចុច​ប៊ូតុង &#8220;រើស​រូបភាព&#8221; ។','If you want to install a plugin that you&#8217;ve downloaded elsewhere, click the Upload Plugin button above the plugins list. You will be prompted to upload the .zip package, and once uploaded, you can activate the new plugin.'=>'ប្រសិន​បើ​អ្នក​ចង់​ដំឡើង​កម្មវិធី​បន្ថែម​ដែល​អ្នក​បាន​ទាញយក​ពី​កន្លែង​ណា​មួយ​ ចុច​ត្រង់ប៊ូតុង​ «ផ្ទុក ​កម្មវិធីបន្ថែមឡើង» ដែល​ស្ថិត​នៅឯបញ្ជីកម្មវិធីបន្ថែម។ អ្នក​នឹង​​បាន​ជំរុញឲ្យទៅ អាប់ឡូតកញ្ចប់ .zip ហើយ​បន្ទាប់​ពី​ផ្ទុក​ឡើង​ហើយ អ្នក​អាច​បើក​ដំណើរការ​កម្មវិធី​បន្ថែម​ថ្មី​នោះ​បាន។','Choose a Custom Header'=>'រើស​ក្បាលទំព័រ​តាម​បំណង','colorDefault: %s'=>'លំនាំ​ដើម: %s','Don&#8217;t forget to click &#8220;Save Changes&#8221; when you&#8217;re done!'=>'កុំ​ភ្លេច​ចុច &#8220;រក្សា​ទុក​បន្លាស់​ប្ដូរ&#8221; នៅ​ពេល​អ្នក​រួចរាល់!','In the Header Text section of this page, you can choose whether to display this text or hide it. You can also choose a color for the text by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'នៅ​ក្នុង​ផ្នែក អក្សរ​ក្បាលទំព័រ នៃ​ទំព័រ​នេះ អ្នក​អាច​រើស​ថា​តើ​ត្រូវ​បង្ហាញ​ឬ​ក៏​លាក់​អក្សរ​នេះ។ អ្នក​ក៏​អាច​រើស​ពណ៌​អក្សរ​ដោយ​ចុច​ប៊ូតុង រើសពណ៌ ហើយ​បញ្ចូល​តម្លៃ​គោល​ដប់ប្រាំមួយ, ឧទា. &#8220;#ff0000&#8221; សម្រាប់​ពណ៌​ក្រហម, ឬក៏​រើស​ពណ៌​ដោយ​ប្រើ​ប្រដាប់​រើសពណ៌។','%s post not updated, somebody is editing it.'=>'ប្រកាស %s មិន​បាន​ធ្វើ​បច្ចុប្បន្នភាព, នរណា​ម្នាក់​កំពុង​កែ​វា។','%s post permanently deleted.'=>'បាន​លុប %s ប្រកាស​ចោល​ជា​អចិន្ត្រៃយ៍។','%s post moved to the Trash.'=>'បាន​បោះ​ចោល %s ប្រកាស​ទៅ​ក្នុង​ធុង​សំរាម។','%s post restored from the Trash.'=>'បាន​បោះ​ចោល %s ប្រកាស​ទៅ​ក្នុង​ធុង​សំរាម។','%s page updated.'=>'ទំព័រ %s បាន​ធ្វើ​បច្ចុប្បន្នភាព។','%s page not updated, somebody is editing it.'=>'ទំព័រ %s មិន​បាន​ធ្វើ​បច្ចុប្បន្នភាព, នរណា​ម្នាក់​កំពុង​កែ​វា។','%s page permanently deleted.'=>'បាន​លុប %s ទំព័រ​ចោល​ជា​អចិន្ត្រៃយ៍។','%s page moved to the Trash.'=>'បាន​បោះ​ចោល %s ទំព័រ​ទៅ​ក្នុង​ធុង​សំរាម។','%s page restored from the Trash.'=>'បាន​យក %s ទំព័រ​ចេញ​ពី​ធុង​សំរាម។','Comment must be manually approved'=>'មតិ​ត្រូវ​តែ​ទទួល​បាន​ការ​យល់​ព្រម​ដោយ​ដៃ','https://wordpress.org/support/forum/how-to-and-troubleshooting'=>'https://wordpress.org/support/forum/how-to-and-troubleshooting','<a href="https://codex.wordpress.org/Pages_Screen">Documentation on Managing Pages</a>'=>'<a href="https://codex.wordpress.org/Pages_Screen">ឯកសារ​ស្ដី​ពីការ​គ្រប់គ្រង​ទំព័រ</a>','<a href="https://codex.wordpress.org/Posts_Screen">Documentation on Managing Posts</a>'=>'<a href="https://codex.wordpress.org/Posts_Screen">ឯកសារ​ស្ដី​ពីការ​គ្រប់គ្រង​ប្រកាស</a>','<a href="https://codex.wordpress.org/Plugins_Add_New_Screen">Documentation on Installing Plugins</a>'=>'<a href="https://codex.wordpress.org/Plugins_Add_New_Screen">ឯកសារ​ស្ដី​ពីការ​ដំឡើង​កម្មវិធី​បន្ថែម</a>','<a href="https://codex.wordpress.org/Tools_Export_Screen">Documentation on Export</a>'=>'<a href="https://codex.wordpress.org/Tools_Export_Screen">ឯកសារ​ស្ដី​ពីការ​នាំចេញ</a>','<a href="https://codex.wordpress.org/Appearance_Header_Screen">Documentation on Custom Header</a>'=>'<a href="https://codex.wordpress.org/Appearance_Header_Screen">ឯកសារ​ស្ដី​ពីក្បាលទំព័រ​ផ្ទាល់​ខ្លួន</a>','1 page not updated, somebody is editing it.'=>'ទំព័រមួយមិនបានអាប់ដេត មានគេផ្សេងទៀតកំពុងកែសម្រួលវា។','1 post not updated, somebody is editing it.'=>'ប្រកាសមួយមិនបានអាប់ដេត មានគេផ្សេងទៀតកំពុងកែសម្រួលវា។','Howdy ###USERNAME###,

You recently clicked the \'Delete Site\' link on your site and filled in a
form on that page.

If you really want to delete your site, click the link below. You will not
be asked to confirm again so only click this link if you are absolutely certain:
###URL_DELETE###

If you delete your site, please consider opening a new site here
some time in the future! (But remember your current site and username
are gone forever.)

Thanks for using the site,
Webmaster
###SITE_NAME###'=>'សួស្ដី ###USERNAME###,

ថ្មីៗនេះអ្នកបានចុចលើតំណ \'លុបវេបសាយ\' នៅលើវេបសាយរបស់អ្នក និងបានបំពេញនូវ
ទម្រង់មួយនៅលើទំព័រនោះ។

ប្រសិនបើអ្នកពិតជាចង់លុបនូវវេបសាយរបស់អ្នកមែន សូមចុចលើតំណខាងក្រោម។ អ្នកនឹងពុំត្រូវបាន
សួរដើម្បីបញ្ជាក់ម្ដងទៀតនោះទេ ដូចនេះសូមចុចលើតំណនេះប្រសិនបើពិតជាចង់លុបមែនប៉ុណ្ណោះ:
###URL_DELETE###

