###SITE_NAME###','Add Plugins'=>'ដំឡើង​កម្មវិធី​បន្ថែម','Browse Plugins'=>'រុករកកម្មវិធី​បន្ថែម','Mystery Person'=>'ជន​អាថ៌កំបាំង','Comment status'=>'ស្ថានភាពមតិយោបល់','In response to: %s'=>'នៅក្នុងការឆ្លើយតបទៅនឹង: %s','In reply to: %s'=>'ឆ្លើយតប​ចំពោះ៖ %s','While you are editing your %1$s file, take a moment to make sure you have all 8 keys and that they are unique. You can generate these using the <a href="%2$s">WordPress.org secret key service</a>.'=>'ខណៈពេលដែលអ្នកកំពុងកែសម្រូលឯកសារ %1$s របស់អ្នក សូមចំណាយពេលបន្ដិចដើម្បីឱ្យប្រាកដថា អ្នកមានចំនុចទាំងប្រាំបីដែលមិនជាន់គ្នា។ អ្នកអាចបង្កើតវាដោយប្រើ <a href="%2$s">WordPress.org សេវាពាក្យសម្ងាត់</a>.','The current theme does not support uploading a custom header image.'=>'រូបរាងបច្ចុប្បន្នពុំគាំទ្រនូវការអាប់ឡូដផ្នែកក្បាលនៃរូបភាពដែលកែច្នៃឡើយ។','The current theme does not support a flexible sized header image.'=>'រូបរាងបច្ចុុប្បន្នពុំគាំទ្រនូវផ្នែកក្បាលនៃរូបភាពដែលមានប្រវែងអាចបត់បែនបាននោះទេ។','commentPermalink:'=>'តំណភ្ជាប់ជាក់លាក់','Submitted on: %s'=>'ស្នើបញ្ជូនលើ៖ %s','You can view posts in a simple title list or with an excerpt using the Screen Options tab.'=>'អ្នកអាចមើលប្រកាសនៅក្នុងបញ្ជីចំណងជើងសាមញ្ញ ឬនៅក្នុងសម្រង់ដោយប្រើផ្ទាំងអេក្រង់ជម្រើសមួយ។','Content to export'=>'នាំចេញមាតិកា','End date:'=>'កាលបរិច្ឆេទបញ្ចប់:','Check secret keys'=>'ពិនិត្យ​សោ​សម្ងាត់','WordPress database repair'=>'ជួសជុលដេតាបេសរបស់ WordPress','Before getting started'=>'មុននឹងចាប់ផ្តើម','Set up your database connection'=>'បង្កើតការតភ្ជាប់ដេតាបេសរបស់អ្នក','Successful database connection'=>'ការតភ្ជាប់ដេតាបេសទទួលបានជោគជ័យ','Allow automatic database repair'=>'អនុញ្ញាតឱ្យជួសជុលដេតាបេសដោយស្វ័យប្រវត្តិ','Database repair results'=>'លទ្ធផលនៃការជួសជុលដេតាបេស','We&#8217;re going to use this information to create a %s file.'=>'ពួកយើង​នឹង​ប្រើ​ព័ត៌មាន​នេះ​សម្រាប់​ការ​បង្កើត​ឯកសារ %s។','Need more help? <a href="%s">We got it</a>.'=>'ត្រូវការជំនួយបន្ថែម? <a href="%s">យើង​ទទួល​បាន</a>.','You should be able to get this info from your web host, if %s doesn&#8217;t work.'=>'អ្នកគួរតែអាចទទួលបានទិន្នន័យនេះពីម៉ាស៊ីនបម្រើបណ្ដាញរបស់អ្នក, ប្រសិនបើ %s មិនដំណើរការ។','Sorry, but I can&#8217;t write the %s file.'=>'សុំទោស ខ្ញុំមិនអាចសរសេរលើឯកសារ %s បានទេ។','You can create the %s file manually and paste the following text into it.'=>'អ្នកអាចបង្កើត %s បានដោយខ្លួនឯង និងបិទភ្ជាប់អក្សរដូចខាងក្រោមទៅក្នុងវា។','If for any reason this automatic file creation doesn&#8217;t work, don&#8217;t worry. All this does is fill in the database information to a configuration file. You may also simply open %1$s in a text editor, fill in your information, and save it as %2$s.'=>'ប្រសិនបើមានមូលហេតុណាមួយដែលការបង្កើតឯកសារដោយស្វ័យប្រវត្តិមិនដំណើរការ,សូមកុំបារម្ភ។  អ្វីដែលការនេះធ្វើ គឺបំពេញព័ត៌មាននៃដេតាបេសទៅកាន់ឯកសារនៃការកំណត់រចនាសម្ព័ន្ធមួយ។ អ្នកក៏អាចគ្រាន់តែបើកឯកសារ %1$s នៅក្នុងកម្មវិធីនិពន្ធអត្ថបទមួយ រួចបំពេញនូវព័ត៌មានរបស់អ្នក និងរក្សាទុកវាជា %2$s។','Images should be at least %s wide.'=>'រូបភាពគួរមានយ៉ាងហោចណាស់ទទឹងចំនួន %s។','%d pixels'=>'%d ភីកសែល','Images should be at least %s tall.'=>'រូបភាពគួរតែមានកម្ពស់យ៉ាងហោចណាស់ %s។','Suggested width is %s.'=>'ប្រវែងដែលបានស្នើរគឺ %s។','Suggested height is %s.'=>'កម្ពស់ដែលបានស្នើរគឺ %s។','comment statusPending'=>'មិនទាន់សម្រេច','The name of the database you want to use with WordPress.'=>'ឈ្មោះ​មូលដ្ឋាន​ទិន្នន័យ​ដែល​អ្នក​ចង់​ប្រើ​ជាមួយ WordPress។','Your database username.'=>'មូលដ្ឋានទិន្នន័យឈ្មោះ​អ្នក​ប្រើប្រាស់​របស់​អ្នក។','Your database password.'=>'មូលដ្ឋាន​ទិន្នន័យពាក្យសម្ងាត់​របស់​អ្នក។','Sorry, you are not allowed to customize headers.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឪ្យកំណត់បឋមកថាដោយខ្លួនឯងទេ។','You can filter the list of posts by post status using the text links above the posts list to only show posts with that status. The default view is to show all posts.'=>'អ្នកអាចច្រោះបញ្ជីនៃប្រកាសនេះដោយស្ថានភាពប្រកាសដោយប្រើតំណភ្ជាប់អក្សរខាងលើបញ្ជីប្រកាសដើម្បីគ្រាន់តែបង្ហាញប្រកាសជាមួយនឹងស្ថានភាពនោះ។ ទិដ្ឋភាពក្នុងលំនាំដើមគឺដើម្បីបង្ហាញប្រកាសទាំងអស់។','Sorry, you are not allowed to export the content of this site.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឪ្យនាំចេញមាតិកានៃវេបសាយនេះទេ។','Sorry, you are not allowed to delete this site.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឪ្យ លុបវេបសាយនេះទេ។','<strong>ERROR</strong>: "Table Prefix" is invalid.'=>'<strong>កំហុស</strong>៖"Table Prefix" គឺមិនត្រឹមត្រូវ។','Plugins hook into WordPress to extend its functionality with custom features. Plugins are developed independently from the core WordPress application by thousands of developers all over the world. All plugins in the official <a href="%s">WordPress Plugin Directory</a> are compatible with the license WordPress uses.'=>'កម្មវិធីបន្ថែមត្រូវបានថ្ពក់ទៅក្នុង WordPress ដើម្បីបន្ថែមមុខងាររបស់វា ដោយប្រើប្រាស់លក្ខណៈពិសេសកែច្នៃ។ កម្មវិធីបន្ថែមដែលត្រូវបានអភិវឌ្ឍន៍ដោយឯករាជ្យពីកម្មវិធីស្នូលរបស់ WordPress ដោយ អ្នកអភិវឌ្ឍន៍រាប់ពាន់នាក់នៅទូទាំងពិភពលោក។ គ្រប់កម្មវិធីបន្ថែមទាំងអស់ដែលស្ថិតនៅក្នុង <a href="%s">WordPress Plugin Directory</a> គឺសុទ្ធតែស្របទៅនឹងអាជ្ញាបណ្ណរបស់ WordPress ។','You can find new plugins to install by searching or browsing the directory right here in your own Plugins section.'=>'អ្នកអាចស្វែងរកកម្មវិធីបន្ថែមថ្មី ទៅតំឡើងដោយការស្វែងរក ឬ រុករកទីតាំងថតដែលត្រឹមត្រូវនៅទីនេះក្នុងផ្នែកកម្មវិធីរបស់អ្នកផ្ទាល់។','<strong>ERROR</strong>: "Table Prefix" must not be empty.'=>'<strong>ERROR</strong>: "Table Prefix" ត្រូវតែមិនទទេ។','Run the installation'=>'ដំណើរការការដំឡើង','1 block not updated, somebody is editing it.'=>'ប្លុក ១ មិនត្រូវបានអាប់ដេតនោះទេ, មានអ្នកផ្សេងកំពុងកែវា។','%s block updated.'=>'ប្លុកចំនួន %s ត្រូវបានអាប់ដេត។','%s block permanently deleted.'=>'ប្លុកចំនួន %s ត្រូវបានលុបជាអចិន្ត្រៃយ៍។','%s block moved to the Trash.'=>'មានប្លុកចំនួន %s ត្រូវបានបញ្ជូនទៅធុងសម្រាម។','%s block restored from the Trash.'=>'មានប្លុកចំនួន %s ត្រូវបាននាំចេញពីធុងសម្រាមមកវិញ។','%s Critical issue'=>'%s បញ្ហាចម្បង','Capabilities'=>'សមត្ថភាព','Invalid plugin page.'=>'ទំព័រ​កម្មវិធី​បន្ថែម​មិន​ត្រឹម​ត្រូវ។','Cannot load %s.'=>'មិន​អាច​ផ្ទុក %s។','Import'=>'នាំ​ចូល','Background updated. <a href="%s">Visit your site</a> to see how it looks.'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព​ផ្ទៃ​ក្រោយ។  <a href="%s">ទៅ​វេបសាយ​របស់​អ្នក</a> ដើម្បី​មើល​ការ​ផ្លាស់​ប្ដូរ។','Choose an image from your computer:'=>'រើស​រូប​មួយ​ពី​កុំព្យូទ័រ​របស់​អ្នក:','Your WordPress database has been successfully updated!'=>'បាន​ធ្វើ​បច្ចុប្បន្ន​ភាព​មូលដ្ឋានទិន្នន័យ WordPress របស់​អ្នក ដោយ​ជោគជ័យ!','%s comment approved'=>'បាន​យល់​ព្រម​នឹង​មតិ​ចំនួន %s','%s comment marked as spam.'=>'បាន​កត់​ចំណាំ​មតិ​ចំនួន %s ថា​ជា​ស្ប៉ាម។','%s comment restored from the spam'=>'បាន​ដក​មតិ​ចំនួន %s ចេញ​ពី​ស្ប៉ាម','%s comment permanently deleted'=>'បាន​លុប​មតិ​ចំនួន %s ជា​អចិន្ត្រៃយ៍','Search Comments'=>'ស្វែងរក​មតិ','Custom field updated.'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព​វាល​ផ្ទាល់​ខ្លួន។','Custom field deleted.'=>'បាន​លុប​វាល​ផ្ទាល់​ខ្លួន។','Post restored to revision from %s.'=>'បាន​ស្ដារ​ប្រកាស​ទៅ​កំណែសម្រួល​ពី %s','Post saved.'=>'បាន​រក្សា​ទុក​ប្រកាស។','Page restored to revision from %s.'=>'បាន​ស្ដារ​ទំព័រ​ទៅ​កំណែសម្រួល​ពី %s','Visit site'=>'មើល​វេបសាយ','<a href="%s">Links</a> / Edit Link'=>'<a href="%s">តំណ</a> / កែ​តំណ','<a href="%s">Links</a> / Add New Link'=>'<a href="%s">តំណ</a> / បន្ថែម​តំណ​ថ្មី','Link added.'=>'បាន​បន្ថែម​តំណ។','Example: Nifty blogging software'=>'ឧទាហរណ៍៖ Nifty blogging software','Web Address'=>'អាសយដ្ឋាន​វេប','Example: <code>http://wordpress.org/</code> &#8212; don&#8217;t forget the <code>http://</code>'=>'ឧទាហរណ៍៖ <code>http://wordpress.org/</code> &#8212; កុំ​ភ្លេច <code>http://</code>','This will be shown when someone hovers over the link in the blogroll, or optionally below the link.'=>'វា​នឹង​បង្ហាញ​ឡើង​នៅ​ពេល​នរណា​ម្នាក់​ចង្អុល​លើ​តំណ​ក្នុង​របុំ​ប្លក់ ឬ​នៅ​ក្រោម​តំណ។','No importers are available.'=>'មិនមាន​កម្មវិធី​នាំចូល។','Skip to main content'=>'រំលង​ទៅ​មាតិកា​ចម្បង','User has been added to your site.'=>'បាន​បន្ថែម​អ្នក​ប្រើ​ទៅ​កាន់​វេបសាយ​របស់​អ្នក។','Choose a Background Image'=>'រើស​រូបភាព​ផ្ទៃ​ក្រោយ​មួយ','Manage Themes'=>'គ្រប់​គ្រង​ស្បែក','Enable accessibility mode'=>'អនុញ្ញាត​បែប​មធ្យោបាយ​ងាយ​ស្រួល','Disable accessibility mode'=>'មិន​អនុញ្ញាត​បែប​មធ្យោបាយ​ងាយ​ស្រួល','<strong>Remove</strong> allows you to remove a user from your site. It does not delete their content. You can also remove multiple users at once by using Bulk Actions.'=>'<strong>ដកចេញ</strong> អនុញ្ញាត​ឲ្យ​អ្នក​ដក​អ្នក​ប្រើ​ណា​ម្នាក់​ចេញ​ពី​វេបសាយ​របស់​អ្នក។ វា​មិន​លុប​មាតិកា​របស់​ពួកគេ​នោះ​ទេ។ អ្នក​ក៏​អាច​ដក​អ្នក​ប្រើ​ចេញ​បាន​ច្រើន​នាក់​ដោយ​ប្រើ «សកម្មភាព​ជា​បណ្ដុំ»។','Add New Link'=>'បន្ថែម​តំណ​ថ្មី','Upload New Media'=>'ផ្ទុកឡើង​មេឌា​ថ្មី','Sorry, you are not allowed to edit this attachment.'=>'សុំទោស អ្នក​មិន​ត្រូវ​បាន​អនុញ្ញាត​ឲ្យ​កែ​ឯកសារ​ភ្ជាប់​នេះ​ទេ។','You attempted to edit an attachment that doesn&#8217;t exist. Perhaps it was deleted?'=>'អ្នកកំពុងព្យាយាមកែនូវឯកសារភ្ជាប់ដែលពុំមាននៅក្នុងវេបសាយ។ ប្រហែលជាវាត្រូវបានគេលុបបាត់ហើយ?','You can&#8217;t edit this attachment because it is in the Trash. Please move it out of the Trash and try again.'=>'អ្នក​មិន​អាច​កែប្រែ​ឯកសារ​ភ្ជាប់​នេះ​បាន​ទេ ព្រោះ​វា​ស្ថិត​នៅ​ក្នុង​ធុង​សំរាម។ សូម​ផ្លាស់​ទី​វា​ចេញ​ពី​ធុងសំរាម​សិន ហើយ​ចាំ​ធ្វើ​ម្ដង​ទៀត។','Update Media'=>'ធ្វើ​បច្ចុប្បន្នភាព​មេឌា','fileAdd New'=>'បន្ថែម​ថ្មី','pluginAdd New'=>'បន្ថែម​ថ្មី','Profile'=>'ប្រវត្តិរូប','Update Themes'=>'ធ្វើ​បច្ចុប្បន្នភាព​ស្បែក','Discussion Settings'=>'កំណត់​ការ​ពិភាក្សា','Default article settings'=>'ការ​កំណត់​អត្ថបទ​លំនាំដើម','These settings may be overridden for individual articles.'=>'ការកំណត់ទាំងនេះ អាចនឹងត្រូវលុបចេញវិញទៅតាមអត្ថបទនីមួយៗ។','Other comment settings'=>'ការកំណត់​មតី​ផ្សេង​ទៀត','Comment author must fill out name and email'=>'អ្នក​បញ្ចេញ​មតិ​ត្រូវតែ​បំពេញ​ឈ្មោះ​និង​អ៊ីមែល','Image sizes'=>'ទំហំ​រូបភាព','Thumbnail size'=>'ទំហំ​រូបតូច','Crop thumbnail to exact dimensions (normally thumbnails are proportional)'=>'ច្រឹប​រូបភាព​តូច​ឲ្យ​ត្រូវ​នឹង​ទំហំ​កំណត់ (ជា​ទូទៅ រូបភាព​តូច​តែង​មាន​ទំហំ​ប៉ុន​គ្នា)','Medium size'=>'ទំហំ​មធ្យម','Max Width'=>'ទទឹង​អតិ.','Max Height'=>'កម្ពស់​អតិ.','Large size'=>'ទំហំធំ','Uploading Files'=>'ការ​ផ្ទុកឡើង','Store uploads in this folder'=>'រក្សា​ការ​ផ្ទុកឡើង​នៅ​ក្នុង​សឺមី​នេះ','Full URL path to files'=>'URL ពេញ​ទៅ​កាន់​ឯកសារ','Organize my uploads into month- and year-based folders'=>'រៀបចំ​ការ​ផ្ទុកឡើង​ជា​សឺមី​ខែ និង​ឆ្នាំ','Permalink Settings'=>'ការ​កំណត់​តំណ​ជាក់លាក់','Permalink structure updated. Remove write access on web.config file now!'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព​តំណ​ជាក់លាក់។ ដក​សិទ្ធិ​សរសេរ​ចេញ​ពី​ឯកសារ web.config ឥឡូវ​នេះ!','You should update your .htaccess now.'=>'អ្នក​គួរ​តែ​ធ្វើ​បច្ចុប្បន្នភាព .htaccess របស់​អ្នក​ឥឡូវ​នេះ។','Permalink structure updated.'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព​តំណ​ជាក់លាក់។','Day and name'=>'ថ្ងៃ​និង​ឈ្មោះ','Month and name'=>'ខែ​និង​ឈ្មោះ','Numeric'=>'ជាលេខ','Custom Structure'=>'រចនាសម្ព័ន្ធ​ផ្ទាល់ខ្លួន','Optional'=>'ស្រេចចិត្ត','Category base'=>'មូលដ្ឋាន​ចំណាត់ក្រុម','Tag base'=>'មូលដ្ឋានស្លាក','All Settings'=>'ការ​កំណត់​ទាំងអស់','Are you sure you wish to delete these files?'=>'តើ​អ្នក​ពិត​ជា​ចង់​លុប​ឯកសារ​ទាំង​នេះ​មែន​ទេ?','Yes, delete these files'=>'ព្រម​លុប​ឯកសារ​ទាំង​នេះ','No, return me to the plugin list'=>'ទេ ជូន​ខ្ញុំ​ត្រឡប់​ទៅ​បញ្ជី​កម្មវិធី​បន្ថែម​វិញ','Plugins extend and expand the functionality of WordPress. Once a plugin is installed, you may activate it or deactivate it here.'=>'កម្មវិធី​បន្ថែម ផ្ដល់​និង​ពង្រីក​មុខងារ​ដល់ WordPress។ នៅ​ពេល​កម្មវិធី​បន្ថែម​មួយ​ត្រូវ​បាន​ដំឡើង អ្នក​អាច​បើក​ឬ​បិទ​វា​បាន​នៅ​ទីនេះ។','If something goes wrong with a plugin and you can&#8217;t use WordPress, delete or rename that file in the %s directory and it will be automatically deactivated.'=>'ប្រសិន​បើ​មាន​កំហុស​ណាមួយ​ក្នុង​កម្មវិធី​បន្ថែមមួយ ហើយ​អ្នក​មិន​អាច​ប្រើ WordPress បាន​ទេ​នោះ សូម​លុប ឬ​ប្ដូរ​ឈ្មោះ​ឯកសារ​នោះ​នៅ​ក្នុង​ទីតាំង %s ហើយ​វា​នឹង​បិទ​ដំណើរការ​ដោយ​ស្វ័យប្រវត្តិ។','The plugin %1$s has been <strong>deactivated</strong> due to an error: %2$s'=>'កម្មវិធី​បន្ថែម %1$s ត្រូវ​បាន​<strong>បិទ​ដំណើរការ</strong> ដោយសារ​កំហុស​: %2$s','Plugin could not be deleted due to an error: %s'=>'មិន​អាច​លុប​កម្មវិធី​បន្ថែម​បាន​ដោយ​សារ​កំហុស​មួយ: %s','The selected plugins have been <strong>deleted</strong>.'=>'<strong>បាន​លុប</strong>កម្មវិធី​បន្ថែម​ដែល​បាន​ជ្រើស។','Plugin <strong>activated</strong>.'=>'<strong>បាន​បើក​ដំណើរ​ការ​</strong>កម្មវិធី​បន្ថែម។','Selected plugins <strong>activated</strong>.'=>'<strong>បាន​បើក​ដំណើរ​ការ</strong>​កម្មវិធី​បន្ថែម​ដែល​បាន​រើស។','Plugin <strong>deactivated</strong>.'=>'<strong>បាន​បិទ​ដំណើរ​ការ​</strong>កម្មវិធី​បន្ថែម។ ','Selected plugins <strong>deactivated</strong>.'=>'<strong>បាន​បិទ​ដំណើរ​ការ</strong>​កម្មវិធី​បន្ថែម​ដែល​បាន​រើស។','You can&#8217;t edit this item because it is in the Trash. Please restore it and try again.'=>'អ្នក​មិន​អាច​កែប្រែ​របស់​នេះ​ទេ ព្រោះ​វា​ស្ថិត​នៅ​ក្នុង​ធុង​សំរាម។ សូម​ស្ដារ​វា​ចេញ​ពី​ធុង​សំរា​សិន រួច​ចាំ​ព្យាយាម​ម្ដង​ទៀត។','View post'=>'មើល​ប្រកាស','Theme deleted.'=>'បាន​លុប​ស្បែក។','Broken Themes'=>'ស្បែក​ខូច','Hide this update'=>'លាក់​បច្ចុប្បន្នភាព​នេះ','Bring back this update'=>'យក​បច្ចុប្បន្នភាព​នេះ​ត្រឡប់​មក​វិញ','This localized version contains both the translation and various other localization fixes. You can skip upgrading if you want to keep your current translation.'=>'កំណែ​ដែល​បាន​បកប្រែ​នេះ មាន​ទាំង​ការ​បកប្រែ​រួម​ទាំង​ការ​កែ​កំហុស​ផ្សេងៗ​នៅ​ក្នុង​ការ​បកប្រែ។ អ្នក​អាច​រំលង​ការ​អាប់ក្រេត ប្រសិនបើ​អ្នក​ចង់​រក្សា​ការ​បកប្រែ​បច្ចុប្បន្ន។','Show hidden updates'=>'បង្ហាញ​បច្ចុប្បន្នភាព​កំបាំង','Hide hidden updates'=>'លាក់​បច្ចុប្បន្នភាព​កំបាំង','Compatibility with WordPress %1$s: 100%% (according to its author)'=>'អាច​ប្រើ​បាន​ជាមួយ WordPress %1$s: 100%% (យោង​ទៅតាម​អ្នក​បង្កើត​វា)','Compatibility with WordPress %1$s: Unknown'=>'អាច​ប្រើ​បាន​ជាមួយ WordPress %1$s: មិនដឹង','Your WordPress database is already up-to-date!'=>'មូលដ្ឋាន​ទិន្នន័យ WordPress របស់​អ្នក គឺ​មាន​បច្ចុប្បន្នភាព​ហើយ!','%s queries'=>'%s សំណើ','%s seconds'=>'%s វិនាទី','Media file permanently deleted.'=>'បានលុប​មេឌា​ចោល​ជា​អចិន្ត្រៃយ៍។','Media file moved to the trash.'=>'បាន​ផ្លាស់​ទី​មេឌា​ទៅ​ធុងសំរាម។','Media file restored from the trash.'=>'បាន​ស្ដារ​យក​មេឌា​ចេញ​ពី​ធុង​សំរាម។','User updated.'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព​អ្នកប្រើ។','Personal Options'=>'ជម្រើស​ផ្ទាល់ខ្លួន','Disable the visual editor when writing'=>'បិទ​កម្មវិធី​កែ​សម្រួល​ឃើញ​ផ្ទាល់ នៅ​ពេល​កំពុង​សរសេរ','Enable keyboard shortcuts for comment moderation.'=>'បើក​គ្រាប់ចុច​ផ្លូវកាត់​សម្រាប់​ការ​សម្របសម្រួល​មតិ។','First Name'=>'នាម​ខ្លួន','Last Name'=>'នាម​ត្រកូល','Nickname'=>'ឈ្មោះ​ក្រៅ','Display name publicly as'=>'បង្ហាញ​ឈ្មោះ​ជា​សាធារណៈ​ជា','Contact Info'=>'ព័ត៌មាន​ទាក់ទង','About Yourself'=>'អំពី​ខ្លួន​អ្នក','About the user'=>'អំពី​អ្នក​ប្រើ','Biographical Info'=>'ជីវប្រវត្តិ','Share a little biographical information to fill out your profile. This may be shown publicly.'=>'ចែក​រំលែក​ព័ត៌មាន​ជីវប្រវត្តិ​បន្តិច​បន្តួច​របស់​អ្នក ដើម្បី​បំពេញ​ប្រវត្តិរូប​របស់​អ្នក។ វា​អាច​នឹង​ត្រូវ​បាន​បង្ហាញ​ជា​សាធារណៈ។','New Password'=>'ពាក្យសម្ងាត់​ថ្មី','Type your new password again.'=>'វាយ​ពាក្យសម្ងាត់​ថ្មី​របស់​អ្នក​ម្ដង​ទៀត។','Additional Capabilities'=>'សមត្ថភាព​ថែម​ទៀត','Update Profile'=>'ធ្វើ​បច្ចុប្បន្នភាព​ប្រវត្តិរូប','Update User'=>'ធ្វើ​បច្ចុប្បន្នភាព​អ្នកប្រើ','Invitation email sent to new user. A confirmation link must be clicked before their account is created.'=>'បាន​ផ្ញើ​អ៊ីមែល​អញ្ជើញ​ទៅ​អ្នក​ប្រើ​ថ្មី។ គណនី​របស់​ពួក​គេ​នឹង​ត្រូវ​បាន​បង្កើត​ក្រោយ​ពេល​តំណ​បញ្ជាក់​ត្រូវ​បាន​ចុច។','Skip Confirmation Email'=>'រំលង​អ៊ីមែល​បញ្ជាក់','Delete Users'=>'លុប​អ្នកប្រើ','There are no valid users selected for deletion.'=>'មិន​មាន​អ្នកប្រើ​មាន​សុពលភាព​ណា​ម្នាក់ ដែល​ត្រូវ​បាន​រើស​សម្រាប់​ការលុប​ទេ។','New user created.'=>'បាន​បង្កើត​អ្នក​ប្រើ​ថ្មី។','Other user roles have been changed.'=>'តួនាទី​អ្នក​ប្រើ​ផ្សេង​ទៀត​ត្រូវ​បាន​ផ្លាស់​ប្ដូរ។','You can&#8217;t delete the current user.'=>'អ្នក​មិន​អាច​លុប​អ្នកប្រើ​បច្ចុប្បន្ន​ម្នាក់​នេះ​ទេ។','Other users have been deleted.'=>'អ្នក​ប្រើ​ផ្សេង​ទៀត​ត្រូវ​បាន​លុប។','Inactive Widgets'=>'ធាតុក្រាហ្វិក​ដែល​មិន​សកម្ម','Widget %s'=>'វិដជិត %s','Position'=>'ទីតាំង','Save Widget'=>'រក្សាទុក​វិដជិត','Error in displaying the widget settings form.'=>'មាន​កំហុស​ក្នុង​ការ​បង្ហាញ​បែបបទ​កំណត់​វិដជិត។','Available Widgets'=>'វិដជិត​ដែល​មាន','Drag widgets here to remove them from the sidebar but keep their settings.'=>'អូស​វិដជិត​មក​ទីនេះ ដើម្បី​ដក​វា​ចេញ​ពី​របារ​ចំហៀង ប៉ុន្តែ​រក្សា​ការ​កំណត់​របស់​វា។','This comment is already approved.'=>'មតិ​នេះ​ត្រូវ​បាន​យល់​ព្រម។','Comments on &#8220;%s&#8221;'=>'មតិ​នៅ​លើ &#8220;%s&#8221;','You are about to remove the following plugin:'=>'អ្នក​រៀបនឹង​ដកចេញ​កម្មវិធី​បន្ថែម​ទាំង​នេះ:','Delete Plugins'=>'លុបកម្មវិធីជំនួយ','Delete Plugin'=>'លុប​កម្មវិធី​បន្ថែម','Are you sure you wish to delete these files and data?'=>'តើ​អ្នក​ពិត​ជា​ចង់​លុប​ឯកសារ​និង​ទិន្នន័យ​ទាំង​នេះ​មែនទេ?','Yes, delete these files and data'=>'ព្រម​លុប​ឯកសារ​និង​ទិន្នន័យ​ទាំង​នេះ','Go to Dashboard'=>'ទៅ​កាន់​ទំព័រ​ព័ត៌មាន','This comment is already in the Trash.'=>'មតិ​នេះ​ត្រូវ​បាន​បោះ​ចោល​ក្នុង​ធុង​សំរាម។','View Trash'=>'មើល​ធុង​សំរាម','This comment is already marked as spam.'=>'មតិ​នេះ​ត្រូវ​បាន​ចំណាំ​ថា​ជា​ស្ប៉ាម។','&mdash; No role for this site &mdash;'=>'&mdash; គ្មាន​តួនាទី​សម្រាប់​វេបសាយ​នេះ &mdash;','Welcome to your WordPress Dashboard! This is the screen you will see when you log in to your site, and gives you access to all the site management features of WordPress. You can get help for any screen by clicking the Help tab above the screen title.'=>'សូមស្វាគមន៍​មក​កាន់ ផ្ទាំងគ្រប់គ្រង WordPress របស់​អ្នក! នេះគឺជាស្ក្រីនដែល អ្នក​អាច​មើល​ឃើញ​ពេល​ដែល​អ្នក​ចូលវេបសាយ នឹង​​​អនុញ្ញាតឲ្យ​អ្នក​ចូល​ទៅ គ្រប់គ្រង​លក្ខណះពិសេសរបស់វេបសាយទាំងមូល​នៃ WordPress ។ អ្នកនឹងទទួលបានជំនួយ សម្រាប់អេក្រង់ណាមួយ ដោយចុចលើ ផ្ទាំងជំនួយ លើស្ក្រីនចំណងជើង។','WordPress Updates'=>'បច្ចុប្បន្នភាព WordPress','Update WordPress'=>'ធ្វើ​បច្ចុប្បន្នភាព WordPress','Update Plugins'=>'ធ្វើ​បច្ចុប្បន្នភាព​កម្មវិធី​បន្ថែម','Get Shortlink'=>'ទទួល​យក​តំណ​ខ្លី','Save Menu'=>'រក្សាទុក​ម៉ឺនុយ','That user is already a member of this site.'=>'អ្នក​ប្រើ​នោះ​បាន​ក្លាយ​ជា​សមាជិក​វេបសាយ​នេះ​ហើយ។','Invitation email sent to user. A confirmation link must be clicked for them to be added to your site.'=>'បាន​ផ្ញើ​អ៊ីមែល​អញ្ជើញ​ទៅ​អ្នកប្រើ​រួចហើយ។ គេ​ត្រូវ​ចុច​លើ​តំណ​បញ្ជាក់​ដែល​មាន​នៅ​ក្នុង​នោះ​សិន ទើប​គេ​ត្រូវ​បាន​បន្ថែម​ទៅ​ក្នុង​វេបសាយ​របស់​អ្នក។','You have specified these users for removal:'=>'អ្នក​បាន​កំណត់​បញ្ជាក់​អ្នកប្រើ​ទាំង​នេះ សម្រាប់​ការ​ដកចេញ៖','The following plugins have new versions available. Check the ones you want to update and then click &#8220;Update Plugins&#8221;.'=>'កម្មវិធី​បន្ថែម​ទាំង​នេះ​មាន​កំណែ​ថ្មី​ហើយ។ ជ្រើស​កម្មវិធី​បន្ថែម​ណា​ខ្លះ​ដែល​អ្នក​ចង់​ធ្វើ​បច្ចុប្បន្នភាព ហើយ​ចុច &#8220;ធ្វើ​បច្ចុប្បន្នភាព​កម្មវិធី​បន្ថែម&#8221;។','Error in restoring from Trash.'=>'មាន​កំហុស​ក្នុង​ការ​ស្ដារ​ចេញ​ពី​ធុងសំរាម។','Usernames cannot be changed.'=>'មិន​អាច​ប្ដូរ ឈ្មោះ​អ្នកប្រើ បាន​ទេ។','Sorry, you are not allowed to restore this item from the Trash.'=>'សុំទោស អ្នក​មិន​ត្រូវ​បាន​អនុញ្ញាត​ឲ្យ​ស្ដារ​របស់​នេះ​ចេញ​ពី​ធុងសំរាម​ទេ។','Error in moving to Trash.'=>'មាន​កំហុស​ក្នុងការ​បោះ​ចោល​ទៅ​ក្នុង​ធុងសំរាម។','Page saved.'=>'បាន​រក្សាទុក​ទំព័រ។','Grant this user super admin privileges for the Network.'=>'ផ្ដល់​ឲ្យ​អ្នក​ប្រើ​ម្នាក់​នេះ​នូវ​សិទ្ធិ​គ្រប់គ្រង​សម្រាប់បណ្ដាញ។','This user has super admin privileges.'=>'អ្នក​ប្រើ​ម្នាក់​នេះ​មាន​សិទ្ធិ​អភិបាល​កំពូល។','%s comment restored from the Trash'=>'បាន​យក​មតិ​ចំនួន %s ចេញ​ពី​ធុង​សំរាម','%s comment moved to the Trash.'=>'បាន​បោះ​ចោល​មតិ​ចំនួន %s ទៅ​ក្នុង​ធុង​សំរាម។','This will remove the background image. You will not be able to restore any customizations.'=>'នេះ​នឹង​ដក​រូប​ផ្ទៃក្រោយ​ចេញ។ អ្នក​នឹង​មិន​អាច​ស្ដារ​រាល់​ការកែតម្រូវ​ណាមួយ​មកវិញនោះ​ទេ។','Display Options'=>'ជម្រើស​ការ​បង្ហាញ','Don&#8217;t forget to click on the Save Changes button when you are finished.'=>'កុំ​ភ្លេច​ចុច រក្សា​ទុក​បន្លាស់​ប្ដូរ ពេល​អ្នក​បាន​បញ្ចប់។','Sorry, you are not allowed to move this item to the Trash.'=>'សុំទោស អ្នក​មិន​ត្រូវ​បាន​អនុញ្ញាត​ឲ្យ​បោះចោល​របស់​នេះ​ទៅ​ក្នុង​ធុងសំរាម​ទេ។','User deletion is not allowed from this screen.'=>'មិន​អាច​លុប​អ្នក​ប្រើ​តាមរយៈ​ទំព័រ​នេះ​ទេ។','Confirm Removal'=>'បញ្ជាក់​ការ​ដកចេញ','You can\'t remove the current user.'=>'អ្នក​មិន​អាច​ដក​អ្នក​ប្រើ​បច្ចុប្បន្ន​ចេញ​ទេ។','Other users have been removed.'=>'អ្នក​ប្រើ​ផ្សេង​ទៀត​ត្រូវ​បាន​ដក​ចេញ។','Error in deleting.'=>'កំហុស​ក្នុង​ការ​លុប។','If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:'=>'ប្រសិន​បើ​អ្នក​មាន​ប្រកាស ឬ​មតិ​នៅ​ក្នុង​ប្រព័ន្ធ​ដទៃ​ទៀត, WordPress អាច​នាំចូល​របស់​ទាំង​នោះ​មក​ក្នុង​វេបសាយ​នេះ​បាន។ ដើម្បី​ចាប់​ផ្ដើម សូម​ជ្រើស​ប្រព័ន្ធ​ណាមួយ​នៅ​ខាងក្រោម:','This will restore the original background image. You will not be able to restore any customizations.'=>'នេះ​នឹង​ស្ដារ​រូប​ផ្ទៃក្រោយ​ដើម​មកវិញ។ អ្នក​នឹង​មិន​អាច​ស្ដារ​រាល់​ការកែតម្រូវ​ណាមួយ​មកវិញនោះ​ទេ។','Search Installed Plugins'=>'ស្វែងរក​កម្មវិធី​បន្ថែម​ដែល​បាន​ដំឡើង','Remove Users from Site'=>'ដក​អ្នក​ប្រើ​ចេញ​ពី​វេបសាយ','You have version %1$s installed. Update to %2$s.'=>'អ្នក​មាន​ជំនាន់ %1$s ។ ធ្វើ​បច្ចុប្បន្នភាព​ទៅ %2$s ។','Remove Background Image'=>'ដក​រូប​ផ្ទៃ​ក្រោយ​ចេញ','You can customize the display of this screen in a number of ways:'=>'អ្នក​អាច​កែតម្រូវ​ការបង្ហាញ​នៃ​អេក្រង់​នេះ​តាម​វិធី​មួយ​ចំនួន:','Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.'=>'វិដជិត​អាច​នឹង​ត្រូវ​ប្រើ​ច្រើន​ដង។ អ្នក​អាច​ឲ្យ​ចំណងជើង​ទៅ​វិដជិត​នីមួយៗ ឲ្យ​វា​បង្ហាញ​នៅ​លើ​វេបសាយ​របស់​អ្នក ប៉ុន្តែ​មិន​ត្រូវ​ការ​នោះ​ទេ។','Administrators have access to all the administration features.'=>'អភិបាល មាន​សិទ្ធិ​ចូល​ទៅ​គ្រប់​មុខងារ​នៃ​ការ​គ្រប់គ្រង។','Enabling Accessibility Mode, via Screen Options, allows you to use Add and Edit buttons instead of using drag and drop.'=>'ការ​បើក "ភាព​ងាយ​ស្រួល" តាម​រយៈ​ជម្រើស​ទិដ្ឋភាព អនុញ្ញាត​ឲ្យ​អ្នក​ប្រើ​ប៊ូតុង "បន្ថែម" និង "កែប្រែ" ជំនួស​ឲ្យ​ការ​អូស​និង​ទម្លាក់។','<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.'=>'<strong>ចំណង​ជើង</strong> &mdash; បញ្ចូល​ចំណង​ជើង​សម្រាប់​ប្រកាស​នេះ។ ក្រោយ​ពី​បញ្ចូល​ចំណង​ជើង​ហើយ អ្នក​នឹង​ឃើញ​តំណ​ភ្ជាប់​នៅ​ខាង​ក្រោម​ដែល​អ្នក​អាច​កែ​បាន។','While your site is being updated, it will be in maintenance mode. As soon as your updates are complete, your site will return to normal.'=>'ខណៈ​ពេល​វេបសាយ​របស់​អ្នក​កំពុង​ត្រូវបាន​ធ្វើ​បច្ចុប្បន្នភាព វា​នឹង​ស្ថិត​ក្នុង​របៀប​ថែទាំ។ វេបសាយ​របស់​អ្នក​នឹង​ត្រឡប់​មក​ធម្មតា​វិញ នៅ​ពេល​ការ​ធ្វើ​បច្ចុប្បន្នភាព​បាន​បញ្ចប់។','<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.'=>'<strong>ការ​ពិភាក្សា</strong> &mdash; អ្នក​អាច​បិទ​បើក​ការ​ដាក់មតិ និង ការ​ភីង ហើយ​ប្រសិន​បើ​មាន​មតិ​នៅ​លើ​ប្រកាស​នោះ អ្នក​អាច​មើល​វា​នៅ​ទីនេះ ហើយ​សម្របសម្រួល​មតិ​ទាំងអស់​នោះ។','Your plugins are all up to date.'=>'កម្មវិធីបន្ថែម​របស់​អ្នក​ទាំង​អស់ គឺ​ទាន់​សម័យ​ហើយ។','You have the latest version of WordPress.'=>'អ្នក​មាន​ជំនាន់​ចុង​ក្រោយ​បំផុត​របស់ WordPress ។','Your themes are all up to date.'=>'ស្បែក​របស់​អ្នក​គឺ​ទាន់សម័យ​ហើយ។','An updated version of WordPress is available.'=>'មាន​បច្ចុប្បន្នភាព WordPress ។','ERROR:'=>'កំហុស:','Your username cannot be changed, but you can use other fields to enter your real name or a nickname, and change which name to display on your posts.'=>'ឈ្មោះ​អ្នកប្រើ​របស់​អ្នក មិន​អាច​ប្ដូរ​បាន​ទេ ប៉ុន្តែ​អ្នក​អាច​ប្រើ​វាល​ដទៃ​ទៀត​ដើម្បី​បញ្ចូល​ឈ្មោះ​ពិត ឬ​ឈ្មោះក្រៅ​របស់​អ្នក ហើយ​ផ្លាស់​ប្ដូរ​ការបង្ហាញ​ឈ្មោះ​នៅ​លើ​ប្រកាស​របស់​អ្នក។','Remember to click the Update Profile button when you are finished.'=>'សូម​ចុច​ប៊ូតុង ធ្វើ​បច្ចុប្បន្នភាព​ប្រវត្តិរូប នៅ​ពេល​អ្នក​រួចរាល់​ហើយ។','To add a new user for your site, click the Add New button at the top of the screen or Add New in the Users menu section.'=>'ដើម្បី​បន្ថែម​អ្នកប្រើ​ថ្មី​ម្នាក់​ទៅ​ក្នុង​វេបសាយ​របស់​អ្នក សូម​ចុច​ប៊ូតុង បន្ថែមថ្មី ដែល​ស្ថិត​នៅ​ផ្នែក​ខាង​លើ​នៃ​អេក្រង់ ឬ បន្ថែមថ្មី នៅ​ក្នុង​ផ្នែក​ម៉ឺនុយ អ្នកប្រើ។','Your profile contains information about you (your &#8220;account&#8221;) as well as some personal options related to using WordPress.'=>'ប្រវត្តិរូប​របស់​អ្នក​មាន​នូវ​ព័ត៌មាន​អំពី​ខ្លួន​អ្នក (&#8220;គណនី&#8221; របស់​អ្នក) ដូចជា​ជម្រើស​ផ្ទាល់ខ្លួន​ដែល​ទាក់ទង​ទៅ​នឹង​ការប្រើប្រាស់ WordPress ។','You can also create posts with the <a href="%s">Press This bookmarklet</a>.'=>'អ្នក​អាច​បង្កើត​ប្រកាស​ជាមួយ​នឹង​ធាតុ​ចំណាំ <a href="%s">Press This</a> ។','If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by <code>%</code>) will also appear in the custom structure field and your path can be further modified there.'=>'បើ​អ្នក​រើស​យក​ជម្រើស​ក្រៅ​ពីលំនាំដើម នោះផ្លូវទៅ URL ទូទៅ​របស់​អ្នក​ដែល​មាន​រចនាសម្ព័ន្ធ​ស្លាក (សព្ទដែល​ឡោមព័ទ្ធ​ដោយ <code>%</code>) ក៏​នឹង​បង្ហាញ​ក្នុង​វាល​រចនាសម្ព័ន្ធប្រអប់​ផ្ទាល់​ខ្លួន ហើយផ្លូវរបស់អ្នកនោះ​ក៏​អាច​កែសម្រួល​នៅ​ទីនោះ​ផង​ដែរ។','<strong>Please Note:</strong> Any customizations you have made to theme files will be lost. Please consider using <a href="%s">child themes</a> for modifications.'=>'<strong>សូម​ចងចាំ:</strong> រាល់​ការកែតម្រូវ​ទាំងឡាយ​ដែល​អ្នក​បាន​ធ្វើ​ទៅ​កាន់​ឯកសារ​របស់​ស្បែក​នេះ នឹង​ត្រូវ​បាត់បង់។ សូម​ពិចារណា​ការប្រើ <a href="%s">ស្បែកកូន</a> សម្រាប់​ការកែសម្រួល។','Please select one or more plugins to update.'=>'សូម​រើស​កម្មវិធី​បន្ថែម​មួយ ឬ​ច្រើន ដើម្បី​ធ្វើ​បច្ចុប្បន្នភាព។','Please select one or more themes to update.'=>'សូម​ជ្រើសរើស​រូបរាង​មួយ​ឬ​ច្រើន ដើម្បី​អាប់ដេត។','Last checked on %1$s at %2$s.'=>'បាន​ពិនិត្យ​ចុង​ក្រោយ​នៅ %1$s នៅ %2$s ។','Check Again'=>'ពិនិត្យ​ម្ដង​ទៀត','Apply Filters'=>'អនុវត្ត​ការ​ច្រោះ','Search Installed Themes'=>'ស្វែងរក​រូបរាង​ដែល​បាន​ដំឡើង','Search installed themes...'=>'ស្វែងរក​រូបរាង​ដែល​បាន​ដំឡើង...','Update WordPress Database'=>'ធ្វើ​បច្ចុប្បន្នភាព​មូលដ្ឋានទិន្នន័យ WordPress','You are about to install WordPress %s <strong>in English (US).</strong> There is a chance this update will break your translation. You may prefer to wait for the localized version to be released.'=>'អ្នក​រៀបនឹង​ដំឡើង WordPress %s <strong>ជាភាសា​អង់គ្លេស (US) ។</strong> ការ​ធ្វើ​បច្ចុប្បន្នភាព​នេះ​នឹង​លុប​ការបកប្រែ​របស់​អ្នក។ អ្នក​អាច​ចាំ​រហូត​ដល់​ជំនាន់​នេះ​ត្រូវ​បាន​បកប្រែ និង​ចេញ​ផ្សាយ។','The database update process may take a little while, so please be patient.'=>'ដំណើរការ​អាប់ដេតដេតាបេស​អាច​ត្រូវការ​ពេលមួយ​ស្របក់ ដូច្នេះ​សូមមេត្តាអត់ធ្មត់។','WordPress &rsaquo; Update'=>'WordPress &rsaquo; ធ្វើ​បច្ចុប្បន្នភាព','Super admin privileges cannot be removed because this user has the network admin email.'=>'មិន​អាច​ឯកសិទ្ធិ​អ្នក​គ្រប់គ្រង​កំពូល​បាន​ទេ ព្រោះ​អ្នកប្រើ​នេះ​មាន​អ៊ីមែល​គ្រប់គ្រង​បណ្ដាញ។','Update Complete'=>'ធ្វើ​បច្ចុប្បន្នភាព​រួចរាល់','Email or Username'=>'អ៊ីមែល ឬឈ្មោះ​អ្នក​ប្រើ','Remember to click Update Media to save metadata entered or changed.'=>'សូម​ចុច ធ្វើ​បច្ចុប្បន្នភាព​មេឌា ដើម្បី​រក្សាទុក​ទិន្នន័យ​មេតា​ដែល​បាន​បញ្ចូល ឬ​បាន​កែប្រែ។','Database Update Required'=>'ត្រូវ​ការ​បច្ចុប្បន្នភាព​មូលដ្ឋាន​ទិន្នន័យ','The boxes on your Dashboard screen are:'=>'ប្រអប់​នានា​នៅ​ទំព័រ​គ្រប់គ្រង​របស់​អ្នក​គឺ​ជា៖','No Update Required'=>'មិនត្រូវការ​ការ​ធ្វើ​បច្ចុប្បន្នភាព','This plugin may be active on other sites in the network.'=>'កម្មវិធី​បន្ថែម​មួយ​នេះ​អាច​នឹង​សកម្ម​ដែរ​នៅ​លើ​វេបសាយ​ដទៃ​ទៀត​ក្នុង​បណ្ដាញ​នេះ។','userAdd Existing'=>'បន្ថែម​មាន​ស្រាប់','&larr; Back to Users'=>'&larr; ត្រឡប់​ទៅ អ្នក​ប្រើ','Main menu'=>'បញ្ជី​ដើម','You have specified these users for deletion:'=>'អ្នកបានបញ្ជាក់ការលុបសម្រាប់អ្នកប្រើទាំងនេះ:','You have specified this user for deletion:'=>'អ្នក​បាន​កំណត់​បញ្ជាក់​អ្នកប្រើ​ទាំង​នេះ សម្រាប់​ការ​លុប៖','This importer is not installed. Please install importers from <a href="%s">the main site</a>.'=>'កម្មវិធី​នាំចូល​នេះ​មិន​ត្រូវ​បាន​ដំឡើង។ សូម​ដំឡើង​កម្មវិធី​នាំចូល​ពី <a href="%s">វេបសាយ​ដើម</a>។','removing-widgetDeactivate'=>'មិន​ដំណើរ​ការ','Collapse menu'=>'លាក់​ម៉ឺនុយ','Don&#8217;t you wish all software came with these freedoms? So do we! For more information, check out the <a href="https://www.fsf.org/">Free Software Foundation</a>.'=>'តើ​អ្នក​មិន​ប្រាថ្នា​ឲ្យ​សូហ្វវែទាំង​អស់​មក​ជាមួយ​នឹង​សេរីភាព​ទាំង​នេះ​ទេឬ? ពួក​យើងក៏​ប្រាថ្នា​ដូច្នោះដែរ! សម្រាប់​ព័ត៌មាន​បន្ថែម សូម​ចូល​មើល <a href="https://www.fsf.org/">មូលនិធិ​សុសវែរ​ឥត​គិត​ថ្លៃ</a>។','Re-install Now'=>'ដំឡើង​ម្ដង​ទៀត​ឥឡូវ','theme nameName'=>'ឈ្មោះ','<strong>ERROR</strong>: options page not found.'=>'<strong>កំហុស</strong>: រក​មិន​ឃើញ​ទំព័រ​ជម្រើស។','Post name'=>'ឈ្មោះ​ប្រកាស','sample permalink structuresample-post'=>'sample-post','sample permalink basearchives'=>'បណ្ណសារ','Add New User'=>'បន្ថែម​អ្នក​ប្រើ​ថ្មី','About Pages'=>'ទំព័រ​អំពី','View version %s details.'=>'មើល​សេចក្តីលម្អិត​អំពី​ជំនាន់ %s។','You can use the following controls to arrange your Dashboard screen to suit your workflow. This is true on most other administration screens as well.'=>'អ្នក​អាច​ប្រើ​ការ​បញ្ជា​ទាំង​នេះ ដើម្បី​រៀបចំ​សណ្ឋាន​ទំព័រ​ព័ត៌មាន​របស់​របស់​អ្នក។ ហើយ​អ្នក​ក៏​អាច​រៀបចំ​នៅ​ក្នុង​កន្លែង​ផ្សេងៗ​ទៀត​នៃ​ទំព័រ​អភិបាល​បាន​ដែរ។','User added.'=>'បាន​បន្ថែម​អ្នក​ប្រើ។','You can&#8217;t remove users.'=>'អ្នក​មិន​អាច​ដក​អ្នកប្រើ​ចេញ​ទេ។','Changed roles.'=>'បាន​ប្ដូរ​តួនាទី។','User removed from this site.'=>'បាន​ដក​អ្នក​ប្រើ​ចេញពី​វេបសាយ​នេះ។','Add Existing User'=>'បន្ថែម​អ្នក​ប្រើ​ដែល​មាន​ស្រាប់','Customizing This Display'=>'កែ​តម្រូវ​ការ​បង្ហាញ​នេះ','Title and Post Editor'=>'ចំនង​ជើង និង​កម្មវិធី​កែ​សម្រួល​ប្រកាស','userAdd New'=>'បន្ថែម​ថ្មី','Installing themes on Multisite can only be done from the Network Admin section.'=>'ការ​ដំឡើង​រូបរាង​លើ​ពហុវេបសាយ អាច​ធ្វើ​ទៅ​បាន​ពី​ទីកន្លែង​គ្រប់គ្រង​បណ្ដាញ។','Permalinks are the permanent URLs to your individual pages and blog posts, as well as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.'=>'តំណ​អចិន្ត្រៃយ៍ គឺ​ជា URL អចិន្ត្រៃយ៍​ទាំង​ឡាយ​ចំពោះ​ទំព័រ​និង​អត្ថបទ​ប្រកាស​និមួយៗ​របស់​អ្នក ក៏​ដូចជា​បណ្ណសារ​ចំណាត់​ក្រុម​និង​ស្លាក​ដែរ។ តំណ​អចិន្ត្រៃយ៍​គឺ​ជា​អាសយដ្ឋាយ​វេប​ដែល​ត្រូវ​បាន​ប្រើ ដើម្បី​ភ្ជាប់​ទៅ​មាតិកា​របស់​អ្នក។ URL ចំពោះ​ប្រកាស​នីមួយៗ​គួរ​តែ​ស្ថិត​នៅ​ជា​អចិន្ត្រៃយ៍ និង​មិន​ត្រូវ​បាន​ប្ដូរ។','If you want to convert your categories to tags (or vice versa), use the <a href="%s">Categories and Tags Converter</a> available from the Import screen.'=>'បើ​អ្នក​ចង់​បំប្លែង​ចំណាត់ក្រុម​របស់​អ្នក​ទៅ​ជា​ស្លាក (ឬ​ត្រឡប់​គ្នា​វិញ), សូម​ប្រើ <a href="%s">កម្មវិធី​បំប្លែង​ចំណាត់ក្រុម និង​ស្លាក</a> ដែល​អាច​រក​បាន​នៅ​ទំព័រ នាំចូល។','Remember to click the Add New User button at the bottom of this screen when you are finished.'=>'សូម​ចុច​ប៊ូតុង បន្ថែម​អ្នក​ប្រើ​ថ្មី ដែល​ស្ថិត​នៅ​ផ្នែក​ខាង​ក្រោម​នៃ​ទំព័រ នៅ​ពេល​អ្នក​រួចរាល់​ហើយ។','<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bug.'=>'<strong>ជំនាន់ %1$s</strong> បាន​ដោះ​ស្រាយ​បញ្ហា​សុវត្ថិភាព និង​ជួស​ជុល​កំហុស​ចំនួន %2$s ។','Inactive Sidebar (not used)'=>'របារខាង​ដែល​មិន​សកម្ម (មិន​បាន​ប្រើ)','This screen allows you to choose your permalink structure. You can choose from common settings or create custom URL structures.'=>'ស្ក្រីននេះ​អនុញ្ញាត ​ឲ្យ​អ្នក​រើស​រចនាសម្ព័ន្ធ​តំណ​ជាក់លាក់​របស់​អ្នក។ អ្នក​អាចជ្រើស​រើស ពី​ការកំណត់​ដែលសាមញ្ញ ឬ​បង្កើត​រចនាសម្ព័ន្ធ URL ផ្ទាល់ខ្លួន។','Attaching Files'=>'កំពុង​ភ្ជាប់​ឯកសារ','Here is a basic overview of the different user roles and the permissions associated with each one:'=>'នេះ​ជា​ទិដ្ឋភាព​ទូទៅ​ស្ដី​អំពី​តួនាទី​និមួយៗ​របស់​អ្នក​ប្រើ និង​សិទ្ធិ​ដែល​មាន​នៅ​ក្នុង​តួនាទី​ទាំងនោះ:','User Roles'=>'តួនាទី​អ្នកប្រើ','To add a new user to your site, fill in the form on this screen and click the Add New User button at the bottom.'=>'ដើម្បី​បន្ថែម​អ្នកប្រើ​ថ្មី​ម្នាក់​ទៅ​ក្នុង​វេបសាយ​របស់​អ្នក សូម​បំពេញ​បែបបទ​ដែល​មាន​បង្ហាញ ហើយ​ចុច​បូតុង បន្ថែម​អ្នក​ប្រើ​ថ្មី ដែល​ស្ថិត​នៅ​ផ្នែក​ខាង​ក្រោម។','<strong>Drag and drop</strong> your files into the area below. Multiple files are allowed.'=>'<strong>អូស​និង​ទម្លាក់</strong>​ឯកសារ​នានា​មក​ក្នុង​តំបន់​ខាង​ក្រោម​នេះ។ អាច​ប្រើ​ឯកសារ​ច្រើន​រួមគ្នា​បាន។','For more information, see <a href="%s">the release notes</a>.'=>'សម្រាប់​ព័ត៌មាន​បន្ថែម សូម​មើល <a href="%s">កំណត់​ត្រា​ចេញ​ផ្សាយ</a>។','Unable to submit this form, please refresh and try again.'=>'មិន​អាច​ដាក់​ស្នើ​ទម្រង់​នេះ​បាន​ទេ សូម​ផ្ទុក​ឡើង​វិញ ហើយ​សាក​ល្បង​ម្ដង​ទៀត។','Moderating Comments'=>'ការ​សម្រប​សម្រួល​មតិ','Removing and Reusing'=>'ការ​ដក​ចេញ និង ការ​ប្រើ​ឡើង​វិញ','Links in the Toolbar at the top of the screen connect your dashboard and the front end of your site, and provide access to your profile and helpful WordPress information.'=>'តំណ​នៅ​របារឧបករណ៍​ផ្នែក​ខាង​លើ ធ្វើ​ការ​តភ្ជាប់​រវាង​ទំព័រ​ព័ត៌មាន និង​ផ្នែក​ខាង​មុខ​នៃ​វេបសាយ​របស់​អ្នក ហើយ​ផ្ដល់​ការ​ចូល​ទៅ​កាន់​ប្រវត្តិរូប​របស់​អ្នក និង​ព័ត៌មាន WordPress សំខាន់ៗ។','If the importer you need is not listed, <a href="%s">search the plugin directory</a> to see if an importer is available.'=>'ប្រសិនបើ​ឧបករណ៍​នាំចូល​ដែល​អ្នក​ត្រូវការ មិនមាន​ក្នុង​បញ្ជី​ទេ សូម​<a href="%s">ស្វែងរក​នៅ​ក្នុង​ឃ្លាំង​កម្មវិធី​បន្ថែម</a> ដើម្បី​រក​មើល​វា។','Return to Updates'=>'ត្រឡប់​ទៅ​ការ​ធ្វើ​បច្ចុប្បន្នភាព','Maintenance and Security Release'=>'ការ​ចេញ​ផ្សាយ​តំហែ​ទាំង និង​សុវត្ថិភាព','Available Actions'=>'សកម្មភាព​ដែល​មាន','Authors can publish and manage their own posts, and are able to upload files.'=>'អ្នក​និពន្ធ​អាច​ផ្សាយ​និង​គ្រប់គ្រង​ប្រកាស​របស់​ពួក​គេ​បាន ហើយ​ក៏​អាច​ផ្ទុក​ឯកសារ​ឡើង​បាន​ដែរ។','How to Update'=>'របៀប​ធ្វើ​បច្ចុប្បន្នភាព','Missing Widgets'=>'វិដជិត​ដែល​ខ្វះ','Screen Content'=>'មាតិកា​អេក្រង់','Adding Themes'=>'ការ​បន្ថែម​រូបរាង','You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.'=>'អ្នក​អាច​លាក់​ឬ​បង្ហាញ​ជួរ​ឈរ ដោយ​ផ្អែក​លើ​តម្រូវការ​របស់​អ្នក និង​សម្រេច​អំពី​ចំនួន​អ្នក​ប្រើ​ដែល​ត្រូវ​បង្ហាញ​នៅ​ក្នុង​ទំព័រ​និមួយៗ​តាមរយៈ​ផ្ទាំង «ជម្រើស​បង្ហាញ»។','<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bug.'=>'<strong>ជំនាន់ %1$s</strong> បាន​ដោះ​ស្រាយ​បញ្ហា​សុវត្ថិភាព និង​ជួស​ជុល​កំហុស​ចំនួន %2$s ។','Common Settings'=>'ការកំណត់​ទូទៅ','Troubleshooting'=>'ការដោះស្រាយ​បញ្ហា','Go to Dashboard &rarr; Home'=>'ទៅ​កាន់​ទំព័រ​ព័ត៌មាន &rarr; ទំព័រ​ដំបូង','Return to Dashboard &rarr; Updates'=>'ត្រឡប់​ទៅ​ទំព័រ​ព័ត៌មាន &rarr; បច្ចុប្បន្នភាព','<strong>Version %1$s</strong> addressed %2$s bug.'=>'<strong>ជំនាន់ %1$s</strong> បាន​ដោះស្រាយ​កំហុស​ចំនួន %2$s ។','Security Release'=>'ការ​ចេញ​ផ្សាយ​សុវត្ថិភាព','Maintenance Release'=>'ការ​ចេញ​ផ្សាយ​តំហែ​ទាំ','Profile updated.'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព​ប្រវត្តិរូប។','You can upload media files here without creating a post first. This allows you to upload files to use with posts and pages later and/or to get a web link for a particular file that you can share. There are three options for uploading files:'=>'អ្នក​អាច​ផ្ទុក​ឡើង​នូវ​ឯកសារ​មេឌា​នានា​នៅ​ទីនេះ ដោយ​មិន​បាច់​បង្កើត​ប្រកាស​ជាមុន​ទេ។ នេះ​អនុញ្ញាត​ឲ្យ​អ្នក​ផ្ទុក​ឡើង​នូវ​ឯកសារ សម្រាប់​ការ​ប្រើប្រាស់​ជាមួយ​ប្រកាស​និង​ទំព័រ​នៅ​ពេលក្រោយ ឬ​ក៏​ទទួល​យក​តំណ​សម្រាប់​ឯកសារ​ណាមួយ​ដែល​អ្នក​អាច​យក​ទៅ​ចែករំលែក​បាន។ មាន​ជម្រើស​បី​សម្រាប់​ការ​ផ្ទុកឡើង​ឯកសារ៖','Show Toolbar when viewing site'=>'បង្ហាញ​របារឧបករណ៍​ពេល​កំពុង​មើល​វេបសាយ','Hi,

You\'ve been invited to join \'%1$s\' at
%2$s with the role of %3$s.

Please click the following link to confirm the invite:
%4$s'=>'សួស្ដី,

អ្នក​ត្រូវ​បាន​អញ្ជើញ​ឲ្យ​ចូលរួម \'%1$s\' នៅ
%2$s ក្រោម​តួនាទី​ជា %3$s។

សូម​ចុច​តំណ​ខាង​ក្រោម​នេះ​ដើម្បី​បញ្ជាក់​ការ​អញ្ជើញ:
%4$s','<strong>Version %s</strong> addressed some security issues.'=>'<strong>ជំនាន់ %s</strong> បាន​ដោះស្រាយ​បញ្ហា​សុវត្ថិភាពមួយចំនួន។','Profile Picture'=>'រូបភាពប្រូហ្វាល់','You can view all posts made by a user by clicking on the number under the Posts column.'=>'អ្នក​អាច​មើល​ប្រកាស​របស់​អ្នកប្រើ​ណា​ម្នាក់ ដោយ​ចុច​លើ​លេខ​ដែល​ស្ថិត​នៅ​ខាង​ក្រោម​ជួរឈរ ប្រកាស។','The active theme is broken. Reverting to the default theme.'=>'រូបរាង​ដែល​ប្រើ​នោះ មាន​បញ្ហា​ហើយ។ កំពុង​ប្រែ​ត្រឡប់​ទៅ​រូបរាង​លំនាំ​ដើម​វិញ។','There is an autosave of this post that is more recent than the version below. <a href="%s">View the autosave</a>'=>'មាន​ការរក្សាទុក​ដោយ​ស្វ័យប្រវត្តិ​មួយ​នៃ​ប្រកាស​នេះ ដែល​ថ្មី​ជាង​កំណែ​ខាង​ក្រោម ។<a href="%s">មើល​ការរក្សាទុក​ដោយ​ស្វ័យប្រវត្តិ</a>','Enter the email address or username of an existing user on this network to invite them to this site. That person will be sent an email asking them to confirm the invite.'=>'បញ្ចូល​អាសយដ្ឋាន​អ៊ីមែល ឬ​ឈ្មោះ​អ្នក​ប្រើ​របស់​អ្នក​ណា​ម្នាក់​នៅ​លើ​បណ្ដាញ​នេះ ដើម្បី​អញ្ជើញ​ពួកគេ​មក​ក្នុង​វេបសាយ​នេះ។ ម្នាក់​នោះ​នឹង​ទទួល​បាន​អ៊ីមែល ដើម្បី​បញ្ជាក់​ការ​អញ្ជើញ។','You should update your web.config now.'=>'អ្នក​គួរ​តែ​ធ្វើ​បច្ចុប្បន្នភាព web.config របស់​អ្នក​ឥឡូវ​នេះ។','This theme has not been rated yet.'=>'រូបរាងនេះមិនទាន់ត្រូវបានវាយតម្លៃនៅឡើយទេ។','<strong>Welcome</strong> &mdash; Shows links for some of the most common tasks when setting up a new site.'=>'<strong>សូមស្វាគមន៍</strong> - បង្ហាញ​តំណ​ទៅកាន់​កិច្ចការ​សំខាន់ៗ នៅ​ពេល​ដំឡើង​វេបសាយ​ថ្មី​មួយ។','Edit comment'=>'កែ​មតិ','Set as background'=>'ដាក់​ទៅ​ផ្ទៃ​ក្រោយ','User deleted.'=>'បាន​លុប​អ្នក​ប្រើ %s នាក់។','New user created. <a href="%s">Edit user</a>'=>'បាន​បង្កើត​អ្នក​ប្រើ​ថ្មី។ <a href="%s">កែ​អ្នក​ប្រើ</a>','Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.'=>'ចំណាត់ក្រុម មាន​លំដាប់​ថ្នាក់ ដែល​មាន​ន័យ​ថា​អ្នក​អាច​រៀបចំ​ឲ្យ​មាន​ចំណាត់ក្រុម​ក្នុង​ចំណាត់​ក្រុម។ ស្លាក មិន​មាន​លំដាប់​ថ្នាក់​ទេ ហើយ​អ្នក​ក៏​មិន​អាច​រៀបចំ​វា​ចូល​គ្នា​ដែរ។ ពេល​ខ្លះ អ្នក​ប្រើប្រាស់​ចាប់​ផ្ដើម​ប្រើ​ពួកវា​នៅ​លើ​អត្ថបទ​របស់​ពួកគេ ហើយ​ក្រោយ​មក​ទើប​នឹក​ឃើញ​ថាបើ​ប្រើ​ផ្សេង​មួយ​ទៀត ប្រហែល​ជា​ល្អ​ប្រសើរ​ជាង។','Previewing and Installing'=>'ការ​មើល​ជាមុន និង​ការ​ដំឡើង','Previewing and Customizing'=>'ការ​មើល​ជាមុន និង​ការ​កែ​តម្រូវ','Select Image'=>'រើស​រូបភាព','Or choose an image from your media library:'=>'ឬ​ក៏​រើស​រូប​ភាព​មួយ​ពី​បណ្ណាល័យ​មេឌា​របស់​អ្នក:','This screen allows you to edit four fields for metadata in a file within the media library.'=>'ទំព័រ​នេះ​អនុញ្ញាត​ឲ្យ​អ្នក​កែ​វាល​ទាំង​បួន​របស់ ទិន្នន័យ​មេតា ក្នុង​ឯកសារ​ដែល​មាន​នៅ​បណ្ណាល័យ​មេឌា។','Please select an option.'=>'សូម​រើស​ជម្រើស​មួយ។','ID #%1$s: %2$s <strong>The current user will not be deleted.</strong>'=>'ID #%1$s: %2$s <strong>អ្នកប្រើ​បច្ចុប្បន្ន​នេះ នឹង​មិន​ត្រូវ​បាន​លុប​ទេ។</strong>','ID #%1$s: %2$s'=>'ID #%1$s: %2$s','You can also choose a background color by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'អ្នក​អាច​រើស​ពណ៌​ផ្ទៃក្រោយ​ដោយ​ចុច​លើ​ប៊ូតុង រើសពណ៌ ហើយ​សូម​វាយ​បញ្ចូល​តម្លៃ​គោល​ដប់ប្រាំមួយ, ឧទា. &#8220;#ff0000&#8221; សម្រាប់​ពណ៌​ក្រហម, ឬក៏​រើស​ពណ៌​ដោយ​ប្រើ​ប្រដាប់​រើស​ពណ៌។','Inserting Media'=>'ការ​បញ្ចូល​មេឌា','Edit your default menu by adding or removing items. Drag each item into the order you prefer. Click Create Menu to save your changes.'=>'កែ​ម៉ឺនុយ​លំនាំដើម​របស់​អ្នក ដោយ​ការបន្ថែម ឬ​ដក​ធាតុ​ចេញ។ ទាញអូស​ធាតុ​និមួយៗ​ទៅតាម​លំដាប់​ដែល​អ្នក​ចង់​បាន។ ចុច បង្កើត​ម៉ឺនុយ ដើម្បី​រក្សា​ទុក​បន្លាស់ប្ដូរ​របស់​អ្នក។','Give your menu a name, then click Create Menu.'=>'ផ្ដល់​ឈ្មោះ​ម៉ឺនុយ​របស់​អ្នក ហើយ​ចុច បង្កើត​ម៉ឺនុយ។','Auto add pages'=>'បន្ថែម​ទំព័រ​ដោយ​ស្វ័យ​ប្រវត្តិ','Select a menu to edit:'=>'រើស​មួយ​ដើម្បី​កែ:','You cannot move this item to the Trash. %s is currently editing.'=>'អ្នក​មិន​អាច​បោះ​របស់​នេះ​ចោល​ទៅ​ក្នុង​ធុង​សំរាម​ទេ។ %s កំពុង​ធ្វើ​ការ​កែសម្រួល។','Menu Settings'=>'ការកំណត់​ម៉ឺនុយ','Denied: %s'=>'បាន​បដិសេធ: %s','This screen is used for managing your content revisions.'=>'ទំព័រ​នេះ​ត្រូវ​បាន​ប្រើប្រាស់​សម្រាប់​គ្រប់គ្រង​កំណែសម្រួល​មាតិកា​របស់​អ្នក។','From this screen you can review, compare, and restore revisions:'=>'នៅ​ទំព័រ​នេះ អ្នក​អាច​ពិនិត្យ, ប្រៀបធៀប និង​ស្ដារ​យក​កំណែ​សម្រួល​នានា:','To restore a revision, <strong>click Restore This Revision</strong>.'=>'ដើម្បីស្តារនូវកំណែរសម្រួលណាមួយ <strong>សូមចុចលើ ស្តារការពិនិត្យនេះឡើងវិញ</strong>។','Drag each item into the order you prefer. Click the arrow on the right of the item to reveal additional configuration options.'=>'ទាញ​អូស​ធាតុ​នីមួយៗ ទៅ​តាម​លំដាប់​ដែល​អ្នក​ចង់​បាន។ ចុច​ព្រួញ​ដែល​នៅ​ខាង​ស្ដាំ​ធាតុ​នោះ ដើម្បី​បង្ហាញ​ជម្រើស​នៃ​ការ​កំណត់​រចនា​សម្ពន្ធ​បន្ថែម។','The item you are trying to move to the Trash no longer exists.'=>'មិន​មាន​ឯកសារ​ដែល​អ្នក​ព្យាយាម​លុប​ទៅ​ក្នុង​ធុង​សំរាម​ទៀត​ទេ។','The item you are trying to restore from the Trash no longer exists.'=>'មិន​មាន​ឯកសារ​ដែល​អ្នក​ព្យាយាម​ស្ដារ​ពី​ធុង​សំរាម​ទៀត​ទេ។','This item has already been deleted.'=>'របស់​នេះ​ត្រូវ​បាន​លុប​រួច​ហើយ។','Repeat New Password'=>'បញ្ចូល​ពាក្យសម្ងាត់​ថ្មី​ឡើង​វិញ','<strong>Connection lost.</strong> Saving has been disabled until you&#8217;re reconnected.'=>'<strong>បាត់បង់​ការ​តភ្ជាប់។</strong> ការ​រក្សា​ទុក​ត្រូវ​បាន​បិទ​រហូត​ដល់​ពេល​អ្នក​ត្រូវ​បាន​តភ្ជាប់​វិញ។','We&#8217;re backing up this post in your browser, just in case.'=>'យើង​ចម្លង​ទុក​ប្រកាស​នេះ​នៅ​លើ​កម្មវិធី​រុករក ជា​ការ​ការពារ។','The sizes listed below determine the maximum dimensions in pixels to use when adding an image to the Media Library.'=>'ខ្នាត​ដែល​បាន​បញ្ជាក់​ខាង​ក្រោម​កំណត់​ទំហំ​ជា​ភិកសែល ដើម្បី​ប្រើ​នៅ​ពេល​អ្នក​បញ្ចូល​រូប​ភាព​ទៅ​បណ្ណាល័យ​មេឌា។','Create a brand new user and add them to this site.'=>'បង្កើត​អ្នក​ប្រើ​ថ្មី​មួយ ហើយ​បន្ថែម​គេ​ចូល​ក្នុង​វេបសាយ​នេះ។','Future security updates will be applied automatically.'=>'ការ​ធ្វើ​បច្ចុប្បន្នភាព​សុវត្ថិភាព​នៅ​ពេល​ខាង​មុខ នឹង​ត្រូវ​អនុវត្ត​ដោយ​ស្វ័យ​ប្រវត្តិ។','Translations'=>'ការបកប្រែ','Your translations are all up to date.'=>'ការ​បក​ប្រែ​ទាំង​អស់​របស់​អ្នក​បាន​ធ្វើ​បច្ចុប្បន្នភាព។','<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.'=>'<strong>ជម្រើស​ការ​បង្ហាញ</strong> &mdash; ប្រើ ជម្រើស​ការ​បង្ហាញ ដើម្បី​រើស​ប្រអប់​ណា​ខ្លះ​ដែល​ត្រូវ​បង្ហាញ​ក្នុង ទំព័រ​ព័ត៌មាន។','<strong>Activity</strong> &mdash; Shows the upcoming scheduled posts, recently published posts, and the most recent comments on your posts and allows you to moderate them.'=>'<strong>សកម្មភាព</strong> - បង្ហាញ​ប្រកាស​កំណត់​ពេល​ដែល​ជិត​មក​ដល់, ប្រកាស​ដែល​បាន​ផ្សាយ​ថ្មី និង​មតិ​ថ្មីៗ​នៅ​លើ​ប្រកាស​របស់​អ្នក ហើយ​អនុញ្ញាត​ឲ្យ​អ្នក​សម្របសម្រួលពួកគេ​បាន។','Are you sure you want to delete this theme?

Click \'Cancel\' to go back, \'OK\' to confirm the delete.'=>'តើ​អ្នក​ពិត​ជា​ចប់​លុប​រូបរាងនេះ​មែនទេ?

ចុច \'បោះបង់\' ដើម្បី​បក​ក្រោយ, ចុច \'ព្រម\' ដើម្បី​លុប។','Add New Theme'=>'បន្ថែម​រូបរាង​ថ្មី','Add new themeAdd New'=>'បន្ថែម​ថ្មី','Sorry, you are not allowed to import content.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឪ្យនាំចូលមាតិកាទេ។','Add Widget'=>'បន្ថែម​វិដជិត','This screen is used for managing your installed themes. Aside from the default theme(s) included with your WordPress installation, themes are designed and developed by third parties.'=>'ទំព័រ​នេះ​ត្រូវបាន​ប្រើ ដើម្បី​គ្រប់គ្រង​រូបរាង​ដែល​បាន​ដំឡើង។ រូបរាង​ដែល​មាន​ក្រៅ​ពី​រូបរាង​លំនាំ​ដើម គឺ​សុទ្ធ​តែ​ត្រូវ​បាន​រចនា​និង​អភិវឌ្ឍ​ដោយ​ភាគី​ទី​បី។','Click on the theme to see the theme name, version, author, description, tags, and the Delete link'=>'ចុច​លើ​រូបរាង ដើម្បី​មើល​ឈ្មោះ ជំនាន់ អ្នក​បង្កើត ការ​ពិពណ៌នា ស្លាក និង​តំណ​លុប។','If you would like to see more themes to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional themes from the <a href="%s">WordPress Theme Directory</a>. Themes in the WordPress Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!'=>'ប្រសិន​បើ​អ្នក​ចង់​មើល​​រូបរាងជា​ច្រើន​ទៀត​ដើម្បី​ជ្រើសរើស សូម​ចុច​លើ​ប៊ូតុង &#8220;បន្ថែម​ថ្មី&#8221; នោះ​អ្នក​នឹង​អាច​រុករក ឬ​ស្វែងរក​រូបរាង​បន្ថែម​ពី <a href="%s">ទីតាំងរូបរាងរបស់ WordPress</a>។ ​រូបរាង​នៅ​ក្នុងទីតាំងរូបរាងរបស់ WordPress ត្រូវ​បាន​រចនា និង​អភិវឌ្ឍ​ដោយ​ភាគី​ទីបី និង​មាន​ភាព​ស្របគ្នា​ជាមួយ​នឹង​អាជ្ញា​ប័ណ្ណ​ដែល WordPress ប្រើប្រាស់។ អូ៎ ហើយ​វា​មិន​គិត​ថ្លៃ​ឡើយ!','On this screen, you can update to the latest version of WordPress, as well as update your themes, plugins, and translations from the WordPress.org repositories.'=>'នៅ​លើ​អេក្រង់​នេះ អ្នក​អាច​ធ្វើ​បច្ចុប្បន្ន​ភាព​ជំនាន់​ចុង​ក្រោយ​បំផុត​នៃ WordPress ក៏​ដូច​ជា​ធ្វើ​បច្ចុប្បន្ន​ភាព​រូបរាង ​កម្មវិធី​បន្ថែម​នឹង ការបកប្រែ ពី​ឃ្លាំងរបស់ WordPress.org ។','<strong>Themes and Plugins</strong> &mdash; To update individual themes or plugins from this screen, use the checkboxes to make your selection, then <strong>click on the appropriate &#8220;Update&#8221; button</strong>. To update all of your themes or plugins at once, you can check the box at the top of the section to select all before clicking the update button.'=>'<strong>រូបរាង និង​កម្មវិធី​បន្ថែម</strong> &mdash; ដើម្បី​ធ្វើ​បច្ចុប្បន្នភាព​​រូបរាង ឬ​កម្មវិធី​បន្ថែម​ណា​មួយ​នៅ​​អេក្រង់​នេះ សូម​ប្រើ​ប្រអប់​ពិនិត្យ​ដើម្បី​ជ្រើសរើស បន្ទាប់​មក <strong>ចុច​លើ​ប៊ូតុង &#8220;ធ្វើ​បច្ចុប្បន្ន​ភាព&#8221;</strong> ។ ដើម្បី​ធ្វើ​បច្ចុប្បន្នភាព​រូបរាង ឬ​កម្មវិធី​ទាំង​អស់​តែ​ម្ដង អ្នក​អាច​ធីក​ក្នុង​ប្រអប់​ដែល​ស្ថិត​នៅ​លើ​ផ្នែក​នោះ​ដើម្បី​ជ្រើស​ទាំង​អស់ មុន​ពេល​ចុច​ប៊ូតុង​ធ្វើ​បច្ចុប្បន្នភាព។','If an update is available, you&#8127;ll see a notification appear in the Toolbar and navigation menu.'=>'ប្រសិន​បើ​មាន​ការ​ធ្វើ​បច្ចុប្បន្នភាព​នោះ អ្នក​នឹង​ឃើញ​ការ​ជូន​ដំណឹង​នៅ​ក្នុង​របារ​ឧបករណ៍ និង​ម៉ឺនុយ​នាំ​ទិស។','In most cases, WordPress will automatically apply maintenance and security updates in the background for you.'=>'នៅ​ក្នុង​ករណី​ជា​ច្រើន WordPress នឹង​អនុវត្ត​ការ​ថែទាំ និង​ការ​ធ្វើ​បច្ចុប្បន្ន​ភាព​សុវត្ថិភាព​តាម​ផ្ទៃ​ក្រោយ​ជូន​អ្នក។','Thank you for creating with <a href="%s">WordPress</a>.'=>'អរគុណ​អ្នក​សម្រាប់​ការ​បង្កើត​ជាមួយ <a href="%s">WordPress</a>។','<strong>WordPress</strong> &mdash; Updating your WordPress installation is a simple one-click procedure: just <strong>click on the &#8220;Update Now&#8221; button</strong> when you are notified that a new version is available.'=>'<strong>WordPress</strong> &mdash; ការ​ធ្វើ​បច្ចុប្បន្ន​ភាព​នៃ​ការ​ដំឡើង WordPress គឺ​មាន​ភាព​សាមញ្ញ​ដោយ​ការ​ចុច​តែ​ម្ដង៖ ដោយ​គ្រាន់​តែ <strong>ចុច​លើ​ប៊ូតុង &#8220;ធ្វើ​បច្ចុប្បន្ន​ភាព​ឥឡូវ&#8221;</strong> នៅ​ពេល​មាន​ការ​ជូន​ដំណឹង​អំពី​ជំនាន់​ថ្មី។','<strong>Translations</strong> &mdash; The files translating WordPress into your language are updated for you whenever any other updates occur. But if these files are out of date, you can <strong>click the &#8220;Update Translations&#8221;</strong> button.'=>'<strong>ការ​បក​ប្រែ</strong> &mdash; ឯកសារ​បក​ប្រែ WordPress ទៅជា​ភាសា​របស់​អ្នក​ត្រូវ​បាន​ធ្វើ​បច្ចុប្បន្នភាព​សម្រាប់​អ្នក នៅ​ពេល​ណា​មាន​បច្ចុប្បន្នភាព​ថ្មី​កើត​ឡើង។ តែ​បើ​ឯកសារ​ទាំង​នេះ​ហួស​សម័យ​ទៅ​ហើយ អ្នក​អាច​<strong>ចុច​ប៊ូតុង &#8220;ធ្វើ​បច្ចុប្បន្នភាព​ការ​បក​ប្រែ&#8221;</strong>។','%s (The year of the post, four digits, for example 2004.)'=>'%s (ឆ្នាំនៃការចេញប្រកាស, មានលេង ៤ ខ្ទង់, ឧទាហរណ៍ ២០០៤។)','&larr; Return to editor'=>'&larr; ត្រឡប់​ទៅ​កម្មវិធី​និពន្ធ','Add Themes'=>'បន្ថែម​រូបរាង','Search Themes'=>'ស្វែងរក​រូបរាង','Search themes...'=>'ស្វែងរក​រូបរាង...','themeDetails &amp; Preview'=>'លម្អិត &amp; មើល​ជាមុន','What should be done with content owned by this user?'=>'តើ​គួរ​តែ​ធ្វើ​អ្វី​ចំពោះ​មាតិកា​ដែល​ជា​របស់​អ្នក​ប្រើ​នេះ?','What should be done with content owned by these users?'=>'តើគួរធ្វើបែបណាជាមួយនឹងមាតិកាដែលជារបស់អ្នកប្រើប្រាស់ទាំងនេះ?','<strong>Delete</strong> brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using Bulk Actions.'=>'<strong>ការ​លុប</strong>នាំអ្នកទៅដល់ផ្ទាំង «លុបអ្នកប្រើ» សម្រាប់បញ្ជាក់ម្ដងទៀត, ជាទីកន្លែង​ដែល​អ្នកអាច​លុបអ្នក​ប្រើជា​អចិន្ត្រៃយ៍​ពី​ពីវេបសាយរបស់​អ្នក និង​លុបមាតិកា​របស់គេ។ អ្នក​អាច​លុប​អ្នក​ប្រើ​ចេញបានច្រើននាក់​នៅ​ពេល​តែមួយដោយ​​​ប្រើ «សកម្មភាពជាបណ្ដុំ»។','themesPopular'=>'ដែល​ពេញ​និយម','A red bar on the left means the comment is waiting for you to moderate it.'=>'របារ​ពណ៌​ក្រហម​នៅ​ខាង​ឆ្វេង​មាន​ន័យ​ថា​មតិ​កំពុង​រង់ចាំ​ឲ្យ​អ្នក​សម្របសម្រួល​វា​ជាមុន​សិន។','Filtering by:'=>'តម្រង​តាម៖','<a href="https://codex.wordpress.org/Revision_Management">Revisions Management</a>'=>'<a href="https://codex.wordpress.org/Revision_Management" target="_blank">ការគ្រប់គ្រង​កំណែ​សម្រួល</a>','<a href="https://codex.wordpress.org/Pages_Add_New_Screen">Documentation on Adding New Pages</a>'=>'<a href="https://codex.wordpress.org/Pages_Add_New_Screen">ឯកសារ​ស្ដី​ពីការ​បន្ថែម​ទំព័រ​ថ្មី</a>','<a href="https://codex.wordpress.org/Tools_Import_Screen">Documentation on Import</a>'=>'<a href="https://codex.wordpress.org/Tools_Import_Screen">ឯកសារ​ស្ដីពីការ​នាំចូល</a>','You can also embed media from many popular websites including Twitter, YouTube, Flickr and others by pasting the media URL on its own line into the content of your post/page. Please refer to the Codex to <a href="https://codex.wordpress.org/Embeds">learn more about embeds</a>.'=>'អ្នកអាចបង្កប់មេឌាពីវេបសាយពេញនិយមជាច្រើន ដូចជា Twitter, YouTube, Flickr  និងវេបសាយដទៃផ្សេងទៀតដោយបិទភ្ជាប់មេឌា URL នោះនៅលើបន្ទាត់ផ្ទាល់របស់វាចូលទៅក្នុងមាតិកានៃប្រកាស ឬទំព័ររបស់អ្នក ។ សូមមើល Codex ដើម្បី <a href="https://codex.wordpress.org/Embeds">ស្វែងយល់បន្ថែមអំពីការបង្កប់ទាំងនេះ</a>។','<strong>Format</strong> &mdash; Post Formats designate how your theme will display a specific post. For example, you could have a <em>standard</em> blog post with a title and paragraphs, or a short <em>aside</em> that omits the title and contains a short text blurb. Please refer to the Codex for <a href="https://codex.wordpress.org/Post_Formats#Supported_Formats">descriptions of each post format</a>. Your theme could enable all or some of 10 possible formats.'=>'<strong>Format</strong> &mdash; ជាទម្រង់ប្រកាសដែលកំណត់នូវរបៀបដែលរូបរាងរបស់អ្នកនឹងបង្ហាញប្រកាសជាក់លាក់ណាមួយ។ ឧទាហរណ៍ថា អ្នកអាចមាន <em>ស្តង់ដា</em> នៃប្រកាសដែលមានចំណងជើង និងកថាខណ្ឌ ឬក៏លី <em>ផ្នែកចំហៀង</em> ខ្លីមួយដែលលុបចំណងជើងចេញ និងមានផ្ទុកជាអត្ថបទខ្លីជាមួយនិងរូបភាព។ សូមយោងទៅកាន់ Codex សម្រាប់ <a href="https://codex.wordpress.org/Post_Formats#Supported_Formats">ការរៀបរាប់អំពីទ្រង់ទ្រាយប្រកាសនីមួយៗ</a>។ រូបរាងរបស់អ្នកអាចបើកបានខ្លះ ឬក៏បាន ១០ នៃទម្រង់ដែលអាចទៅរួចទាំងឡាយ។','<a href="https://codex.wordpress.org/Appearance_Background_Screen">Documentation on Custom Background</a>'=>'<a href="https://codex.wordpress.org/Appearance_Background_Screen">ឯកសារ​ស្ដី​ពីផ្ទៃ​ក្រោយផ្ទាល់ខ្លួន</a>','<a href="https://codex.wordpress.org/Appearance_Widgets_Screen">Documentation on Widgets</a>'=>'<a href="https://codex.wordpress.org/Appearance_Widgets_Screen">ឯកសារ​ស្ដី​ពីវិដជិត</a>','<a href="https://codex.wordpress.org/Dashboard_Screen">Documentation on Dashboard</a>'=>'<a href="https://codex.wordpress.org/Dashboard_Screen">ឯកសារ​ស្ដី​ពីទំព័រ​ព័ត៌មាន</a>','<a href="https://codex.wordpress.org/Users_Add_New_Screen">Documentation on Adding New Users</a>'=>'<a href="https://codex.wordpress.org/Users_Add_New_Screen">ឯកសារ​ស្ដី​ពីការ​បន្ថែម​អ្នក​ប្រើ​ថ្មី</a>','<a href="https://codex.wordpress.org/Links_Add_New_Screen">Documentation on Creating Links</a>'=>'<a href="https://codex.wordpress.org/Links_Add_New_Screen">ឯកសារ​ស្ដី​ពីការ​បង្កើត​តំណ</a>','<a href="https://codex.wordpress.org/Settings_Discussion_Screen">Documentation on Discussion Settings</a>'=>'<a href="https://codex.wordpress.org/Settings_Discussion_Screen">ឯកសារ​ស្ដី​ពីការ​កំណត់​ការ​ពិភាក្សា</a>','<a href="https://codex.wordpress.org/Settings_Permalinks_Screen">Documentation on Permalinks Settings</a>'=>'<a href="https://codex.wordpress.org/Settings_Permalinks_Screen">ឯកសារ​ស្ដី​ពីការកំណត់តំណ​ជាក់លាក់</a>','<a href="https://codex.wordpress.org/Users_Your_Profile_Screen">Documentation on User Profiles</a>'=>'<a href="https://codex.wordpress.org/Users_Your_Profile_Screen">ឯកសារ​ស្ដី​ពីប្រវត្តិរូប​អ្នក​ប្</a>','<a href="https://codex.wordpress.org/Media_Add_New_Screen">Documentation on Uploading Media Files</a>'=>'<a href="https://codex.wordpress.org/Media_Add_New_Screen">ឯកសារ​ស្ដី​ពីការអាប់ឡូដ​ឯកសារ​មេឌា</a>','<a href="https://codex.wordpress.org/Users_Screen">Documentation on Managing Users</a>'=>'<a href="https://codex.wordpress.org/Users_Screen">ឯកសារ​ស្ដី​ពីការ​គ្រប់គ្រង​អ្នក​ប្រើ</a>','<a href="https://codex.wordpress.org/Posts_Add_New_Screen">Documentation on Writing and Editing Posts</a>'=>'<a href="https://codex.wordpress.org/Posts_Add_New_Screen">ឯកសារ​ស្ដី​ពីការសរសេរ ​និង​កែ​ប្រកាស</a>','<a href="https://codex.wordpress.org/Dashboard_Updates_Screen">Documentation on Updating WordPress</a>'=>'<a href="https://codex.wordpress.org/Dashboard_Updates_Screen">កម្រង​ឯកសារ​អំពី​ការ​អាប់ដេត WordPress</a>','<a href="https://codex.wordpress.org/Settings_Media_Screen">Documentation on Media Settings</a>'=>'<a href="https://codex.wordpress.org/Settings_Media_Screen">ឯកសារ​ស្ដី​ពីការ​កំណត់​មេឌា</a>','<a href="https://codex.wordpress.org/Tools_Screen">Documentation on Tools</a>'=>'<a href="https://codex.wordpress.org/Tools_Screen">ឯកសារ​ស្ដី​ពីឧបករណ៍នានា</a>','<a href="https://codex.wordpress.org/Pages_Screen#Editing_Individual_Pages">Documentation on Editing Pages</a>'=>'<a href="https://codex.wordpress.org/Pages_Screen#Editing_Individual_Pages">ឯកសារ​ស្ដី​ពីការកែ​ទំព័រ</a>','<a href="https://codex.wordpress.org/Media_Library_Screen">Documentation on Media Library</a>'=>'<a href="https://codex.wordpress.org/Media_Library_Screen">ឯកសារ​ស្ដី​ពីបណ្ណាល័យ​មេឌា</a>','<a href="https://codex.wordpress.org/Media_Add_New_Screen#Edit_Media">Documentation on Edit Media</a>'=>'<a href="https://codex.wordpress.org/Media_Add_New_Screen#Edit_Media">ឯកសារ​ស្ដី​ពីការ​កែ​មេឌា</a>','<a href="https://codex.wordpress.org/Roles_and_Capabilities">Descriptions of Roles and Capabilities</a>'=>'<a href="https://codex.wordpress.org/Roles_and_Capabilities">ការ​អធិប្បាយ​ពីតួនាទី​ និង​សមត្ថភាព</a>','<a href="https://codex.wordpress.org/Using_Permalinks">Documentation on Using Permalinks</a>'=>'<a href="https://codex.wordpress.org/Using_Permalinks">ឯកសារ​ស្ដី​ពីការ​ប្រើ​តំណ​ជាក់លាក់</a>','<a href="https://codex.wordpress.org/Keyboard_Shortcuts">Documentation on Keyboard Shortcuts</a>'=>'<a href="https://codex.wordpress.org/Keyboard_Shortcuts">ឯកសារ​ស្ដី​ពីគ្រាប់​ចុច​ផ្លូវ​កាត់</a>','<a href="https://codex.wordpress.org/Comment_Spam">Documentation on Comment Spam</a>'=>'<a href="https://codex.wordpress.org/Comment_Spam">ឯកសារ​ស្ដី​ពីមតិ​ស្ប៉ាម</a>','<a href="https://codex.wordpress.org/Keyboard_Shortcuts" target="_blank">More information</a>'=>'<a href="https://codex.wordpress.org/Keyboard_Shortcuts" target="_blank">ព័ត៌មាន​បន្ថែម</a>','<a href="https://codex.wordpress.org/Using_Themes#Adding_New_Themes">Documentation on Adding New Themes</a>'=>'<a href="https://codex.wordpress.org/Using_Themes#Adding_New_Themes">ឯកសារ​ស្ដី​ពីការ​បន្ថែម​រូបរាង​ថ្មី</a>','<a href="https://codex.wordpress.org/Managing_Plugins#Plugin_Management">Documentation on Managing Plugins</a>'=>'<a href="https://codex.wordpress.org/Managing_Plugins#Plugin_Management">ឯកសារ​ស្ដី​ពីការ​គ្រប់គ្រង​កម្មវិធី​បន្ថែម</a>','The %s setting is unregistered. Unregistered settings are deprecated. See https://codex.wordpress.org/Settings_API'=>'ការកំណត់ %s មិនត្រូវបានចុះបញ្ជីទេ។ ការកំណត់ដែលមិនត្រូវបានចុះបញ្ជីសុទ្ធតែលែងត្រូវបានប្រើ។ មើល https://codex.wordpress.org/Settings_API','%1$s by %2$s (will also <strong>delete its data</strong>)'=>'%1$s ដោយ %2$s (ក៏​នឹង​<strong>លុប​ទិន្នន័យ​របស់​វា​ដែរ</strong>)','The theme you are currently using isn&#8217;t widget-aware, meaning that it has no sidebars that you are able to change. For information on making your theme widget-aware, please <a href="https://codex.wordpress.org/Widgetizing_Themes">follow these instructions</a>.'=>'រូបរាងដែលអ្នកប្រើបច្ចុប្បន្ន គឺមិនគាំទ្រវិដជិតឡើយ ដែលមានន័យថាវាមិនមានរបារចំហៀងដែលអនុញ្ញាតអោយអ្នកអាចកែប្រែបាន។  សម្រាប់ព័តមានអំពីការផ្ដល់ការគាំទ្រដល់រូបរាង សូម <a href="https://codex.wordpress.org/Widgetizing_Themes">អនុវត្តតាមលំណែនាំទាំងនេះ</a>។','The search for installed themes will search for terms in their name, description, author, or tag.'=>'ការស្វែងរកនៃរូបរាងដែលបានដំឡើង នឹងស្វែងរកសព្ទនៅក្នុងឈ្មោះរបស់វា, បរិយាយ, អ្នកនិពន្ធ, ឬក៏ស្លាក។','Alternately, you can browse the themes that are Featured, Popular, or Latest. When you find a theme you like, you can preview it or install it.'=>'វិធីមួយផ្សេងទៀត គឺអ្នកអាចរកមើលរូបរាងដែលត្រូវបានកំណត់ជា ពិសេស, ពេញនិយម, ឬក៏ថ្មីបំផុត។ នៅពេលដែលអ្នករកឃើញរូបរាងដែលអ្នកពេញចិត្តហើយ អ្នកអាចមើលវា ឬក៏ដំឡើងវាតែម្ដង។','You can Search for themes by keyword, author, or tag, or can get more specific and search by criteria listed in the feature filter.'=>'អ្នកស្វែងរករូបរាងដោយពាក្យគន្លឺះ, អ្នកនិពន្ធ, ឬ​ស្លាក, ឬក៏អាចផ្ដោតកាន់តែជាក់លាក់បន្ថែមទៀត ហើយស្វែងរកដោយលក្ខណ្ឌដែលបានបញ្ចូលនៅក្នុងតម្រងលក្ខណៈ។','Number of Themes found: %d'=>'ចំនួននៃរូបរាងដែលបានរកឃើញ: %d','%s user deleted.'=>'បាន​លុប​អ្នក​ប្រើ %s។','You are about to remove the following plugins:'=>'អ្នកដូចជានឹងលុបកម្មវិធីជំនួយខាងក្រោម:','These plugins may be active on other sites in the network.'=>'កម្មវិធី​បន្ថែម​ទាំងនេះ​អាច​នឹង​សកម្ម​នៅ​លើ​វេបសាយ​ដទៃ​ទៀត​ក្នុង​បណ្ដាញ​នេះ។','<span>Active:</span> %s'=>'<span>សកម្ម:</span> %s','New translations are available.'=>'បំណកប្រែថ្មីៗទើបមកដល់។','You can log out of other devices, such as your phone or a public computer, by clicking the Log Out Everywhere Else button.'=>'អ្នក​អាច​ចាកចេញ​ពី​គ្រប់​ឧបករណ៍​ដទៃ​ទៀត ដូចជា​ទូរសព្ទ​របស់​អ្នក ឬ​ក៏​កុំព្យូទ័រ​សាធារណៈ​ណា​មួយ ដោយ​គ្រាន់​តែ​ចុច​លើ​ប៊ូតុង "ចាកចេញ​ពី​គ្រប់​ទី​កន្លែង"។','BETA TESTERS:'=>'BETA TESTERS:','To delete media items, click the Bulk Select button at the top of the screen. Select any items you wish to delete, then click the Delete Selected button. Clicking the Cancel Selection button takes you back to viewing your media.'=>'ដើម្បី​លុប​វត្ថុ​មេឌា​ច្រើន សូម​ចុច​ប៊ូតុង ជ្រើស​រើស​ជា​បណ្ដុំ ដែល​ស្ថិត​នៅ​ផ្នែក​លើ​នៃ​ទំព័រ។ ជ្រើស​យក​វត្ថុ​ទាំងឡាយ​ណា​ដែល​អ្នក​ចង់​លុប បន្ទាប់​មក​ចុច​លើ​ប៊ូតុង លុប​អ្វី​ដែល​បាន​ជ្រើស។ ការ​ចុច​ប៊ូតុង បោះបង់​ការ​ជ្រើស នឹង​នាំ​អ្នក​ត្រឡប់​ក្រោយ​វិញ។','You cannot delete a theme while it has an active child theme.'=>'អ្នកមិនអាចលុបរូបរាងមួយនៅពេលដែលវាមានកូនដែលកំពុងដាក់អោយដំណើរការនោះឡើយ។','You are only logged in at this location.'=>'អ្នកបានចូលប្រើតែត្រឹមតំបន់នេះប៉ុននោះ។','Log Out Everywhere'=>'ចាកចេញ​ពី​គ្រប់​ទីកន្លែង','If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.'=>'ប្រសិនបើអ្នកចូលចិត្ត, អ្នកអាចបញ្ចូលរចនាសម្ព័ន្ធផ្ទាល់ខ្លួនសម្រាប់ចំណាត់ក្រុម និង URL នៃស្លាក នៅទីនេះ។  ឧទាហរណ៍ ការប្រើ <code>ប្រធានបទ</code> ដូចចំណាត់ក្រុមមូលដ្ឋានរបស់អ្នកនឹងធ្វើឱ្យតំណភ្ជាប់ចំណាត់ក្រុមនោះជា <code>%s/topics/uncategorized/</code>។ ប្រសិនបើអ្នកទុកវាឱ្យទទេ នោះលំនាំដើមនឹងត្រូវបានប្រើ។','<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.'=>'<strong>និពន្ធការ​ប្រកាស</strong> - បញ្ចូល​អត្ថបទ​សម្រាប់​ប្រកាស​របស់​អ្នក។ នៅ​ក្នុង​នេះ​មាន​ការ​សរសេរ​ពីរ​បែប​គឺ ការ​ឃើញ​ផ្ទាល់ និង អក្សរ​ធម្មតា។ ជ្រើស​យក​ម៉ូតណាមួយដោចុចទៅ​តាម​ផ្ទាំង​របស់​វា។','You have specified this user for removal:'=>'អ្នកបានបញ្ជាក់អ្នកប្រើនេះអំពីការលុបចេញហើយៈ','Log %s out of all locations.'=>'ចាកចេញ %s ពីគ្រប់ទីតាំងទាំអស់។','Did you lose your phone or leave your account logged in at a public computer? You can log out everywhere else, and stay logged in here.'=>'តើអ្នកបានបាត់ទូរស័ព្ទរបស់អ្នក ឬក៏ភ្លេចចាកចេញពីគណនីរបស់អ្នកនៅឯកុំព្យូទ័រសាធារណៈណាមួយឬ? អ្នកអាចចាកចេញពីគណនីយរបស់អ្នកនៅទីកន្លែងទាំងនោះ និងបន្តចូលប្រើនៅទីនេះបាន។','Log Out Everywhere Else'=>'ចាកចេញពីគ្រប់ទីកន្លែងផ្សេងទៀត','Cancel password change'=>'បោះបង់ពាក្យសម្ងាត់ដែលបានប្ដូរ','Sessions'=>'Sessions','Account Management'=>'ការគ្រប់គ្រងគណនី','Generate Password'=>'បង្កើតពាក្យសម្ងាត់','Comments (%1$s) on &#8220;%2$s&#8221;'=>'មតិយោបល់ (%1$s) លើ &#8220;%2$s&#8221;','In the <strong>Comment</strong> column, hovering over any comment gives you options to approve, reply (and approve), quick edit, edit, spam mark, or trash that comment.'=>'នៅក្នុងជួរឈរ <strong>មតិយោបល់</strong>, ការដាក់ Mouse នៅលើមតិយោបល់ណាមួយ នឹងផ្ដល់ឱ្យអ្នកនូវជម្រើសដើម្បីអនុម័ត, ឆ្លើយតប (និងអនុម័ត), កែសម្រួលរហ័ស, កែសម្រួល, កំណត់ជាស្ប៉ាម, ឬក៏លុបនូវមតិយោបល់នោះ។
 ','In the <strong>Submitted On</strong> column, the date and time the comment was left on your site appears. Clicking on the date/time link will take you to that comment on your live site.'=>'នៅក្នុងជួរឈរ <strong>បញ្ជូននៅ</strong>, មានលេចចេញនូវកាលបរិច្ឆេទ និងពេលវេលាដែលមតិយោបល់ត្រូវបានបន្សល់ទុកនៅលើវេបសាយរបស់អ្នក។ ការចុចលើ កាលបរិច្ឆេទ/ពេលវេលា នឹងនាំអ្នកទៅកាន់មតិយោបល់នោះនៅលើផ្នែកខាងមុខនៃវេបសាយរបស់អ្នក។','Filter comments list'=>'ច្រោះបញ្ជីមតិយោបល់','Comments list navigation'=>'របាររុករកបញ្ជីមតិយោបល់','Comments list'=>'បញ្ចីមតិ','Preview post'=>'មើលប្រកាសជាមុន','Preview page'=>'មើលទំព័រជាមុន','View page'=>'មើលទំព័រ','Post submitted.'=>'ប្រកាសត្រូវបានបញ្ជូន។','Post scheduled for: %s.'=>'ប្រកាសត្រូវបានកំណត់ពេលសម្រាប់: %s។','Post draft updated.'=>'សេចក្ដីព្រាងប្រកាសត្រូវបានអាប់ដេត។','Page submitted.'=>'ទំព័រត្រូវបានបញ្ជូន។','Page scheduled for: %s.'=>'ទំព័រត្រូវបានកំណត់ពេលក្នុង: %s.','Page draft updated.'=>'ទំព័រពង្រៀងត្រូវបានអាប់ដេត។','<a href="https://codex.wordpress.org/Nginx">Documentation on Nginx configuration</a>.'=>'<a href="https://codex.wordpress.org/Nginx">ឯកសារអំពី Nginx configuration</a>។','Filter plugins list'=>'ត្រងបញ្ជីកម្មវិធីបន្ថែម','Plugins list navigation'=>'បញ្ជីររុករកកម្មវិធីបន្ថែម','Plugins list'=>'បញ្ជី​កម្មវិធី​បន្ថែម','The selected plugin has been <strong>deleted</strong>.'=>'កម្មវិធីបន្ថែមដែលបានជ្រើសរើស ត្រូវបាន <strong>លុបចេញ</strong>។','All selected plugins are up to date.'=>'កម្មវិធីជំនួយដែលបានជ្រើសទាំងអស់សុទ្ធតែទាន់សម័យ។','Filter themes list'=>'ត្រងបញ្ជីរូបរាង','Themes list'=>'បញ្ចីរូបរាង','Install Parent Theme'=>'ដំឡើងប្រភពរូបរាង','Filter media items list'=>'ត្រងពីបញ្ជីរធាតុនៃមេឌា','Media items list navigation'=>'បញ្ជីររុករកធាតុនៃមេឌា','Media items list'=>'បញ្ជី​វត្ថុ​មេឌា','Filter users list'=>'ត្រងពីបញ្ជីរអ្នកប្រើប្រាស់','Users list navigation'=>'បញ្ជីររុករកអ្នកប្រើប្រាស់','Users list'=>'បញ្ជី​អ្នកប្រើប្រាស់','One of the selected users is not a member of this site.'=>'អ្នកប្រើប្រាស់ម្នាក់ក្នុងចំណោមអ្នកប្រើប្រាស់ដែលបានជ្រើសរើសគឺមិនមែនជាសមាជិកនៃតំបន់បណ្ដាញនេះទេ។','Clear Inactive Widgets'=>'លុបវិដជិតដែលមិនដំណើរការ','This will clear all items from the inactive widgets list. You will not be able to restore any customizations.'=>'ការនេះនឹងលុបនូវរាល់ធាតុផ្សេងៗនៃវិដជិតដែលអសកម្មពីបញ្ជីរ។ អ្នកនឹងមិនអាចស្តារឡើងវិញពីការកែប្រែនានាបានទេ។','Sorry, you are not allowed to manage these options.'=>'សុំទោស អ្នក​មិនត្រូវបានអនុញ្ញាតអោយគ្រប់គ្រងនូវជម្រើសទាំងនេះទេ។','themesFavorites'=>'ចំនូលចិត្ត','If you have marked themes as favorites on WordPress.org, you can browse them here.'=>'បើអ្នកបានដៅនៅលើរូបរាងថាចូលចិត្តនៅលើ WordPress.org នោះអ្នកអាចរកមើលពួកវានៅទីនេះបាន។','Default is %s'=>'លំនាំដើម​គឺ %s','Plain'=>'សុទ្ធ','Maintenance Releases'=>'ការចេញផ្សាយនានានូវការជួសជុលបន្ថែម','Permalinks can contain useful information, such as the post date, title, or other elements. You can choose from any of the suggested permalink formats, or you can craft your own if you select Custom Structure.'=>'តំណជាក់លាក់ អាចនឹងផ្ទុកនូវព័ត៌មានមានប្រយោជន៍ ដូចជាកាលបរិច្ឆេទប្រកាស, ចំណងជើង,  ឬធាតុផ្សេងៗទៀត។ អ្នកអាចជ្រើសទម្រង់នៃតំណជាក់លាក់ណាមួយដែលបានណែនាំ ឬក៏អ្នកអាចបង្កើតមួយសម្រាប់ផ្ទាល់ខ្លួនរបស់អ្នកប្រសិនបើអ្នកបានជ្រើសនូវទម្រង់ Custom Structure។','WordPress offers you the ability to create a custom URL structure for your permalinks and archives. Custom URL structures can improve the aesthetics, usability, and forward-compatibility of your links. A <a href="%s">number of tags are available</a>, and here are some examples to get you started.'=>'WordPress ផ្តល់ឲ្យអ្នកនូវសមត្ថភាពក្នុងការបង្កើតរចនាសម្ព័ន URL ផ្ទាល់ខ្លួនមួយសម្រាប់ តំណនានា និងបណ្ណសាររបស់អ្នក។ រចនាសម្ព័ន្ធ URL ផ្ទាល់ខ្លួន អាចកែលម្អសោភណភាព ងាយស្រួលប្រើប្រាស់ និងភាពត្រូវគ្នាទៅមុខនៃតំណរបស់អ្នក។ <a href="%s">ស្លាកមួយចំនួននៅទំនេរ</a>, ហើយនេះគឺជាឧទាហរណ៍មួយចំនួនដែលអាចជួយអ្នកក្នុងការចាប់ផ្តើម។','Security Releases'=>'ការចេញផ្សាយនូវការរក្សាសុវត្ថិភាពនានា','Maintenance and Security Releases'=>'ការចេញផ្សាយនូវការជួសជុល និងការរក្សាសុវត្ថិភាព','https://en.gravatar.com/'=>'https://km.gravatar.com/','<strong>Version %s</strong> addressed one security issue.'=>'<strong>កំណែ %s</strong> បានដោះស្រាយបញ្ហាសន្ដិសុខមួយ។','menu location(Currently set to: %s)'=>'(ការកំណត់បច្ចុប្បន្នទៅកាន់: %s)','Send User Notification'=>'ផ្ញើការជូនដំណឹងដល់អ្នកប្រើ','Send the new user an email about their account.'=>'ផ្ញើអ៊ីម៉ែលអ្នកប្រើថ្មីអំពីគណនីរបស់ពួកគេ។','The %s importer is invalid or is not installed.'=>'ការនាំចូល %s មិនត្រឹមត្រូវ ឬមិនត្រូវបានដំឡើង។','Dismiss the welcome panel'=>'ច្រានចោល ផ្ទាំងស្វាគមន៍','plugin%1$s by %2$s'=>'%1$s ដោយ %2$s','Sorry, you are not allowed to delete that user.'=>'សូមទោស, អ្នក​មិនត្រូវបានអនុញ្ញាតឪ្យលុបអ្នកប្រើនេះ​ទេ។','https://wordpress.org/themes/'=>'https://km.wordpress.org/themes/','Settings saved and theme activated.'=>'បាន​រក្សាទុក​ការ​កំណត់ ហើយ​បាន​បើក​រូបរាង។','New theme activated.'=>'បាន​បើក​រូបរាង​ថ្មី។','The following themes are installed but incomplete.'=>'រូបភាព​ទាំងនេះ​ត្រូវបាន​ដំឡើង​ហើយ តែ​មិន​ពេញលេញ​ទេ។','You can narrow the list by file type/status or by date using the dropdown menus above the media table.'=>'អ្នកអាចបង្រួមបញ្ជីតាមប្រភេទឯកសារ / ស្ថានភាព ឬកាលបរិច្ឆេទដោយប្រើបញ្ជី dropdown ដែលនៅខាងលើតារាងមេឌា។','Error while saving the new email address. Please try again.'=>'មាន​បញ្ហា​ក្នុង​ការ​រក្សាទុក​អាសយដ្ឋាន​អ៊ីមែល​ថ្មី។ សូម​ព្យាយាម​ម្ដង​ទៀត។','There is a pending change of your email to %s.'=>'មានការផ្លាស់ប្តូរដែលមិនទាន់សម្រេចនៃអ៊ីម៉ែលរបស់អ្នកទៅកាន់ %s។','User has been added to your site. <a href="%s">Edit user</a>'=>'បាន​បន្ថែម​អ្នក​ប្រើប្រាស់​ទៅ​ក្នុង​វេបសាយ​របស់​អ្នក។ <a href="%s">កែសម្រួល​អ្នក​ប្រើប្រាស់</a>','<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.'=>'<strong>ចុះផ្សាយ</strong> &mdash; អ្នកអាចកំណត់សព្ទ នៃការផ្សាយប្រកាសរបស់អ្នកក្នុងប្រអប់ ចុះផ្សាយ។ ចំពោះស្ថានភាព, ការកំណត់ឃើញ, និង ចុះផ្សាយ (ភ្លាមៗ), ចុចលើតំណរភ្ផាប់ កែប្រែ ដើម្បីបង្ហាញជម្រើសផ្សេងទៀត។ ការកំណត់ឃើញ មានរួមបញ្ចូលជម្រើសសម្រាប់ការពារប្រកាសដោយលេខសម៉្ងាត់ ឬក៏កំណត់អោយតែងតែនៅលើគេក្នុងប្លុករបស់អ្នកដោយមិនកំណត់ពេល(sticky)។ ជម្រើសការពារដោយពាក្យសម៉្ងាត់អនុញ្ញាតអោយអ្នកកំណត់ពាក្យសម្ងាត់ដោយសេរីទៅលើប្រកាសនីមួយៗ។  ជម្រើសឯកជនលាក់ប្រកាសពីមនុស្សទាំងអស់ដោយលើកលែងតែអ្នកកែសម្រួល និងអ្នកគ្រប់គ្រងប៉ុននោះ។  ចុះផ្សាយ (ភ្លាមៗ) អនុញ្ញាតឱ្យអ្នកកំណត់ពេលអនាគត ឬពេលវេលា ឬកាលបរិច្ឆេទវេលាកន្លងមក ដែលធ្វើអោយអ្នកអាចកំណត់ពេលប្រកាសមួយ ដើម្បីត្រូវបានចុះផ្សាយនៅក្នុងពេលអនាគត ឬក៏ទៅកាន់អតីតកាលវិញ។','Media file updated.'=>'បាន​អាប់ដេត​ឯកសារ​មេឌា។','Media file attached.'=>'បាន​ភ្ជាប់​ឯកសារ​មេឌា។','%s media file attached.'=>'បាន​ភ្ជាប់​ឯកសារ​មេឌា %s ។','Media file detached.'=>'បាន​ដក​ឯកសារ​មេឌា​ចេញ។','%s media file detached.'=>'បាន​ដក​ឯកសារ​មេឌា %s ចេញ។','%s media file permanently deleted.'=>'បាន​លុប​ឯកសារ​មេឌា %s ចោល​ជា​អចិន្ត្រៃយ៍។','%s media file moved to the trash.'=>'បាន​យក​ឯកសារ​មេឌា %s ទៅ​ដាក់​ក្នុង​ធុង​សំរាម។','%s media file restored from the trash.'=>'បាន​យក​ឯកសារ​មេឌា %s ចេញ​ពី​ធុង​សំរាម។','Error saving media file.'=>'មាន​បញ្ហា​ក្នុង​ការ​រក្សាទុក​ឯកសារ​មេឌា។','Visual mode gives you an editor that is similar to a word processor. Click the Toolbar Toggle button to get a second row of controls.'=>'Visual mode ផ្តល់ឱ្យអ្នកនូវកម្មវិធីនិពន្ធដែលស្រដៀងគ្នានឹងកម្មវិធីវាយអត្ថបទមួយដែរ។  ចុចលើប៊ូតុង Toolbar Toggle ដើម្បីទទួលបាននូវជួរទីពីរនៃបញ្ជីឧបករណ៍។','The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.'=>'Text mode នេះអនុញ្ញាតឱ្យអ្នកបញ្ចូល HTML រួមជាមួយនឹងអត្ថបទប្រកាសរបស់អ្នក។ ចំណាំថា ស្លាក &lt;p&gt; និងស្លាក &lt;br&gt; ត្រូវបានបម្លែងជាការចុះបន្ទាត់នៅពេលប្ដូរទៅ Text editor ដើម្បីកុំអោយមានការរញេរញ៉ៃច្រើន។ នៅពេលអ្នកសរសេរ បន្ទត់ដេកម្នាក់ឯងអាចប្រើជំនួសការសរសេរ &lt;br&gt; ហើយបន្ទត់ដេកពីរជំនួសនូវស្លាកកថាខណ្ឌ។ បន្ទត់ដេកត្រូវបានបម្លែងទៅជាស្លាកវិញដោយស្វ័យប្រវត្តិ។','Close the Customizer and go back to the previous page'=>'បិទ Customizer ហើយត្រឡប់ក្រោយទៅទំព័រចាស់វិញ','Sorry, you are not allowed to add links to this site.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឪ្យបន្ថែមតំណភ្ជាប់ទៅក្នុងវេបសាយនេះទេ។','Sorry, you are not allowed to modify unregistered settings for this site.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឪ្យកែសម្រួលការកំណត់ដែលមិនបានចុះឈ្មោះ សម្រាប់វេបសាយនេះទេ។','Sorry, you are not allowed to activate plugins for this site.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឪ្យកម្មវិធីបន្ថែម សកម្មសម្រាប់វេបសាយនេះទេ។','Sorry, you are not allowed to deactivate plugins for this site.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតឲ្បបិទមិនអោយដំណើរការកម្មវិធីបន្ថែមសម្រាប់វេបសាយនេះបានទេ។','New version available. <button class="button-link" type="button">Update now</button>'=>'មាន​កកំណែ​ថ្មី​ហើយ។ <button class="button-link" type="button">អាប់ដេត​ឥឡូវ​នេះ</button>','The Theme Installer screen requires JavaScript.'=>'អេក្រង់ដំឡើងរូបរាង ត្រូវការJavaScript។','Sorry, you are not allowed to update this site.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាត​ឱ្យ​អាប់ដេត​វេបសាយ​នេះ​ទេ។','Sorry, you are not allowed to edit this changeset.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យកែការកំណត់ប្ដូរនេះទេ។','Confirm use of potentially weak password'=>'បញ្ជាក់ពីការប្រើពាក្យសម៉្ងាត់ដ៏ខ្សោយនេះ','Sorry, you are not allowed to add users to this network.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឲ្យបន្ថែមអ្នកប្រើទៅបណ្ដាញនេះទេ។','Sorry, you are not allowed to remove users.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឲ្យដកអ្នកប្រើនេះចេញទេ។','The search for installed plugins will search for terms in their name, description, or author.'=>'ការស្វែងរកកម្មវិធីបន្ថែមសម្រាប់តំឡើងនឹងស្វែងរកនូវលក្ខ័ខ័ណ្ឌក្នុងឈ្មោះពួកគេ, ការពិពណ៌នា, ឬអ្នកនិពន្ធ។','Display location'=>'បង្ហាញទីតាំង','New users are automatically assigned a password, which they can change after logging in. You can view or edit the assigned password by clicking the Show Password button. The username cannot be changed once the user has been added.'=>'អ្នកប្រើថ្មីត្រូវបានកំណត់ពាក្យសម្ងាត់ដោយស្វ័យប្រវត្តិ ហើយពួកគេអាចផ្លាស់ប្តូរបានបន្ទាប់ពីការ​ចូលប្រើ។ អ្នកអាចមើល ឬកែសម្រួលនូវពាក្យសម្ងាត់ដែលបានផ្ដល់នេះដោយចុចលើ បង្ហាញពាក្យសម្ងាត់។ ចំនែកឯឈ្មោះអ្នកប្រើ គឺមិនអាចត្រូវបានផ្លាស់ប្ដូរបានទេនៅពេលដែលអ្នកប្រើត្រូវបានបន្ថែមរួចហើយ។','By default, new users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain a password reset link. Uncheck the box if you don&#8217;t want to send the new user a welcome email.'=>'តាម​លំនាំដើម អ្នកប្រើថ្មីនឹងទទួលបានអ៊ីមែលមួយដែលអនុញ្ញាតឱ្យគេពួកគេដឹងថាគេបានបន្ថែមជាអ្នកប្រើប្រាស់នៅលើវេបសាយរបស់អ្នក។  អ៊ីមែលនេះក៏មានផងដែរនូវតំណកំណត់ពាក្យសម្ងាត់ឡើងវិញ។ ដោះធីកពីប្រអប់ ប្រសិនបើអ្នកមិនចង់អោយមានការផ្ញើរអ៊ីមែលស្វាគមន៍នេះ។','Expand Sidebar'=>'ពង្រីករបាចំហៀង','Original SizeOriginal'=>'ច្បាប់ដើម','Background RepeatRepeat'=>'ម្តងទៀត','Background ScrollScroll'=>'អូសចុះឡើង','Customize New Changes'=>'ធ្វើតាមការផ្លាស់ប្ដូរថ្មី','Select one or more Theme features to filter by'=>'ជ្រើសយកលក្ខណពិសេសរូបរាងមួយ ឬផ្សេងទៀតដើម្បីតម្រង់ដោយ','Clear current filters'=>'សម្អាតតម្រង់បច្ចុប្បន្ន','Edit Filters'=>'កែការច្រោះ','You are using a development version of WordPress. You can update to the latest nightly build automatically:'=>'អ្នកកំពុងប្រើកំណែអភិវឌ្ឍន៍នៃ  WordPress។ អ្នកអាចធ្វើបច្ចុប្បន្នភាពទៅកាន់ជំនាន់ពេញលេញដោយស្វ័យប្រវត្តិ។','If you need to re-install version %s, you can do so here:'=>'ប្រសិនជាអ្នក ត្រូវការដំឡើងជំនាន់%s ឡើងវិញ អ្នកអាចធ្វើដូច្នោះនៅទីនេះ:','You can select the language you wish to use while using the WordPress administration screen without affecting the language site visitors see.'=>'អ្នកអាចរើសភាសាដែលអ្នកមានចង់ប្រើខណៈពេលដែលកំពុងប្រើអេក្រង់រដ្ឋបាលរបស់ WordPress បានដោយមិនប៉ះពាល់ដល់ភាសារបស់វេបសាយដែលអ្នកទស្សនាកំពុងមើលនោះទេ។','ID #%1$s: %2$s <strong>Sorry, you are not allowed to remove this user.</strong>'=>'ID #%1$s: %2$s <strong>សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតអោយលុបអ្នកប្រើប្រាស់នេះទេ។</strong>','short (~12 characters) label for hide controls buttonHide Controls'=>'លាក់ឧបករណ៍ត្រួតពិនិត្យ','Sorry, you are not allowed to create users.'=>'សូមទោស អ្នកមិនត្រូវបានអនុញ្ញាតិអោយបង្កើតអ្នកប្រើប្រាស់ទេ។','Sorry, you are not allowed to delete users.'=>'សុំទោស អ្នកមិនត្រូវបានអនុញ្ញាតអោយលុបអ្នកប្រើទាំងនេះទេ។','The Customizer allows you to preview changes to your site before publishing them. You can navigate to different pages on your site within the preview. Edit shortcuts are shown for some editable elements.'=>'Customizer អាចអោយអ្នកអាចមើលកំណែប្រែទាំងឡាយនៃវេបសាយរបស់អ្នក មុនពេលពួកគេត្រូវបានចុះផ្សាយ។ អ្នកក៏អាចមើលឃើញកំណែប្រែនៅលើទំព័រផ្សេងទៀតនៃវេបសាយរបស់អ្នកផងដែរនៅក្នុងពេលមើលនោះផងដែរ។  ការកែសម្រួល shortcuts ក៏ត្រូវបានបង្ហាញសម្រាប់ធាតុដែលអាចកែបានផងដែរ។','Edit User %s'=>'កែសម្រួលអ្នកប្រើ %s','Site HealthInfo'=>'ព័ត៌មាន','Your scheduled changes just published'=>'កំណែប្រែដែលបានកំណត់ពេលចុះផ្សាយទើបបានចុះផ្សាយ','%s (Month of the year, for example 05.)'=>'%s (ខែនៃឆ្នាំ, ឧទាហរណ៍, 05)','%s (Day of the month, for example 28.)'=>'%s (ថ្ងៃនៃខែ, ឧទាហរណ៍ 28។)','%s (Hour of the day, for example 15.)'=>'%s (ម៉ោងនៃថ្ងៃ, ឧទាហរណ៍ 15។)','%s (Minute of the hour, for example 43.)'=>'%s (នាទីនៃម៉ោង, ឧទាហរណ៍ 43។)','%s (Second of the minute, for example 33.)'=>'%s (វិនាទីនៃនាទី, ឧទាហរណ៍ 33។)','%s (The unique ID of the post, for example 423.)'=>'%s (ID តែមួយគត់នៃប្រកាស, ឧទាហរណ៍ 423។)','%s (The sanitized post title (slug).)'=>'%s (ចំណងជើងនៃប្រកាសដែលបានសម្អាត (តំណ)។)','%s (Category slug. Nested sub-categories appear as nested directories in the URL.)'=>'%s (តំណនៃចំណាត់ក្រុម។ ចំណាត់ក្រុមរងក្រោមៗនឹងបង្ហាញជាថតៗនៅលើURL។)','%s (A sanitized version of the author name.)'=>'%s (កំណែនៃឈ្មោះអ្នកនិពន្ធដែលបានសម្អាតហើយ។)','%s added to permalink structure'=>'%s ត្រូវបានបញ្ចូលទៅក្នុងរចនាសម្ព័ន្ធតំណ','%s (already used in permalink structure)'=>'%s (បានប្រើរួចហើយនៅក្នុងរចនាសម្ព័ន្ធតំណ)','Available tags:'=>'ស្លាកនៅទំនេរ:','Sorry, you are not allowed to activate this plugin.'=>'សូមទោស អ្នកពុំមានសិទ្ធិដាក់អោយដំណើរការកម្មវិធីបន្ថែមនេះទេ។','Sorry, you are not allowed to deactivate this plugin.'=>'សូមទោស អ្នកពុំមានសិទ្ធិបិទមិនអោយដំណើរការកម្មវិធីបន្ថែមនេះទេ។','Syntax Highlighting'=>'ការហាយឡាយស៊ីនតាក់','Disable syntax highlighting when editing code'=>'បិទការហាយឡាយស៊ីនតាក់នៅពេលកែរកូដ','That user could not be added to this site.'=>'អ្នកប្រើនោះមិនអាចបញ្ចូលទៅក្នុងវេបសាយបានទេ។','User has been created, but could not be added to this site.'=>'អ្នកប្រើត្រូវបានបង្កើត ប៉ុន្ដែមិនអាចបញ្ចូលទៅក្នុងវេបសាយបានទេ។','From time to time, your WordPress site may send data to WordPress.org &#8212; including, but not limited to &#8212; the version of WordPress you are using, and a list of installed plugins and themes.'=>'ពីមួយពេលទៅមួយពេល វេបសាយ WordPress របស់អ្នកអាចនឹងផ្ញើរទិនិ្នន័យទៅកាន់ WordPress.org &#8212; ដែលរួមបញ្ចូលប៉ុន្តែមិនកំណត់ចំពោះ &#8212; លេខកំណែនៃ WordPress ដែលអ្នកកំពុងប្រើ និងបញ្ជីនៃកម្មវិធីបន្ថែម និងរូបរាងវេបសាយនានាដែលបានដំឡើង។ ','We take privacy and transparency very seriously. To learn more about what data we collect, and how we use it, please visit <a href="%s">WordPress.org/about/privacy</a>.'=>'យើងគោរពនូវឯកជនភាព និងតម្លាភាពយ៉ាងខ្ពស់បំផុត។ ដើម្បីស្វែងយល់ពីទិន្នន័យអ្វីដែលយើងប្រមូល និងតើយើងប្រើវាបែបណា សូមចូលទៅកាន់ <a href="%s">WordPress.org/about/privacy</a>។','Developer Happiness'=>'សុភមង្គលនៃអ្នកអភិវឌ្ឍន៍','https://codex.wordpress.org/Using_Permalinks'=>'https://codex.wordpress.org/Using_Permalinks','https://codex.wordpress.org/Changing_File_Permissions'=>'https://codex.wordpress.org/Changing_File_Permissions','If your %1$s file was <a href="%2$s">writable</a>, we could do this automatically, but it isn&#8217;t so this is the url rewrite rule you should have in your %1$s file. Click in the field and press %3$s to select all. Then insert this rule inside of the %4$s element in %1$s file.'=>'ប្រសិនបើឯកសារ %1$s របស់អ្នក <a href="%2$s">អាចសរសេរពីលើបាន</a> នោះយើងអាចធ្វើការងារនេះបានដោយស្វ័យប្រវត្តិ ប៉ុន្តែវាមិនអីចឹង។ ដូច្នេះ ទាំងនេះគឺជាការកំណត់ url rewrite ដែលអ្នកគួរមាននៅក្នុងឯកសារ %1$s របស់អ្នក។ ចុចទៅលើប្រអប់នេះ ហើយចុចលើ %3$s ដើម្បីរើសយកទាំងអស់។ បន្ទាប់មកបញ្ចូលការកំណត់នេះនៅក្នុងធាតុ %4$s នៃឯកសារ %1$s។','If the root directory of your site was <a href="%1$s">writable</a>, we could do this automatically, but it isn&#8217;t so this is the url rewrite rule you should have in your %2$s file. Create a new file, called %2$s in the root directory of your site. Click in the field and press %3$s to select all. Then insert this code into the %2$s file.'=>'ប្រសិនបើបញ្ជីទិន្នន័យដើមរបស់អ្នក <a href="%1$s">អាចសរសេរពីលើបាន</a> នោះយើងអាចធ្វើការងារនេះបានដោយស្វ័យប្រវត្តិ ប៉ុន្តែវាមិនអីចឹង។ ដូច្នេះ នេះគឺជាការកំណត់ url rewrite ដែលអ្នកគួរមាននៅក្នុងឯកសារ %2$s របស់អ្នក។ សូមបង្កើតឯកសារថ្មីមួយដោយដាក់ឈ្មោះថា %2$s នៅក្នុងបញ្ជីទិន្ន័យដើមនៃវេបសាយរបស់អ្នក។ ចុចទៅលើប្រអប់នេះ ហើយចុចលើ %3$s ដើម្បីរើសយកទាំងអស់។ បន្ទាប់មកបញ្ជូលកូដនេះទៅក្នុងឯកសារ %2$s របស់អ្នក។','If your %1$s file was <a href="%2$s">writable</a>, we could do this automatically, but it isn&#8217;t so these are the mod_rewrite rules you should have in your %1$s file. Click in the field and press %3$s to select all.'=>'ប្រសិនបើឯកសារ %1$s របស់អ្នក <a href="%2$s">អាចសរសេរពីលើបាន</a> នោះយើងអាចធ្វើការងារនេះបានដោយស្វ័យប្រវត្តិ ប៉ុន្តែវាមិនអីចឹង។ ដូច្នេះ ទាំងនេះគឺជាការកំណត់ mod_rewrite ដែលអ្នកគួរមាននៅក្នុងឯកសារ %1$s របស់អ្នក។ ចុចទៅលើប្រអប់នេះ ហើយចុចលើ %3$s ដើម្បីរើសយកទាំងអស់។','Default template'=>'គំរូដើម','This changeset cannot be further modified.'=>'Changeset មិនអាចធ្វើការកែប្រែបានទៀតទេ។','This data is used to provide general enhancements to WordPress, which includes helping to protect your site by finding and automatically installing new updates. It is also used to calculate statistics, such as those shown on the <a href="%s">WordPress.org stats page</a>.'=>'ទិន្នន័យនេះនឹងត្រូវប្រើដើម្បីផ្ដល់នូវភាពប្រសើរឡើងជាទូទៅទៅកាន់ WordPress ដែលរួមបញ្ចូលដូចជា ការជួយការពារវេបសាយរបស់អ្នកដោយការស្វែងរកនូវការអាប់ដេតថ្មីៗដោយស្វ័យប្រវត្តិ។ វាក៏នឹងត្រូវប្រើដើម្បីគណនាស្ថិតិដូចជាអ្វីដែលបានបង្ហាញនៅលើ<a href="%s">ទំព័រស្ថិតិនៃ WordPress.org</a>។','Privacy Policy Guide'=>'សេចក្ដីណែនាំពីគោលការណ៍ឯកជនភាព','https://wordpress.org/plugins/classic-editor/'=>'https://wordpress.org/plugins/classic-editor/','page titleAbout'=>'អំពីកំណែថ្មីនេះ','CSS Font Family for Editor FontNoto Serif'=>'Noto Serif','The 1st Freedom'=>'សេរីភាពលើកទី១','To run the program for any purpose.'=>'ដើម្បីដំណើការកម្មវិធីសម្រាប់គ្រប់គោលបំណង។','The 2nd Freedom'=>'សេរីភាពលើកទី២','To study how the program works and change it to make it do what you wish.'=>'ដើម្បីរៀនពីរបៀបដែលកម្មវិធីដំណើរការ និងពីការកែប្រែវាដើម្បីឲ្យវាធ្វើតាមអ្វីដែលអ្នកចង់បាន។','The 3rd Freedom'=>'សេរីភាពលើកទី៣','To redistribute.'=>'ដើម្បីចែកចាយបន្ត។','The 4th Freedom'=>'សេរីភាពលើកទី៤','To distribute copies of your modified versions to others.'=>'ដើម្បីចែកចាយនូវសេចក្ដីចម្លងនៃកំណែដែលអ្នកបានកែទៅកាន់អ្នកឯទៀត។','A post type mismatch has been detected.'=>'ប្រភេទប្រកាសមួយដែលពុំត្រូវគ្នា ត្រូវបានរកឃើញ។','The block editor requires JavaScript. Please enable JavaScript in your browser settings, or try the <a href="%s">Classic Editor plugin</a>.'=>'កម្មវិធីនិពន្ធប្លុកទាមទាឲ្យមាន JavaScript ដំណើការ។ សូមដាក់ឲ្យដំណើការ JavaScript នៅក្នុងការកំណត់នៃកម្មវិធីរុករកអ៊ីនធឺណិតរបស់អ្នក ឬមួយក៏សាកល្បងប្រើ <a href="%s">កម្មវិធីនិពន្ធចាស់</a>។','Site HealthStatus'=>'ស្ថានភាព','Keeping Your Site Safe'=>'បន្តធ្វើឲ្យវេបសាយរបស់អ្នកមានសុវត្ថិភាព','Site Health Check'=>'ត្រួតពិនិត្យសុខភាពវេបសាយ','New Dashboard Icons'=>'មានអាយខុនថ្មីៗនៅលើផ្ទាំងគ្រប់គ្រង','PHP Version Bump'=>'ការកំណត់ជំនាន់ PHP','Privacy Updates'=>'ការអាប់ដេតលើឯកជនភាព','Building JavaScript'=>'Building JavaScript','Comment %d does not exist'=>'មិន​មាន​មតិ %d ទេ','You 