ារ​កម្មវិធី​បន្ថែម​ឡើង​វិញ','Plugin reactivated successfully.'=>'បាន​បើក​ដំណើរការ​កម្មវិធី​បន្ថែម​ម្ដង​ទៀត​ដោយ​ជោគជ័យ។','Plugin failed to reactivate due to a fatal error.'=>'មិន​អាច​បើក​ដំណើរការ​កម្មវិធី​បន្ថែម​ឡើង​វិញ ដោយ​សារ​កំហុស​ធ្ងន់​មួយ។','Installing Plugin: %s'=>'កំពុង​ដំឡើង​កម្មវិធី​បន្ថែម: %s','Installing Plugin from uploaded file: %s'=>'កំពុង​ដំឡើង​កម្មវិធី​បន្ថែម​ពី​ឯកសារ​ដែល​បាន​ផ្ទុកឡើង: %s','Installing Theme: %s'=>'កំពុង​ដំឡើង​ស្បែក: %s','Upload Theme'=>'ផ្ទុក​ស្បែក​ឡើង','Installing Theme from uploaded file: %s'=>'កំពុង​ដំឡើង​ស្បែក​ពី​ឯកសារ​ដែល​បាន​ផ្ទុកឡើង: %s','Update to version %s'=>'ធ្វើ​បច្ចុប្បន្នភាព​ទៅ​ជំនាន់ %s','This comment is currently marked as spam.'=>'មតិ​នេះ​ត្រូវ​បាន​ចំណាំ​ថា​ជា​ស្ប៉ាម។','Moderate Comment'=>'សម្រប​សម្រួល​មតិ','This comment is currently approved.'=>'មតិ​នេះ​ត្រូវ​បាន​យល់​ព្រម។','Executed before Multisite is loaded.'=>'បាន​ប្រតិបត្តិ​មុន​ពហុវេបសាយ​ត្រូវបាន​ផ្ទុក។','Install %s'=>'ដំឡើង %s','Custom database class.'=>'ក្លាស់​មូលដ្ឋាន​ទិន្នន័យ​ផ្ទាល់​ខ្លួន។','This address is used for admin purposes. If you change this we will send you an email at your new address to confirm it. <strong>The new address will not become active until confirmed.</strong>'=>'អាសយដ្ឋាន​នេះ​ត្រូវបាន​ប្រើ​សម្រាប់​គោលបំណង​គ្រប់គ្រងនានា។ ប្រសិន​បើ​អ្នក​ប្ដូរ​វា យើង​នឹង​ផ្ញើ​អ៊ីមែល​មួយ​ទៅ​អាសយដ្ឋាន​ថ្មី​របស់​អ្នកដើម្បី​បញ្ជាក់។ <strong>អាសយដ្ឋាន​ថ្មី​នឹង​មិន​ក្លាយជាសកម្ម ដរាប​ណា​អ្នក​បាន​បញ្ជាក់​រួច។</strong>','This comment is currently in the Trash.'=>'មតិ​នេះ​កំពុង​ស្ថិត​នៅ​ក្នុង​ធុង​សំរាម។','Please enter a valid menu name.'=>'សូម​បញ្ចូល​ឈ្មោះ​ម៉ឺនុយ​ដែល​ត្រឹម​ត្រូវ។','View All'=>'មើល​ទាំងអស់','Try again'=>'ព្យាយាម​ម្ដង​ទៀត','Updating Theme %1$s (%2$d/%3$d)'=>'កំពុង​ធ្វើ​បច្ចុប្បន្នភាព​ស្បែក %1$s (%2$d/%3$d)','Link Target'=>'ទិសដៅ​តំណ','In a few words, explain what this site is about.'=>'ពន្យល់​អំពី​វេបសាយ​របស់​អ្នក តាម​រយៈ​ពីរបី​ពាក្យ។','Show advanced menu properties'=>'បង្ហាញ​លក្ខណៈ​កម្រិត​ខ្ពស់​របស់​ម៉ឺនុយ','Author Template'=>'ពុម្ព​គម្រូ​អ្នក​និពន្ធ','Tag Template'=>'ពុម្ពគម្រូ​ស្លាក','The menu item has been successfully deleted.'=>'បាន​លុប​ធាតុ​ម៉ឺនុយ​ដោយ​ជោគជ័យ។','The menu has been successfully deleted.'=>'ម៉ឺនុយ​ត្រូវបាន​លុប​ដោយ​ជោគជ័យ។','WordPress Blog'=>'WordPress ប្លក់','Important:'=>'សំខាន់:','Please provide a custom field name.'=>'សូម​ផ្ដល់​ឈ្មោះ​វាល​ផ្ទាល់​ខ្លួន។','No items.'=>'មិនមាន​ធាតុ។','Plugin InstallerTag'=>'ស្លាក','Most Recent'=>'ថ្មី​បំផុត','Function Name&hellip;'=>'ឈ្មោះ​អនុគមន៍&hellip;','Your theme supports one menu. Select which menu you would like to use.'=>'រូបរាង​ដែល​អ្នក​កំពុង​ប្រើ មាន​ផ្ដល់​ម៉ឺនុយ​ចំនួន​មួយ។ ជ្រើសរើស​ម៉ឺនុយ​ណា​ដែល​អ្នក​ចង់​ប្រើ។','Your theme supports %s menu. Select which menu appears in each location.'=>'រូបរាង​ដែល​អ្នក​កំពុង​ប្រើ មាន​ផ្ដល់​ម៉ឺនុយ %s។ ជ្រើសរើស​ម៉ឺនុយ​ណា​ដែល​ត្រូវ​បង្ហាញ​នៅ​ត្រង់​កន្លែង​ណាមួយ។','UTC means Coordinated Universal Time.'=>'UTC មានន័យ​ថា Coordinated Universal Time (ពេលវេលា​ដែល​ត្រូវ​បាន​សម្របសម្រួល​ជា​សាកល)។','After typing in your edits, click Update File.'=>'ក្រោយ​ពី​វាយ​បញ្ចូល​ក្នុង​ការ​កែប្រែ​របស់​អ្នក, ចុច ធ្វើ​បច្ចុប្បន្នភាព​ឯកសារ។','The fields on this screen determine some of the basics of your site setup.'=>'វាលនានា​នៅ​ក្នុង​ទំព័រ​នេះ​កំណត់​ការ​រៀបចំ​មូលដ្ឋាន​ខ្លះ​នៃ​វេបសាយ​របស់​អ្នក។','You can also moderate the comment from this screen using the Status box, where you can also change the timestamp of the comment.'=>'អ្នក​អាច​សម្របសម្រួល​មតិ​ពី​ទីតាំង​នេះ​ដោយ​ប្រើ​ប្រអប់ ស្ថានភាព ជា​ទីតាំង​ដែល​អ្នក​ក៏អាច​ប្ដូរ​ពេលវេលា​របស់​មតិ​ដែរ។','You can edit the information left in a comment if needed. This is often useful when you notice that a commenter has made a typographical error.'=>'អ្នក​អាច​កែ​ព័ត៌មាន​នៅ​ក្នុង​មតិ​បាន​តាម​តម្រូវ​ការ។ នេះ​មាន​សារប្រយោជន៍ នៅ​ពេល​អ្នក​សម្គាល់​ឃើញ​ថា​អ្នក​បញ្ចេញ​មតិ​បាន​សរសេរ​ខុស​អក្ខរាវិរុទ្ធ។','Please enter your FTP or SSH credentials to proceed.'=>'សូម​បញ្ចូល​ព័ត៌មាន​សម្គាល់ FTP ឬ SSH របស់​អ្នក​ដើម្បី​បន្ត​ទៅ​មុខ​ទៀត។','Please enter your FTP credentials to proceed.'=>'សូម​បញ្ចូល​លិខិត​តែងតាំង FTP របស់​អ