d menu items. Please check or delete them.'=>'មាន​វត្ថុ​ម៉ឺនុយ​ខ្លះ​ដែល​មិន​ត្រឹម​ត្រូវ។ សូម​ពិនិត្យ ហើយ​លុប​វា។','It looks like you\'re using an old version of %s. For the best WordPress experience, please update your browser.'=>'មើល​ទៅ អ្នក​កំពុង​ប្រើ​ជំនាន់​ចាស់​នៃ %s។ ដើម្បី​ទទួល​បទពិសោធន៍​ដ៏​ល្អ​របស់ WordPress សូម​ធ្វើ​ការអាប់ដេតកម្មវិធី​អ៊ីនធឺណិត​របស់​អ្នក។','It looks like you\'re using an insecure version of %s. Using an outdated browser makes your computer unsafe. For the best WordPress experience, please update your browser.'=>'មើល​ទៅ អ្នក​កំពុង​ប្រើ​ជំនាន់​គ្មាន​សុវត្ថិភាព​នៃ %s។ ការ​ប្រើ​កម្មវិធី​អ៊ីនធឺណិត​ហួស​សម័យ​អាច​ធ្វើ​ឲ្យ​កុំព្យូទ័រ​របស់​អ្នក​គ្មាន​សុវត្ថិភាព។ ដើម្បី​ទទួល​បទពិសោធន៍​ដ៏​ល្អ​ពី WordPress សូម​ធ្វើ​បច្ចុប្បន្នភាព​កម្មវិធី​អ៊ីនធឺណិត​របស់​អ្នក។','Email Address'=>'អាស័យដ្ឋាន​អ៊ីមែល','Caution:'=>'ការ​ព្រមាន:','Settings saved.'=>'បាន​រក្សាទុក​ការ​កំណត់។','Search Users'=>'ស្វែងរក​អ្នកប្រើ','<strong>ERROR:</strong> There was an error connecting to the server, Please verify the settings are correct.'=>'<strong>កំហុស:</strong> មាន​កំហុស​ក្នុង​ការ​តភ្ជាប់​ទៅ​ម៉ាស៊ីន​បម្រើ។ សូម​ប្រាកដ​ថា​ការ​កំណត់​ទាំង​ឡាយ​គឺ​ត្រឹម​ត្រូវ​អស់​ហើយ។','ERROR: you are replying to a comment on a draft post.'=>'កំហុស: អ្នក​កំពុង​ឆ្លើយ​តប​ទៅ​មតិ​នៅ​លើ​ប្រកាស​ព្រាង។','ERROR: please type a comment.'=>'កំហុស: សូម​វាយ​បញ្ចូល​មតិ។','<a href="%1$s" class="update-browser-link">Update %2$s</a> or learn how to <a href="%3$s" class="browse-happy-link">browse happy</a>'=>'<a href="%1$s" class="update-browser-link">ធ្វើ​បច្ចុប្បន្នភាព %2$s</a> ឬ​សិក្សា​ពី​របៀប <a href="%3$s" class="browse-happy-link">រុករក​ដោយ​សប្បាយ</a>','Customize Your Site'=>'កែតម្រូវ​វេបសាយ​របស់​អ្នក','Type'=>'ប្រភេទ','%s plugins'=>'%s កម្មវិធី​បន្ថែម','%s plugin'=>'%s កម្មវិធី​បន្ថែម','The package could not be installed.'=>'មិន​អាច​ដំឡើង​កញ្ចប់​នេះ​បាន។','Plugin Homepage &#187;'=>'គេហទំព័រ​កម្មវិធី​បន្ថែម &#187;','Plugin installer section titleChangelog'=>'កំណត់​ត្រា​ផ្លាស់​ប្ដូរ','Plugin installer section title