%1$s នៅ %2$s','The backup of this post in your browser is different from the version below.'=>'ការបម្រុង​ទុក​នៃ​ប្រកាស​នេះ​នៅ​ក្នុងកម្មវិធី​អ៊ីនធឺណិត​របស់​អ្នក គឺ​ខុស​គ្នា​ពី​កំណែ​ខាង​ក្រោម។','Restore the backup'=>'ស្ដារមកវិញនូវ ​ការ​បម្រុង​ទុក','This screen is used for managing your navigation menus.'=>'អេក្រង់​នេះ​ប្រើ​ដើម្បីគ្រប់គ្រង​ម៉ឺនុយ​របស់​អ្នក។','From this screen you can:'=>'នៅ​ទំព័រ​នេះ អ្នក​អាច:','Create, edit, and delete menus'=>'បង្កើត, កែ និង​លុប​ម៉ឺនុយ','Add, organize, and modify individual menu items'=>'បន្ថែម, រៀបចំ និង​កែ​សម្រួល​ធាតុ​ម៉ឺនុយ​ដោយ​ឡែក','To edit an existing menu, <strong>choose a menu from the drop down and click Select</strong>'=>'ដើម្បី​កែ​ម៉ឺនុយ​ដែល​មាន​ស្រាប់ <strong>សូ​រើស​ម៉ឺនុយមួយ​ពី​បញ្ជី​ធ្លាក់ ហើយ​ចុច រើស</strong>','Menu Management'=>'ការគ្រប់គ្រង​ម៉ឺនុយ','Add one or several items at once by <strong>selecting the checkbox next to each item and clicking Add to Menu</strong>'=>'បន្ថែម​របស់​មួយ ឬ​ច្រើន​ក្នុង​ពេល​តែ​មួយ​ដោយ <strong>ជ្រើស​ប្រអប់​ធីក​នៅ​ក្បែរ​របស់​និមួយៗ ហើយ​ចុច បន្ថែម​ទៅ​ម៉ឺនុយ</strong>','To reorganize menu items, <strong>drag and drop items with your mouse or use your keyboard</strong>. Drag or move a menu item a little to the right to make it a submenu'=>'ដើម្បី​រៀប​ចំ​ធាតុ​ម៉ឺនុយ​ឡើង​វិញ <strong>សូម​អូស និង​ទម្លាក់​ធាតុ​ដោយ​ប្រើ​កណ្ដុរ ឬ​ក្ដារ​ចុច</strong>។ អូស ឬ​រំកិល​ធាតុ​ម៉ឺនុយ​ទៅ​ខាង​ស្ដាំ​បន្តិច​ដើម្បី​ធ្វើ​វា​ជា​ម៉ឺនុយ​រង។','Delete a menu item by <strong>expanding it and clicking the Remove link</strong>'=>'លុប​ធាតុ​ម៉ឺនុយ​ដោយ <strong>ពង្រីក​វា ហើយ​ចុច​តំណ​ដក​ចេញ </strong>','Editing Menus'=>'កំពុង​កែ​ម៉ឺនុយ','This screen is used for globally assigning menus to locations defined by your theme.'=>'អេក្រង់​នេះ​ប្រើ​ដើម្បី​ផ្ដល់​តម្លៃ​ឲ្យ​ម៉ឺនុយ​ជា​សកល​ទៅ​កាន់​ទី​តាំង​ដែល​កំណត់​ដោយ​​រូបរាងរបស់អ្នក។','You can assign theme locations to individual menus by <strong>selecting the desired settings</strong> at the bottom of the menu editor. To assign menus to all theme locations at once, <strong>visit the Manage Locations tab</strong> at the top of the screen.'=>'អ្នក​អាច​កំណត់​ទីតាំង​រូបរាង​នានា​ទៅ​ម៉ឺនុយ​មួយ ដោយ​<strong>ជ្រើស​ការ​កំណត់​ដែល​អ្នក​ចង់​បាន</strong> ដែល​ស្ថិត​នៅ​ផ្នែក​ខាង​ក្រោម​នៃ​កម្មវិធី​កែប្រែ​ម៉ឺនុយ។ ដើម្បី​កំណត់​ម៉ឺនុយ​ចំពោះ​ទីតាំង​ស្បែករូបរាង​ទាំង​អស់​ក្នុង​ពេល​តែ​ម្ដង <strong>សូម​មើល​ផ្ទាំង​គ្រប់​គ្រង​ទីតាំង</strong> ដែល​នៅ​ផ្នែក​ខាង​លើ​នៃ​ទំព័រ។','To assign menus to one or more theme locations, <strong>select a menu from each location&#8217;s drop down.</strong> When you&#8217;re finished, <strong>click Save Changes</strong>'=>'ដើម្បី​កំណត់​ម៉ឺនុយ​ចំពោះ​ទីតាំង​រូប​រាង​មួយ ឬ​ច្រើន <strong>ជ្រើស​ម៉ឺនុយ​ពី​បញ្ជី​ទីតាំង។</strong> នៅ​ពេល​រួច​រាល់​ហើយ <strong>សូម​ចុច​រក្សា​ការ​ផ្លាស់​ប្ដូរ</strong>','To edit a menu currently assigned to a theme location, <strong>click the adjacent &#8217;Edit&#8217; link</strong>'=>'ដើម្បី​កែ​ម៉ឹនុយ​ដែល​បាន​កំណត់​ទីតាំង​រូប​រាង​ហើយ <strong>សូម​ចុច​តំណ &#8217;កែប្រែ&#8217;</strong>','To add a new menu instead of assigning an existing one, <strong>click the &#8217;Use new menu&#8217; link</strong>. Your new menu will be automatically assigned to that theme location'=>'ដើម្បី​បន្ថែម​ម៉ឺនុយ​ថ្មី​ជំនួស​ការ​កំណត់​ម៉ឺនុយ​ដែល​មាន​ស្រាប់ <strong>សូម​ចុច​តំណ &#8217;ប្រើ​ម៉ឺនុយ​ថ្មី&#8217;</strong>។ ម៉ឺនុយ​ថ្មី​នឹង​ត្រូវ​កំណត់​ដោយ​ស្វ័យ​ប្រវត្តិ​ទៅ​កាន់​ទីតាំង​រូបរាង','Edit Menus'=>'កែ​ម៉ឺនុយ','Manage Locations'=>'គ្រប់គ្រង​ទីតាំង','Theme Location'=>'ទីតាំង​រូបរាង','Assigned Menu'=>'ម៉ឺនុយ​ដែល​បាន​ចាត់​ចែង','Select a Menu'=>'រើស​ម៉ឺនុយ​មួយ','menuEdit'=>'កែ','menuUse new menu'=>'ប្រើ​ម៉ឺនុយ​ថ្មី','The package contains no files.'=>'គ្មាន​ឯកសារ​នៅ​ក្នុង​កញ្ចប់។','Add menu items from the column on the left.'=>'បន្ថែម​ធាតុ​ម៉ឺនុយ​ពី​ប្រអប់​នៅ​ខាង​ឆ្វេង','Repeat Password'=>'បញ្ចូល​ពាក្យ​សម្ងាត់​ម្ដង​ទៀត','Looking for %1$s in %2$s'=>'កំពុង​រក %1$s ក្នុង %2$s','Updating to WordPress %s'=>'កំពុង​ធ្វើ​បច្ចុប្បន្នភាព​ទៅ WordPress %s','WordPress %s'=>'WordPress %s','The checksum of the file (%1$s) does not match the expected checksum value (%2$s).'=>'ឆេកសាំនៃឯកសារ (%1$s) មិនដូចគ្នានឹងតម្លៃឆេកសាំ (%2$s) ដែលបានរំពឹងទុកទេ។','This password will not be stored on the server.'=>'ពាក្យសម្ងាត់​នេះ​នឹង​មិន​ត្រូវ​រក្សាទុក​ក្នុង​ម៉ាស៊ីន​បម្រើ​ទេ។','Please provide a valid username.'=>'សូម​ផ្ដល់​ឈ្មោះ​អ្នក​ប្រើ​ដែល​ត្រឹម​ត្រូវ។','The username you provided has invalid characters.'=>'ឈ្មោះ​អ្នក​ប្រើ​ដែល​បាន​ផ្ដល់ មាន​តួ​អក្សរ​ដែល​គ្មាន​សុពលភាព។','Your passwords do not match. Please try again.'=>'ពាក្យ​សម្ងាត់​របស់​អ្នក​មិន​ត្រូវ​គ្នា។ សូម​ព្យាយាម​ម្ដង​ទៀត។','You must provide an email address.'=>'អ្នក​ត្រូវ​តែ​ផ្ដល់​អាសយដ្ឋាន​អ៊ីមែល។','Sorry, that isn&#8217;t a valid email address. Email addresses look like <code>username@example.com</code>.'=>'សូម​ទោស អាសយដ្ឋាន​អ៊ីមែល​នោះ​គ្មាន​សុពលភាព។ អាសយដ្ឋាន​អ៊ីមែល​មាន​ទម្រង់​ដូច​ជា <code>username@example.com</code> ។','Your theme does not natively support menus, but you can use them in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%s">Widgets</a> screen.'=>'រូបរាងរបស់អ្នកមិនគាំទ្រម៉ឺនុយជាធម្មជាតិឡើយ, ប៉ុន្តែអ្នកអាចប្រើវាបាននៅក្នុងរបារចំហៀងដោយបន្ថែមវិដជិត &#8220;ម៉ឺនុយផ្ទាល់ខ្លួន&#8221; នៅលើអេក្រង់ <a href="%s">វិដជិត</a>។','Menus can be displayed in locations defined by your theme, even used in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%1$s">Widgets</a> screen. If your theme does not support the navigation menus feature (the default themes, %2$s and %3$s, do), you can learn about adding this support by following the Documentation link to the side.'=>'ម៉ឺនុយ​អាច​ត្រូវបាន​បង្ហាញ​នៅ​ទីតាំង​នានា​ទៅ​តាម​ការ​កំណត់​នៃ​ពុម្ព​រូបរាង​របស់​អ្នក សូម្បី​តែ​ការ​ប្រើនៅក្នុងរបារចំហៀងដោយប្រើប្រាស់​វិដជិត &#8220;ម៉ឺនុយ​ផ្ទាល់ខ្លួន&#8221; ដែល​ស្ថិត​នៅ​ផ្ទាំង <a href="%1$s">វិដជិត</a>។ ប្រសិនបើ​រូបរាង​នោះ​មិនគាំទ្រដល់​មុខងារ​ម៉ឺនុយ​ផ្ទាល់ខ្លួន​ទេ​នោះ (រូបរាង​លំនាំ​ដើម, %2$s និង %3$s គាំទ្រ) អ្នក​អាច​រៀន​អំពីការ​បន្ថែម​មុខងារ​នេះ​តាមរយៈ​តំណ​ទៅ​កាន់​អត្ថបទ​ណែនាំ។','Some of your translations need updating. Sit tight for a few more seconds while we update them as well.'=>'ការ​បកប្រែ​ខ្លះ​របស់​អ្នក ត្រូវ​ការ​ធ្វើ​បច្ចុប្បន្នភាព។ សូម​រង់​ចាំ​សិន ពេល​នេះ​យើង​កំពុង​ធ្វើ​បច្ចុប្បន្នភាព​វា។','The translations are up to date.'=>'ការបក​ប្រែ​មាន​បច្ចុប្បន្នភាព​ហើយ។','Translation update failed.'=>'ធ្វើ​បច្ចុប្បន្នភាព​ការបកប្រែ​មិន​បាន​សម្រេច។','Upgrading to a newer version of the same theme will override changes made here. To avoid this, consider creating a <a href="%s">child theme</a> instead.'=>'ការ​ដំឡើង​ទៅ​ជំនាន់​ថ្មី​នៃ​រូបរាង​ដដែល នឹង​លុប​ចោល​បម្លាស់ប្ដូរ​ដែល​បាន​ធ្វើ​នៅ​ទីនេះ។ ដើម្បី​ចៀសវាង សូម​ពិចារណា​ក្នុង​ការ​ប្រើ <a href="%s">កូន​រូបរាង</a> ជំនួស​វិញ។','Translation updated successfully.'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព​ការបកប្រែ​ដោយ​ជោគជ័យ។','Updating theme: %s'=>'កំពុង​ធ្វើ​បច្ចុប្បន្នភាព​រូបរាង៖ %s','Updating plugin: %s'=>'កំពុង​ធ្វើ​បច្ចុប្បន្នភាព​កម្មវិធី​បន្ថែម: %s','Update Translations'=>'ធ្វើ​បច្ចុប្បន្នភាព​ការ​បកប្រែ','Updating translations for %1$s (%2$s)&#8230;'=>'កំពុង​ធ្វើ​បច្ចុប្បន្នភាព​សម្រាប់ %1$s (%2$s)&#8230;','Translations for %s'=>'ការបកប្រែ​សម្រាប់ %s','[%1$s] Your site has updated to WordPress %2$s'=>'[%1$s] វេបសាយ​របស់​អ្នក​ត្រូវ​បាន​ធ្វើ​បច្ចុប្បន្នភាព​ទៅ WordPress %2$s','[%1$s] WordPress %2$s is available. Please update!'=>'[%1$s] WordPress %2$s មាន​វត្តមាន​ហើយ។ សូម​ធ្វើ​បច្ចុប្បន្នភាព!','[%1$s] URGENT: Your site may be down due to a failed update'=>'[%1$s] បន្ទាន់: វេបសាយ​របស់​អ្នក​ប្រហែលជា​លែង​ដំណើរការ ដោយ​សារ​ធ្វើ​បច្ចុប្បន្នភាព​បរាជ័យ','Howdy! Your site at %1$s has been updated automatically to WordPress %2$s.'=>'សួស្ដី! វេបសាយ​របស់​អ្នក​នៅ %1$s ត្រូវ​បាន​ធ្វើ​បច្ចុប្បន្នភាព​ដោយ​ស្វ័យប្រវត្តិ​ទៅ WordPress %2$s ។','No further action is needed on your part.'=>'មិន​ត្រូវ​ការ​សកម្មភាព​ផ្សេង​ទៀត​ពី​ខាង​អ្នក​ឡើយ។','For more on version %s, see the About WordPress screen:'=>'សម្រាប់​អ្វីៗ​ច្រើន​ទៀត​លើ​ជំនាន់ %s, សូម​មើល​ទំព័រ អំពី WordPress:','Please update your site at %1$s to WordPress %2$s.'=>'សូម​ធ្វើ​បច្ចុប្បន្នភាព​វេបសាយ​របស់​អ្នក​នៅ %1$s ទៅ​កាន់ WordPress %2$s ។','We tried but were unable to update your site automatically.'=>'យើង​បាន​ព្យាយាម​ហើយ ប៉ុន្តែ​មិន​អាច​ធ្វើ​បច្ចុប្បន្នភាព​វេបសាយ​របស់​អ្នក​ដោយ​ស្វ័យ​ប្រវត្តិ​ឡើយ។','Updating is easy and only takes a few moments:'=>'ការ​ធ្វើ​បច្ចុប្បន្នភាព​គឺ​ងាយ​ស្រួល ហើយ​ចំណាយ​ពេល​តែ​មួយ​ភ្លែត​ប៉ុណ្ណោះ:','Your site at %1$s experienced a critical failure while trying to update to the latest version of WordPress, %2$s.'=>'វេបសាយ​របស់​អ្នក​នៅ %1$s បាន​ជួប​ប្រទះ​បញ្ហា ខណៈ​ពេល​កំពុង​ព្យាយាម​ធ្វើ​បច្ចុប្បន្នភាព​ទៅ​ជំនាន់​ចុង​ក្រោយ​របស់ WordPress, %2$s។','This means your site may be offline or broken. Don\'t panic; this can be fixed.'=>'នេះ​មាន​ន័យ​ថា​វេបសាយ​របស់​អ្នក​ប្រហែល​ជា​នៅ​ក្រៅ​បណ្ដាញ ឬ​ក៏​ខូចខាត​ហើយ។ ប៉ុន្តែ​កុំភ័យ​អី រឿង​នេះ​អាច​ដោះស្រាយ​បាន។','Please check out your site now. It\'s possible that everything is working. If it says you need to update, you should do so:'=>'សូម​ត្រួត​ពិនិត្យ​វេបសាយ​របស់​អ្នក​ឥឡូវ​នេះ។ អ្វី​គ្រប់​យ៉ាង​អាច​នឹង​ដំណើរ​ការ។ ប្រសិន​បើ​វា​ប្រាប់​ថា អ្នក​ត្រូវ​ធ្វើ​បច្ចុប្បន្នភាព នោះ​អ្នក​គួរ​តែ​ធ្វើ​តាម:','Keeping your site updated is important for security. It also makes the internet a safer place for you and your readers.'=>'ការ​ធ្វើ​បច្ចុប្បន្នភាព​វេបសាយ​គឺ​មាន​សារ​សំខាន់​ក្នុង​ការ​រក្សា​សន្តិសុខ។ វា​ក៏​ធ្វើ​ឲ្យ​បណ្ដាញ​អ៊ីនធឺណិត​ជា​កន្លែង​មាន​សុវត្ថិភាព​សម្រាប់​អ្នក និង​អ្នក​អាន​ផង​ដែរ។','If you experience any issues or need support, the volunteers in the WordPress.org support forums may be able to help.'=>'ប្រសិន​បើ​អ្នក​ជួប​ប្រទះ​បញ្ហា ឬ​ត្រូវ​ការ​ការ​គាំទ្រ​នោះ អ្នក​ស្ម័គ្រ​ចិត្ត​នៅ​វេទិកា​គាំទ្រ​របស់ WordPress.org ប្រហែល​ជា​អាច​ជួយ​អ្នក​បាន។','You also have some plugins or themes with updates available. Update them now:'=>'អ្នក​ប្រហែល​ជា​មាន​កម្មវិធី​បន្ថែម ឬ​រូបរាង​មួយ​ចំនួន​ដែល​អាច​ធ្វើ​បច្ចុប្បន្នភាព​បាន។ ធ្វើ​បច្ចុប្បន្នភាព​ពួក​វា​ឥឡូវ​នេះ៖','The WordPress Team'=>'ក្រុម​ការងារ WordPress','We have some data that describes the error your site encountered.'=>'យើង​មាន​ទិន្នន័យ​មួយ​ចំនួន​ដែល​ពិពណ៌នា​កំហុស​ដែល​វេបសាយ​អ្នក​ជួប​ប្រទះ។','Your hosting company, support forum volunteers, or a friendly developer may be able to use this information to help you:'=>'ក្រុមហ៊ុន​បង្ហោះ​វេបសាយ, អ្នក​ស្ម័គ្រ​ចិត្ត​នៅ​វេទិកា​គាំទ្រ ឬ​អ្នក​អភិវឌ្ឍ​ដែល​រាក់​ទាក់ ប្រហែល​ជា​អាច​ប្រើ​ព័ត៌មាន​នេះ ដើម្បី​ជួយ​អ្នក៖','Error code: %s'=>'កូដ​កំហុស: %s','WordPress %s is also now available.'=>'នៅ​ពេល​នេះ​មាន​វត្តមាន WordPress %s ហើយ។','Your site at %1$s experienced a critical failure while trying to update WordPress to version %2$s.'=>'វេបសាយ​របស់​អ្នក​ជួប​ប្រទះ​បញ្ហា​គួរ​កត់​សម្គាល់ %1$s នៅ​ពេល​ព្យាយាម​ធ្វើ​បច្ចុប្បន្នភាព WordPress ទៅ​ជំនាន់ %2$s ។','Your site was running version %s.'=>'វ៉ិបសាយ​របស់​អ្នក​បាន​ដំណើរ​ការ​ជំនាន់ %s ។','The following plugins were successfully updated:'=>'កម្មវិធី​បន្ថែម​ទាំង​នេះ​ត្រូវ​បាន​ធ្វើ​បច្ចុប្បន្នភាព​ដោយ​ជោគជ័យ៖','WordPress site: %s'=>'តំបន់​បណ្ដាញ WordPress៖ %s','SUCCESS: WordPress was successfully updated to %s'=>'ជោគជ័យ: WordPress ត្រូវ​បាន​ធ្វើ​បច្ចុប្បន្នភាព​ទៅ %s ដោយ​ជោគជ័យ','FAILED: WordPress failed to update to %s'=>'មិន​បាន​សម្រេច: WordPress បាន​បរាជ័យ​ក្នុង​ការ​ធ្វើ​បច្ចុប្បន្នភាព​ទៅ %s','SUCCESS: %s'=>'ជោគជ័យ: %s','FAILED: %s'=>'មិន​បាន​សម្រេច: %s','Quick Draft'=>'ការព្រាង​រហ័ស','What&#8217;s on your mind?'=>'តើ​អ្នក​កំពុង​គិត​ពីអ្វី?','Publishing Soon'=>'នឹង​ផ្សាយ​ឆាប់ៗ​នេះ','Recently Published'=>'ដែល​ទើប​បាន​ផ្សាយ​ថ្មីៗ','No activity yet!'=>'មិនទាន់​មាន​សកម្មភាព!','Tomorrow'=>'ស្អែក','Popular Plugin'=>'កម្មវិធី​បន្ថែម​ដែល​ពេញនិយម','Manage Uploads'=>'គ្រប់គ្រង​ការ​ផ្ទុកឡើង','At a Glance'=>'នៅ​ពេល​ឥឡូវ​នេះ','The following themes were successfully updated:'=>'រូបរាង​ទាំងនេះ​ត្រូវ​បាន​ធ្វើ​បច្ចុប្បន្នភាព​ដោយ​ជោគជ័យ៖','The following translations were successfully updated:'=>'ការ​បក​ប្រែ​ទាំង​នេះ​ត្រូវ​បាន​ធ្វើ​បច្ចុប្បន្នភាព​ដោយ​ជោគជ័យ៖','The following plugins failed to update:'=>'កម្មវិធី​បន្ថែម​ទាំងនេះ​ធ្វើ​បច្ចុប្បន្នភាព​មិន​បាន​សម្រេច៖','The following themes failed to update:'=>'រូបរាង​ទាំងនេះ​បាន​បរាជ័យ​ក្នុង​ការ​ធ្វើ​បច្ចុប្បន្នភាព៖','The following translations failed to update:'=>'ការ​បក​ប្រែ​នេះ​មិន​បាន​ធ្វើ​បច្ចុប្បន្ន​ភាព​ឡើយ៖','Rollback Error: [%1$s] %2$s'=>'កំហុស​ការ​បកក្រោយ: [%1$s] %2$s','%s rating'=>'%s រង្វាយ​តម្លៃ','%s Post'=>'%s ប្រកាស','%s Page'=>'%s ទំព័រ','M jS'=>'M jS','%s MB Space Allowed'=>'អនុញ្ញាត​ចំណុះ %s MB','%1$s MB (%2$s%%) Space Used'=>'បាន​ប្រើ​អស់​ចំណុះ %1$s MB (%2$s%%)','Active Installations:'=>'ការដំឡើងកំពុងដំណើរការ:','Custom installation script.'=>'ស្រ្គីបសម្រាប់ដំឡើងផ្ទាល់ខ្លួន។','Theme Installation'=>'ការដំឡើងរូបរាងវេបសាយ','%d star'=>'%d ផ្កាយ','Manage widgets'=>'គ្រប់គ្រង​វិដជិត','Manage menus'=>'គ្រប់គ្រង​ម៉ឺនុយ','themesFeatured'=>'ដែល​លេច​ធ្លោ','themesLatest'=>'ថ្មី​បំផុត','%s failed to embed.'=>'មិន​អាច​បង្កប់ %s បាន។','If you reach out to us, we\'ll also ensure you\'ll never have this problem again.'=>'ប្រសិន​បើ​អ្នក​មក​រកពួក​យើង ពួក​យើង​ប្រាកដ​ថា​អ្នក​នឹង​មិន​ជួប​ប្រទះ​បញ្ហា​នេះ​ម្ដង​ទៀត​ទេ។','https://codex.wordpress.org/First_Steps_With_WordPress'=>'https://codex.wordpress.org/First_Steps_With_WordPress','<a href="https://codex.wordpress.org/Appearance_Menus_Screen">Documentation on Menus</a>'=>'<a href="https://codex.wordpress.org/Appearance_Menus_Screen">ឯកសារ​ស្ដី​ពីម៉ឺនុយ</a>','<a href="https://codex.wordpress.org/Plugins_Editor_Screen">Documentation on Editing Plugins</a>'=>'<a href="https://codex.wordpress.org/Plugins_Editor_Screen">ឯកសារ​ស្ដី​ពីការ​កែ​កម្មវិធី​បន្ថែម</a>','<a href="https://codex.wordpress.org/Administration_Screens#Comments">Documentation on Comments</a>'=>'<a href="https://codex.wordpress.org/Administration_Screens#Comments">ឯកសារ​ស្ដីពីមតិ</a>','<a href="https://codex.wordpress.org/Settings_General_Screen">Documentation on General Settings</a>'=>'<a href="https://codex.wordpress.org/Settings_General_Screen">ឯកសារ​ស្ដី​ពីការ​កំណត់​ទូទៅ</a>','<a href="https://codex.wordpress.org/Dashboard_My_Sites_Screen">Documentation on My Sites</a>'=>'<a href="https://codex.wordpress.org/Dashboard_My_Sites_Screen">ឯកសារ​ស្ដី​ពីវេបសាយ​របស់​ខ្ញុំ</a>','<a href="https://codex.wordpress.org/Writing_a_Plugin">Documentation on Writing