 Template'=>'ភ្ជាប់គំរូក្បាលទំព័រ','Embed Footer Template'=>'ភ្ជាប់គំរូជើងទំព័រ','Sorry, you are not allowed to access this page.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យចូលដំណើរការក្នុងទំព័រនេះទេ។','Close media attachment panel'=>'បិទផ្ទាំងមេឌាឯកសារភ្ជាប់','This will replace the current editor content with the last backup version. You can use undo and redo in the editor to get the old content back or to return to the restored version.'=>'ទង្វើនេះនឹងជំនួសមាតិកាកម្មវិធីនិពន្ធបច្ចុប្បន្ន ជាមួយនឹងកំណែបម្រុងទុកចុងក្រោយ។ អ្នកអាចប្រើ undo និង redo ក្នុងការកែសម្រួលដើម្បីទាញយកមាតិការចាស់ត្រឡប់មកវិញ ឬដើម្បីត្រឡប់ទៅកំណែដែលធ្លាប់បានស្ដារឡើងវិញហើយ។','Manage with Live Preview'=>'គ្រប់គ្រងជាមួយ ការមើលជាមុនដោយផ្ទាល់','Sorry, you are not allowed to edit plugins for this site.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឪ្យកែប្រែកម្មវិធីបន្ថែម សម្រាប់វេបសាយនេះទេ។','Sorry, you are not allowed to edit templates for this site.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឪ្យកែប្រែពុម្ពគំរូ សម្រាប់វេបសាយនេះទេ។','Sorry, you are not allowed to update themes for this site.'=>'សូមទោស, អ្នកមិនត្រូវបានអនុញ្ញាត​ឱ្យ​អាប់ដេតរូបរាង សម្រាប់វេបសាយនេះទេ។','Search plugins by:'=>'ស្វែងរកកម្មវិធីបន្ថែម ដោយ៖','https://wordpress.org/plugins/'=>'https://km.wordpress.org/plugins/','Sorry, you are not allowed to attach files to this post.'=>'សំុទោស, អ្នកមិនត្រូវបានអនុញ្ញាតឱ្យភ្ជាប់ឯកសារទៅប្រកាសនេះទេ។','&#8220;%s&#8221; is locked'=>'&#8220;%s&#8221; គឺត្រូវបានចាក់សោរ។','Search plugins...'=>'ស្វែងរកកម្មវិធីបន្ថែម...','Current Header Image'=>'ផ្នែកក្បាលនៃរូបភាពបច្ចុប្បន្ន','Current Background Image'=>'រូបភាពផ្ទៃខាងក្រោយបច្ចុប្បន្ន','Choose either a city in the same timezone as you or a UTC timezone offset.'=>'ជ្រើសទីក្រុងមួយដែលនៅក្នុងល្វែងម៉ោងដូចអ្នក ឬក៏ល្វែងម៉ោង UTC ដែលកាត់ខាងចុង។','Plugin Installation'=>'ការដំឡើងកម្មវិធីបន្ថែម','WordPress Events and News'=>'ព្រឹត្តិការណ៍ និងពត៌មាន WordPress','Meetups'=>'ការជួបជុំ','WordCamps'=>'WordCamps','Edit city'=>'កែសម្រួលទីក្រុង','City:'=>'ទីក្រុង:','Cincinnati'=>'Cincinnati','Attend an upcoming event near %s.'=>'ចូលរួមព្រឹត្តិការណ៍នាពេលខាងមុខនៅជិត %s.','There aren&#8217;t any events scheduled near %1$s at the moment. Would you like to <a href="%2$s">organize one</a>?'=>'មិនមានព្រឹត្តិការណ៍ណាមួយដែលបានកំណត់ពេលនៅក្បែរ %1$s នៅពេល​នេះទេ។ តើអ្នកចង់ <a href="%2$s">រៀបចំមួយ</a> ឬទេ?','https://make.wordpress.org/community/handbook/meetup-organizer/welcome/'=>'https://make.wordpress.org/community/handbook/meetup-organizer/welcome/','There aren&#8217;t any events scheduled near you at the moment. Would you like to <a href="%s">organize one</a>?'=>'ពុំមានព្រឹត្តិការណ៍ណាមួយនឹងប្រព្រឹត្តឡើងនៅជិតអ្នកនៅពេលនេះនោះទេ។ តើអ្នកចង់ <a href="%s">រៀបចំមួយ</a>ឬទេ?','Unable to add data to export file.'=>'ពុំអាចបញ្ចូលទិន្នន័យទៅក្នុងហ្វាល់ដើម្បីនាំចេញទេ។','Did you know?'=>'តើអ្នកបានដឹងទេ?','Your Recent Drafts'=>'ប្រកាសព្រាងថ្មីៗរបស់អ្នក','Events and News dashboard widgethttps://wordpress.org/news/'=>'https://wordpress.org/news/','Your PHP code changes were rolled back due to an error on line %1$s of file %2$s. Please fix and try saving again.'=>'កំណែប្រែកូដ PHP ត្រូវបានលុបចោលដោយសារមានកំហុសកើតឡើងនៅបន្ទាត់ទី %1$s នៃឯកសារ %2$s។ សូមកែតម្រូវវារួចហើយព្យាយាមម្ដងទៀត។','Unable to write to file.'=>'មិនអាសរសេរលើឯកសារបាន។','There was an error while trying to update the file. You may need to fix something and try updating again.'=>'មានកំហុសមួយកើតឡើងកំឡុងពេលព្យាយាមអាប់ឡូដហ្វាល់។ សូមពិនិត្យរាល់កំហុសឆ្គងបើមាន និងសូមព្យាយាមអាប់ដេតម្ដងទៀត។','Selected file content:'=>'មាតិកានៃហ្វាល់ដែលបានជ្រើស:','<strong>Warning:</strong> Making changes to active plugins is not recommended.'=>'<strong>ការព្រមាន:</strong> ការកែប្រែលើកម្មវិធីបន្ថែមដែលកំពុងដំណើរការគួរជៀសវាង។','Heads up!'=>'ប្រុងប្រយ័ត្ន!','I understand'=>'ខ្ញុំយល់ស្រប','Activate Press This'=>'ដាក់អោយដំណើរការប្រែសឌីស','Press This is not installed. Please install Press This from <a href="%s">the main site</a>.'=>'ប្រែសឌីសមិនបានដំឡើង។ សូមដំឡើងប្រែសឌីសពី <a href="%s">វេបសាយមេ</a>។','Press This is not available. Please contact your site administrator.'=>'ប្រែសឌីសពុំបានដំឡើង។ សូមទាក់ទងទៅកាន់អ្នកគ្រប់គ្រងវេបសាយរបស់អ្នក។','Could not fully remove the plugin %s.'=>'មិនអាចលុបកម្មវិធីបន្ថែម %s ទាំងស្រុងបានទេ។','Installation Required'=>'ទាមទារការដំឡើង','Theme Files'=>'ឯកសារនៃរូបរាងវេបសាយ','Customization Draft'=>'ពង្រាងការកែសម្រួល','Likely direct inclusion of %1$s in order to use %2$s. This is very wrong. Hook the %2$s call into the %3$s action instead.'=>'ដូចជាមានការបញ្ចូលដោយផ្ទាល់នូវ %1$s ដើម្បីអាចប្រើ %2$s បាន។ នេះជាកំហុសដ៏ធ្ងន់ធ្ងរបំផុត។ សូមភ្ជាប់នូវ %2$s ដើម្បីហៅទៅកាន់សកម្មភាព %3$s ជំនួសវិញ។','Unable to communicate back with site to check for fatal errors, so the PHP change was reverted. You will need to upload your PHP file change by some other means, such as by using SFTP.'=>'ពុំអាចភ្ជាប់ទំនាក់ទំនងទៅកាន់វេបសាយឡើងវិញបានទេ ដើម្បីរកមើលកំហុសធ្ងន់ធ្ងរ ដូច្នេះហើយកំណែប្រែទាំងឡាយនៅលើកូដ PHP ត្រូវបានកែត្រឡប់វិញ។ អ្នកនឹងត្រូវអាប់ឡូដហ្វាល់ PHP ដែលបានកែរបស់អ្នកដោយមធ្យោបាយផ្សេងទៀត ដូចជាប្រើ SFTP ជាដើម។','Downloading translation from %s&#8230;'=>'ដោនឡូដបំណកប្រែពី %s&#8230;','Enter the address here if you <a href="%s">want your site home page to be different from your WordPress installation directory</a>.'=>'បញ្ចូលអាសយដ្ឋាននៅទីនេះ បើអ្នក <a href="%s">ចង់អោយទំព័រដើមនៃវេបសាយរបស់អ្នកផ្សេងពីបញ្ជីផ្ទុកការដំឡើង WordPress </a>។','https://codex.wordpress.org/Giving_WordPress_Its_Own_Directory'=>'https://codex.wordpress.org/Giving_WordPress_Its_Own_Directory','You appear to be making direct edits to your plugin in the WordPress dashboard. We recommend that you don&#8217;t! Editing plugins directly may introduce incompatibilities that break your site and your changes may be lost in future updates.'=>'អ្នកកំពុងតែធ្វើការកែដោយផ្ទាល់ទៅលើកម្មវិធីបន្ថែមរបស់អ្នកនៅលើផ្ទាំងគ្រប់គ្រងនៃ WordPress។ យើងសូមណែនាំឲ្យអ្នកចៀសវាងទង្វើនេះ! ការកែនូវកម្មវិធីបន្ថែមដោយផ្ទាល់ អាចបង្កជាការមិនដំណើការណាមួយដែលអាចបង្កបញ្ហាដល់វេបសាយរបស់អ្នក ឬមួយក៏ការកែរបស់អ្នកអាចនឹងបាត់បង់នៅពេលដែលមានការអាប់ដេតណាមួយនាពេលអនាគត។','There&#8217;s no need to change your CSS here &mdash; you can edit and live preview CSS changes in the <a href="%s">built-in CSS editor</a>.'=>'អ្នកពុំចាំបាច់កែ CSS របស់អ្នកនៅទីនេះទេ &mdash; អ្នកអាចកែវា និងមើលជាមុនដោយផ្ទាល់នូវ កំណែប្រែរបស់ CSS នៅ <a href="%s">កម្មវិធីកែ CSS ដែលមានស្រាប់</a>។','Requires PHP Version:'=>'តម្រូវការ PHP ជំនាន់៖','Invalid email address in request.'=>'អ៊ីមែលដែលបានស្នើពុំត្រឹមត្រូវ។','Eraser index cannot be less than one.'=>'លិបិក្រមលុប មិនអាចតិចជាងមួយទេ។','If you absolutely have to make direct edits to this plugin, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'ប្រសិនបើអ្នកពិតជាចង់កែដោយផ្ទាល់នៅលើកម្មវិធីបន្ថែមនេះ សូមប្រើកម្មវិធីគ្រប់គ្រងហ្វាល់ណាមួយដើម្បីបង្កើតហ្វាល់ចម្លងដោយដាក់ឈ្មោះថ្មី និងរក្សាទម្រង់នៃហ្វាល់ដើមជាមុនសិន។ តាមរយៈវិធីនេះ អ្នកអាចដាក់ឲ្យដំណើការឡើងវិញនូវកំណែដែលដំណើការ ប្រសិនបើមានកំហុសណាមួយកើតឡើង។','You appear to be making direct edits to your theme in the WordPress dashboard. We recommend that you don&#8217;t! Editing your theme directly could break your site and your changes may be lost in future updates. If you need to tweak more than your theme&#8217;s CSS, you might want to try <a href="%s">making a child theme</a>.'=>'អ្នកកំពុងតែធ្វើការកែដោយផ្ទាល់ទៅលើរូបរាងវេបសាយរបស់អ្នកនៅលើផ្ទាំងគ្រប់គ្រងនៃ WordPress។ យើងសូមណែនាំឲ្យអ្នកចៀសវាងទង្វើនេះ! ការកែនូវរូបរាងវេបសាយរបស់អ្នកដោយផ្ទាល់ អាចធ្វើឲ្យវេបសាយរបស់អ្នកមានបញ្ហា ឬក៏ការកែរបស់អ្នកអាចនឹងត្រូវបាត់បង់នៅពេលដែលមានការអាប់ដេតណាមួយនាពេលអនាគត។ ប្រសិនបើអ្នកចង់កែច្រើនជាជាងការកែតែហ្វាល់ CSS សូមសាកល្បង <a href="%s">បង្កើតរូបរាងកូន</a>។','If you decide to go ahead with direct edits anyway, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'ប្រសិនបើអ្នកសម្រេចចិត្តថានឹងបន្តដោយការកែប្រែដោយផ្ទាល់ហើយនោះ សូមប្រើកម្មវិធីគ្រប់គ្រងឯកសារដើម្បីបង្កើតនូវឯកសារបម្រុងទុក ដោយប្រើឈ្មោះថ្មី ហើយប្រហាក់ប្រហែលរីជាមួយនឹងឯកសារដើម។ ដោយប្រើមធ្យោបាយនេះ អ្នកអាចដាក់អោយប្រើឡើងវិញនូវកំណែដែលដំណើរការប្រសិនបើមានកំហុសអ្វីមួយកើតឡើង។','Page index cannot be less than one.'=>'លិបិក្រមទំព័រមិនអាចតិចជាងមួយទេ។','Expected an array describing the eraser at index %d.'=>'រំពឹង array មួយដែលបរិយាយពី eraser នៅលិបិក្រមទី %d។','Eraser array at index %d does not include a friendly name.'=>'Eraser array នៅលិបិក្រមទី %d ពុំមានឈ្មោះដែលងាយយល់នោះទេ។','Did not receive array from %1$s eraser (index %2$d).'=>'ពុំទទួលបាន array ពី  %1$s eraser (លិបិក្រម %2$d) ឡើយ។','Expected items_removed key in response array from %1$s eraser (index %2$d).'=>'រំពឹងលេខសម្គាល់ items_removed ដែលបោះមកជា array ពី %1$s eraser (លិបិក្រម %2$d)។','Expected items_retained key in response array from %1$s eraser (index %2$d).'=>'រំពឹង items_retained key នៅក្នុង array ដែលជាការឆ្លើយតបពី %1$s eraser (index %2$d)។','Expected messages key in response array from %1$s eraser (index %2$d).'=>'រំពឹងនូវ messages key របស់ array ដែលជាការឆ្លើយតបពី %1$s eraser (index %2$d)។','Expected messages key to reference an array in response array from %1$s eraser (index %2$d).'=>'រំពឹងនូវ messages key ដើម្បីធ្វើការ reference នូវ array មួយដែលជាការឆ្លើយតបទៅនឹង array ពី %1$s eraser (index %2$d)។','Expected done flag in response array from %1$s eraser (index %2$d).'=>'រំពឹង done flag ដែលបោះមកវិញជា array ពី %1$s eraser (លិបិក្រម %2$d)។','Invalid request ID.'=>'ID នៃសំណើពុំត្រឹមត្រូវ។','A valid email address must be given.'=>'ទាមទារឲ្យផ្ដល់អាសយដ្ឋានអ៊ីមែលដែលត្រឹមត្រូវ។','Unable to generate export file. ZipArchive not available.'=>'ពុំអាចបង្កើតជាហ្វាល់សម្រាប់នាំចេញបានទេ។ ពុំមាន ZipArchive ដំណើរការនោះទេ។','Invalid request ID when generating export file.'=>'ID ដែលបានស្នើ ពុំត្រឹមត្រូវនោះទេ នៅកំឡុងពេលបង្កើតហ្វាល់សម្រាប់នាំចេញ។','Invalid email address when generating export file.'=>'អាសយដ្ឋានអ៊ីមែលពុំត្រឹមត្រូវពេលកំពុងបង្កើតហ្វាល់សម្រាប់នាំចេញ។','Unable to protect export folder from browsing.'=>'ពុំអាចទប់ស្កាត់នូវការមើលលើថតដែលមានផ្ទុកហ្វាល់ដែលបាននាំចេញទេ។','Unable to open export file (HTML report) for writing.'=>'ពុំអាចបើកហ្វាល់ដែលបាននាំចេញ (របាយការណ៍ HTML) ដើម្បីបញ្ចូលទិន្នន័យបានទេ។','Personal Data Export for %s'=>'នាំចេញទិន្នន័យផ្ទាល់ខ្លួនសម្រាប់ %s','Personal Data Export'=>'នាំចេញទិន្នន័យផ្ទាល់ខ្លួន','Unable to open export file (archive) for writing.'=>'ពុំអាចធ្វើការបើកហ្វាល់នាំចេញ (បណ្ណសារ) ដើម្បីបញ្ចូលទិន្នន័យបានទេ។','Invalid request ID when sending personal data export email.'=>'ID ដែលបានស្នើ ពុំត្រឹមត្រូវ ពេលផ្ញើអ៊ីមែលដែលមានភ្ជាប់ទិន្នន័យផ្ទាល់ខ្លួន។','[%s] Personal Data Export'=>'[%s] នាំចេញទិន្នន័យផ្ទាល់ខ្លួន','Unable to send personal data export email.'=>'ពុំអាចផ្ញើអ៊ីមែលដែលមានភ្ជាប់ទិន្នន័យផ្ទាល់ខ្លួនបានទេ។','Invalid request ID when merging exporter data.'=>'ID ដែលបានស្នើ ពុំត្រឹមត្រូវនៅពេលដែលធ្វើការភ្ជាប់ទិន្នន័យរវាង exporter។','Howdy,

Your request for an export of personal data has been completed. You may
download your personal data by clicking on the link below. For privacy
and security, we will automatically delete the file on ###EXPIRATION###,
so please download it before then.

###LINK###

Regards,
All at ###SITENAME###
###SITEURL###'=>'សួស្ដី,

សំណើរបស់អ្នកក្នុងការនាំចេញនូវទិន្នន័យផ្ទាល់ខ្លួនរបស់អ្នក ត្រូវបានបញ្ចប់ហើយ។ អ្នកអាចដោនឡូដ
នូវទិន្នន័យផ្ទាល់ខ្លួនរបស់អ្នកបាន ដោយចុចលើតំណខាងក្រោម។ សម្រាប់ឯកជនភាព
និងសុវត្ថិភាព យើងនឹងលុបហ្វាល់នោះដោយស្វ័យប្រវត្តិនៅ ###EXPIRATION###,
ដូចនេះសូមដោនឡូដវាឲ្យបានមុន។

