###SITEURL###','The suggested privacy policy content should be added only in wp-admin by using the %s (or later) action.'=>'ខ្លឹមសារនៃគោលការណ៍ឯកជនភាពដែលបានស្នើ គួរត្រូវបានបញ្ចូលតែនៅលើ wp-admin ដោយការប្រើសកម្មភាព %s (ឬ ពេលក្រោយ)។','Unable to create a Privacy Policy page.'=>'ពុំអាចបង្កើតទំព័រគោលការណ៍ឯកជនភាពបានទេ។','The currently selected Privacy Policy page does not exist. Please create or select a new page.'=>'ទំព័រគោលការណ៍ឯកជនភាពដែលបានជ្រើស ពុំមានទេ។ សូមបង្កើតថ្មី ឬក៏ជ្រើសពីទំព័រថ្មីមួយ។','The currently selected Privacy Policy page is in the trash. Please create or select a new Privacy Policy page or <a href="%s">restore the current page</a>.'=>'ទំព័រគោលការណ៍ឯកជនភាពដែលបានជ្រើស ស្ថិតនៅក្នុងធុងសម្រាម។ សូមបង្កើតថ្មី ឬជ្រើសពីទំព័រថ្មីមួយ ឬក៏ <a href="%s">យកចេញពីធុងសម្រាមមកវិញ</a>។','Privacy Policy page'=>'ទំព័រគោលការណ៍ឯកជនភាព','If you already have a Privacy Policy page, please select it below. If not, please create one.'=>'ប្រសិនបើអ្នកមានទំព័រគោលការណ៍ឯកជនភាពរួចហើយ សូមជ្រើសយកវាពីខាងក្រោម។ ប្រសិនបើពុំទាន់មានទេ សូមបង្កើតថ្មីមួយ។','The new page will include help and suggestions for your Privacy Policy.'=>'ទំព័រថ្មីនឹងបញ្ចូលនូវជំនួយ និងការណែនាំផ្សេងៗសម្រាប់គោលការណ៍ឯកជនភាពរបស់អ្នក។','However, it is your responsibility to use those resources correctly, to provide the information that your Privacy Policy requires, and to keep that information current and accurate.'=>'ទោះយ៉ាងណា វាគឺជាទំនួលខុសត្រូវរបស់អ្នកក្នុងការប្រើធនធានទាំងនោះដោយត្រឹមត្រូវ ដើម្បីផ្ដល់នូវព័ត៌មានដែលគោលការណ៍ឯកជនភាពរបស់អ្នកតម្រូវ និងដើម្បីរក្សាព័ត៌មានទាំងនោះឲ្យនៅតែថ្មី និងត្រឹមត្រូវ។','We would also suggest reviewing your Privacy Policy from time to time, especially after installing or updating any themes or plugins. There may be changes or new suggested information for you to consider adding to your policy.'=>'យើងសូមស្នើឲ្យមានការពិនិត្យឡើងវិញនូវគោលការណ៍ឯកជនភាពរបស់អ្នកឲ្យបានញឹកញាប់ ជាពិសេសគឺនៅពេលតម្លើង ឬក៏អាប់ដេតនូវរូបរាងវេបសាយ ឬកម្មវិធីបន្ថែមផ្សេងៗ។ អាចនឹងមានការផ្លាស់ប្ដូរនានា ឬក៏ព័ត៌មានថ្មីៗដែលបានណែនាំឲ្យអ្នកដាក់បញ្ចូលទៅក្នុងគោលការណ៍របស់អ្នកផងដែរ។','<a href="%1$s">Edit</a> or <a href="%2$s">view</a> your Privacy Policy page content.'=>'<a href="%1$s">កែប្រែ</a> ឬក៏ <a href="%2$s">មើល</a> ខ្លឹមសារនៃទំព័រគោលការណ៍ឯកជនភាពរបស់អ្នក។','Change your Privacy Policy page'=>'ប្ដូរទំព័រគោលការណ៍ឯកជនភាពរបស់អ្នក','Select a Privacy Policy page'=>'ជ្រើសយកទំព័រគោលការណ៍ឯកជនភាពមួយ','Use This Page'=>'ប្រើទំព័រនេះ','Create New Page'=>'បង្កើតទំព័រថ្មី','Invalid request type.'=>'ប្រភេទនៃការស្នើពុំត្រឹមត្រូវ។','Missing exporter index.'=>'ពុំឃើញមានលិបិក្រម exporter។','Missing page index.'=>'ពុំឃើញមានលិបិក្រមទំព័រ។','An exporter has improperly used the registration filter.'=>'exporter មួយបានប្រើនូវចម្រោះនៃការចុះឈ្មោះពុំត្រឹមត្រូវ។','Exporter index cannot be negative.'=>'លិបិក្រម Exporter ពុំអាចអវិជ្ជមានបានទេ។','Expected an array describing the exporter at index %s.'=>'រំពឹងនូវ array មួយដែលបរិយាយពី exporter នៅលិបិក្រមទី %s។','Exporter does not include a callback: %s.'=>'Exporter ពុំឃើញមានបញ្ចូល callback៖ %s ទេ។','Exporter callback is not a valid callback: %s.'=>'Exporter callback ពុំមែនជា callback ដែលត្រឹមត្រូវទេ៖ %s។','Expected response as an array from exporter: %s.'=>'រំពឹងទុកនូវការបោះទៅវិញនូវ ជា array ពី exporter ៖ %s។','Expected data in response array from exporter: %s.'=>'ទិន្នន័យត្រូវបានរំពឹងទុក ក្នុងការបោះទៅវិញនូវ array ពី exporter ៖ %s។','Expected data array in response array from exporter: %s.'=>'array នៃទិន្នន័យត្រូវបានរំពឹងទុក ក្នុងការបោះទៅវិញនូវ array ពី exporter ៖ %s។','Expected done (boolean) in response array from exporter: %s.'=>'done ត្រូវបានរំពឹងទុក (boolean) ក្នុងការបោះទៅវិញនូវ array ពី exporter ៖ %s។','Missing eraser index.'=>'បាត់លិបិក្រុមនៃការលុប។','Eraser index is out of range.'=>'លិបិក្រុមនៃការលុបលើសពីដែនកំណត់។','Exporter array at index %s does not include a friendly name.'=>'Exporter array នៅលិបិក្រុម %s ពុំមានបញ្ចូលឈ្មោះដែលងាយស្រួលហៅនោះទេ។','email addressReport generated for'=>'របាយការណ៍បង្កើតសម្រាប់','website nameFor site'=>'សម្រាប់វេបសាយ','website URLAt URL'=>'នៅ','date/timeOn'=>'នៅ','As a website owner, you may need to follow national or international privacy laws. For example, you may need to create and display a Privacy Policy.'=>'ក្នុងនាមជាម្ចាស់វេបសាយ អ្នកត្រូវតែគោរពនូវច្បាប់ឯកជនភាពជាតិ និងអន្តរជាតិ។ ឧទាហរណ៍, អ្នកនឹងត្រូវការបង្កើត និងបង្ហាញនូវគោលការណ៍ឯកជនភាពមួយ។','After your Privacy Policy page is set, we suggest that you edit it.'=>'ក្រោយពេលដែលទំព័រគោលការណ៍ឯកជនភាពរបស់អ្នកត្រូវបានកំណត់ យើងសូមណែនាំអោយអ្នកធ្វើការកែវា។','Or:'=>'ឬក៏:','There are no pages.'=>'ពុំមានទំព័រណាមួយទេ។','Unable to create export folder.'=>'ពុំអាចបង្កើតសឺមីសម្រាប់នាំចេញបានទេ។','The suggested privacy policy content should be added by using the %s (or later) action. Please see the inline documentation.'=>'ខ្លឹមសារនៃគោលការណ៍ឯកជនភាពដែលបានផ្ដល់ឲ្យ គួរត្រូវបានដាក់បញ្ចូលដោយការ %s (ឬពេលក្រោយ)។ សូមមើលលំណែនាំនៅក្នុងបន្ទាត់។','Need help putting together your new Privacy Policy page? <a href="%1$s" %2$s>Check out our guide%3$s</a> for recommendations on what content to include, along with policies suggested by your plugins and theme.'=>'ត្រូវការជំនួយក្នុងការដាក់បញ្ចូលគ្នាជាមួយនឹងទំព័រគោលការណ៍ឯកជនភាពរបស់អ្នកមែនទេ? <a href="%1$s" %2$s>មើលសេចក្ដីណែនាំរបស់យើង%3$s</a> សម្រាប់ជាអនុសាសន៍ ថាតើមាតិកាបែបណានឹងត្រូវបញ្ចូល ជាមួយនឹងគោលការណ៍ដែលបានណែនាំដោយកម្មវិធីបន្ថែមរបស់អ្នក និងរូបរាងវេបសាយរបស់អ្នក។','Privacy Policy page updated successfully.'=>'ទំព័រគោលការណ៍ឯកជនភាពត្រូវបានអាប់ដេតដោយជោគជ័យ។','Privacy Policy Page'=>'ទំព័រគោលការណ៍ឯកជនភាព','<a href="%1$s">Edit</a> or <a href="%2$s">preview</a> your Privacy Policy page content.'=>'<a href="%1$s">កែ</a> ឬ <a href="%2$s">មើលផ្ទាល់</a> នូវមាតិកានៃទំព័រគោលការណ៍ឯកជនភាពរបស់អ្នក។','personal data group labelAbout'=>'អំពី','This meta box, from the %s plugin, isn\'t compatible with the block editor.'=>'ប្រអប់មេតាដែលបានមកពីកម្មវិធីបន្ថែម %s មិនដំណើរការជាមួយនឹងកម្មវិធីនិពន្ធប្លុកនោះទេ។','Export &#8220;%s&#8221; as JSON'=>'នាំចេញ &#8220;%s&#8221; ជា JSON','Export as JSON'=>'នាំចេញជា JSON','This meta box isn\'t compatible with the block editor.'=>'ប្រអប់មេតានេះពុំត្រូវគ្នាជាមួយនឹងកម្មវិធីនិពន្ធរបស់ប្លុកនេះទេ។','Please install the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'សូមតម្លើង <a href="%s">កម្មវិធីបន្ថែម «Classic Editor»</a> ដើម្បីប្រើប្រអប់មេតានេះ។','Please activate the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'សូមដាក់ឲ្យដំណើរការនូវ <a href="%s">កម្មវិធីបន្ថែម «Classic Editor»</a> ដើម្បីប្រើប្រអប់មេតានេះ។','Please open the <a href="%s">classic editor</a> to use this meta box.'=>'សូមបើក <a href="%s">កម្មវិធីនិពន្ធចាស់</a> ដើម្បីប្រើប្រអប់មេតានេះ។','&laquo;'=>'&laquo;','&raquo;'=>'&raquo;','g:i:s a'=>'g:i:s a','Draft saved at %s.'=>'បាន​រក្សា​ទុក​ការ​ព្រាង​នៅ %s។','Item not updated.'=>'វត្ថុ​នេះ​មិន​ត្រូវ​បាន​ធ្វើ​បច្ចុប្បន្នភាព​ទេ។','%s is currently editing'=>'%s កំពុង​កែ​សម្រួល','View &#8220;%s&#8221;'=>'ទិដ្ឋភាព &#8220;%s&#8221;','Unpublished'=>'មិន​បាន​ផ្សាយ','(Unattached)'=>'(មិន​បាន​ភ្ជាប់)','Attach'=>'ភ្ជាប់','Unapprove'=>'មិន​យល់​ព្រម','Approve'=>'យល់ព្រម','Pings'=>'Pings','Empty Spam'=>'សម្អាត​ស្ប៉ាម','Empty Trash'=>'សម្អាត​ធុងសំរាម','No comments found.'=>'រក​មិន​ឃើញ​មតិ។','Send Trackbacks'=>'ផ្ញើ trackbacks','Update Link'=>'ធ្វើ​បច្ចុប្បន្នភាព​តំណ','Item deleted.'=>'បាន​លុប​វត្ថុ។','Item updated.'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព​វត្ថុ។','Item not added.'=>'វត្ថុ​មិន​ត្រូវ​បាន​បន្ថែម។','Items deleted.'=>'បាន​លុប​វត្ថុ។','Excerpt View'=>'ទិដ្ឋភាព​អត្ថបទ​ដកស្រង់','Continue'=>'បន្ត','Posts'=>'ប្រកាស','Blogger'=>'Blogger','LiveJournal'=>'LiveJournal','widgetAdd'=>'បន្ថែម','widgetEdit'=>'កែប្រែ','Search by tag'=>'ស្វែងរក​តាម​ស្លាក','Search by author'=>'ស្វែងរក​តាម​អ្នកនិពន្ធ','Search by keyword'=>'ស្វែងរក​តាម​ពាក្យគន្លឹះ','Type of search'=>'ប្រភេទ​ស្វែងរក','Screen Options Tab'=>'ផ្ទាំង​ជម្រើស​បង្ហាញ','Movable Type and TypePad'=>'Movable Type និង TypePad','Select comment'=>'រើស​មតិ','Blogroll'=>'Blogroll','The ssh2 PHP extension is not available'=>'មិនមាន​កម្មវិធី​ជំនួយ​របស់ PHP ឈ្មោះ ssh2 ទេ','SSH2 hostname is required'=>'ត្រូវការ​ឈ្មោះ​ម៉ាស៊ីន SSH2','SSH2 user