vious version.'=>'WordPress បាន​ត្រឡប់​ទៅ​ជំនាន់​មុន​របស់​អ្នក ដោយសារ​មាន​បញ្ហា​ពេល​ធ្វើ​បច្ចុប្បន្នភាព។','Preparing to install the latest version&#8230;'=>'កំពុង​រៀបចំ​ដំឡើង​ជំនាន់​ចុង​ក្រោយ​បំផុត&#8230;','Copying the required files&#8230;'=>'ចម្លង​ឯកសារ​ដែល​ត្រូវ​ការ&#8230;','There is not enough free disk space to complete the update.'=>'មិនមាន​ចំណុះ​ផ្ទុក​គ្រប់គ្រាន់​ដើម្បី​បញ្ចប់​ការ​ធ្វើ​បច្ចុប្បន្នភាព។','The update cannot be installed because we will be unable to copy some files. This is usually due to inconsistent file permissions.'=>'មិន​អាច​ដំឡើង​បច្ចុប្បន្នភាព​បាន ពី​ព្រោះ​យើង​មិន​អាច​ចម្លង​ឯកសារ​មួយ​ចំនួន។ នេះ​មក​ពី​អ​ថេរភាព​នៃ​សិទ្ធិ​កំណត់​ឯកសារ។','Error: [%1$s] %2$s'=>'កំហុស: [%1$s] %2$s','<a href="https://wordpress.org/support/forum/multisite/">Support Forums</a>'=>'<a href="https://wordpress.org/support/forum/multisite/">វេទិកា​គាំទ្រ</a>','%s is already editing this post. Do you want to take over?'=>'%s កំពុងតែកែសម្រួលប្រកាសនេះ។ តើអ្នកចង់យកមកកែសម្រួលវិញ?','%s is already editing this post.'=>'%s កំពុងតែកែសម្រួលប្រកាសនេះ។','Edit status'=>'កែប្រែ​ស្ថានភាព','Edit visibility'=>'កែប្រែ​ភាព​ដែល​អាច​មើល​ឃើញ','Browse revisions'=>'រក​មើល​កំណែសម្រួល','Edit date and time'=>'កែប្រែ​កាល​បរិច្ឆេទ​និង​ម៉ោង','Delete all content.'=>'លុប​មាតិកា​ទាំង​អស់។','Attribute all content to:'=>'សន្មត​មាតិកា​ទាំងអស់​ទៅ​ឲ្យ៖','All comment types'=>'ប្រភេទ​មតិ​ទាំង​អស់','Displayed on attachment pages.'=>'បាន​បង្ហាញ​​នៅ​លើ​ទំព័រ​ឯកសារ​ភ្ជាប់។','https://codex.wordpress.org/Introduction_to_Blogging#Managing_Comments'=>'https://codex.wordpress.org/Introduction_to_Blogging#Managing_Comments','The <a href="https://codex.wordpress.org/Glossary#Character_set">character encoding</a> of your site (UTF-8 is recommended)'=>'<a href="https://codex.wordpress.org/Glossary#Character_set">ការ​អ៊ីនកូដ​តួអក្សរ</a> នៃ​វេបសាយ​របស់​អ្នក (UTF-8 ត្រូវ​បាន​ណែនាំ)','Number of items per page:'=>'ចំនួន​ធាតុ​ក្នុង​មួយ​ទំព័រ៖','Size in megabytes'=>'ទំហំ​ជា​មេកាបៃ','Site Upload Space Quota'=>'កូតាទំហំអាប់ឡូដរបស់វ