។ អ្នកប្រើប្រាស់ %s គឺជាអ្នកគ្រប់គ្រងបណ្តាញ។','What should be done with content owned by %s?'=>'តើគួរធ្វើអ្វីជាមួយនឹងមាតិកាដែលជាកម្មសិទ្ធិរបស់%s?','Select a user'=>'ជ្រើសរើសអ្នកប្រើម្នាក់','Site: %s'=>'វេបសាយ: %s','User has no sites or content and will be deleted.'=>'អ្នកប្រើប្រាស់ដែលមិនមានវេបសាយ ឬមាតិកា គឺនឹងត្រូវបានលុប។','Once you hit &#8220;Confirm Deletion&#8221;, the user will be permanently removed.'=>'នៅពេលដែលអ្នកចុចលើ &#8220; អះអាងការលុប&#8221; នោះអ្នកប្រើនេះនឹងត្រូវបានលុបចេញជាអចិន្ត្រៃយ៍។','Once you hit &#8220;Confirm Deletion&#8221;, these users will be permanently removed.'=>'នៅពេលដែលអ្នកចុចលើ &#8220; អះអាងការលុប&#8221; នោះអ្នកប្រើទាំងនេះនឹងត្រូវបានលុបចេញជាអចិន្ត្រៃយ៍។','Edit permalink'=>'កែសម្រួល permalink','Saving revision&hellip;'=>'កំពុងរក្សាទុកកំណែ&hellip;','You are about to delete %s.'=>'អ្នកប្រហែលជានឹងលុប %s។','Edit this comment'=>'កែប្រែមតិនេះ','Quick edit this comment inline'=>'កែរហ័សនូវមតិយោបល់នេះនៅក្នុងបន្ទាត់','The ssh2 PHP extension is available, however, we require the PHP5 function %s'=>'ផ្នែកបន្ថែមរបស់ ssh2 PHP មានអត្ថិភាពហើយ ទោះយ៉ាងណាយើងត្រូវការមុខងារ %s របស់ PHP5','attachment filterTrash'=>'ធុងសំរាម','&#8220;%s&#8221; (Edit)'=>'&#8220;%s&#8221; (កែសម្រួល)','Detach from &#8220;%s&#8221;'=>'ផ្ដាច់ពី &#8220;%s&#8221;','Attach &#8220;%s&#8221; to existing content'=>'ភ្ជាប់ &#8220;%s&#8221; ទៅមាតិកាដែលមានស្រាប់','Move &#8220;%s&#8221; to the Trash'=>'ផ្លាស់ &#8220;%s&#8221; ទៅធុងសម្រាម','Delete &#8220;%s&#8221; permanently'=>'លុប &#8220;%s&#8221; ជាអចិន្ត្រៃយ៍','Restore &#8220;%s&#8221; from the Trash'=>'ស្ដារឡើងវិញនូវ &#8220;%s&#8221; ពីធុងសំរាម','Quick edit &#8220;%s&#8221; inline'=>'កែរហ័ស &#8220;%s&#8221; នៅក្នុងបន្ទាត់','Delete &#8220;%s&#8221;'=>'លុប &#8220;%s&#8221;','View &#8220;%s&#8221; archive'=>'ពិនិត្យ &#8220;%s&#8221; កាលប្បវត្ត','Another update is currently in progress.'=>'ការអាប់ដេតមួយផ្សេងទៀតកំពុងដំណើរការ។','Click the image to edit or update'=>'ចុច​រូបភាព​ដើម្បី​កែសម្រួល​ឬ​អាប់ដេត','Excerpts are optional hand-crafted summaries of your content that can be used in your theme. <a href="%s">Learn more about manual excerpts</a>.'=>'សេចក្ដីដកស្រង់ គឺជាការសង្ខបនូវអត្ថបទរបស់អ្នកនៃការសរសេរដោយដៃរបស់អ្នកស្រេចនឹងចិត្ត ដែលអាចត្រូវប្រើនៅក្នុងរូបរាងរបស់អ្នក។  <a href="%s">ស្វែងយល់បន្ថែមអំពីសម្រង់ដោយដៃ</a>។','Custom fields can be used to add extra metadata to a post that you can <a href="%s">use in your theme</a>.'=>'ប្រអប់កែច្នៃអាចត្រូវបានប្រើដើម្បីបន្ថែមទិន្នន័យមេតាទៅកាន់ប្រកាសមួយដែលអ្នកអាច <a href="%s">ប្រើក្នុងរូបរាងរបស់អ្នក</a>។','https://codex.wordpress.org/Using_Custom_Fields'=>'https://codex.wordpress.org/Using_Custom_Fields','Allow <a href="%s">trackbacks and pingbacks</a> on this page'=>'អនុញ្ញាត <a href="%s">trackbacksនិង pingbacks</a> លើទំព័រនេះ។','Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. If you link other WordPress sites, they&#8217;ll be notified automatically using <a href="%s">pingbacks</a>, no other action necessary.'=>'Trackbacks គឺជាវិធីមួយដើម្បីផ្ដល់ដំណឺងពីប្រព័ន្ធប្លុកស្របច្បាប់នានាដែលអ្នកបានភ្ផាប់ទៅកាន់ពួកគេ។ ប្រសិនបើអ្នកភ្ផាប់ទៅកាន់វេបសាយ WordPress ដទៃទៀត, ពួកគេនឹងត្រូវជូនដំណឹងដោយស្វ័យប្រវត្តិដោយការប្រើ <a href="%s">pingbacks</a> ដោយមិនចាំបាច់មានសកម្មភាពអ្វីផ្សេងទៀតនោះទេ។','(Private post)'=>'(ប្រកាសឯកជន)','Need help? Use the Help tab above the screen title.'=>'ត្រូវការ​ជំនួយ? ប្រើផ្ទាំងជំនួយខាងលើចំណងជើង។','Info'=>'លំអិត','A WordPress Commenter'=>'សេចក្តីអធិប្បាយនៃWordPress ','Hi, this is a comment.
