&mdash; The site URL is rarely edited as this can cause the site to not work properly. The Registered date and Last Updated date are displayed. Network admins can mark a site as archived, spam, deleted and mature, to remove from public listings or disable.'=>'<strong>ព័ត៌មាន</strong> &mdash; អាសយដ្ឋាន URL នៃវេបសាយកំរត្រូវបានកែណាស់ ព្រោះថាវាអាចនឹងធ្វើឲ្យវេបសាយដំណើការមិនត្រឹមត្រូវ។ កាលបរិច្ឆេទចុះបញ្ជី និងកាលបរិច្ឆេទអាប់ដេតសុទ្ធតែបានបង្ហាញ។ អ្នកគ្រប់គ្រងបណ្ដាញអាចកំណត់វេបសាយមួយថាជាបណ្ណសារ, ស្ប៉ាម, លុបចេញ ដោយទុកសំណៅ, ដកចេញពីបញ្ជីសាធារណៈ ឬក៏បិទចោលតែម្ដង។','<strong>Users</strong> &mdash; This displays the users associated with this site. You can also change their role, reset their password, or remove them from the site. Removing the user from the site does not remove the user from the network.'=>'<strong>អ្នកប្រើ</strong> &mdash; ផ្នែកនេះបង្ហាញពីអ្នកប្រើទាំងអស់ដែលមាននៅលើវេបសាយនេះ។ អ្នកអាចប្ដូរមុខងាររបស់ពួកគេបាន កំណត់ឡើងវិញនូវពាក្យសម្ងាត់របស់ពួកគេ ឬមួយក៏ដកពួកគេចេញពីវេបសាយបានផងដែរ។ ការដាកអ្នកប្រើណាម្នាក់ចេញពីវេបសាយ ពុំបានដកគេចេញពីបណ្ដាញទាំងមូលនោះទេ។','<strong>Themes</strong> &mdash; This area shows themes that are not already enabled across the network. Enabling a theme in this menu makes it accessible to this site. It does not activate the theme, but allows it to show in the site&#8217;s Appearance menu. To enable a theme for the entire network, see the <a href="%s">Network Themes</a> screen.'=>'<strong>រូបរាងនៃវេបសាយ</strong> &mdash; តំបន់នេះបង្ហាញនូវរូបរាងផ្សេងៗនៃវេបសាយដែលពុំទាន់បានដាក់ឲ្យដំណើការនៅទូទាំងបណ្ដាញ។ ការដាក់ឲ្យដំណើការនៅក្នុងម៉ឺនុយនេះ ធ្វើឲ្យរូបរាងអាចចូលទៅដំណើការនៅលើវេបសាយនេះ។ វាមិនដាក់ឲ្យរូបរាងវេបសាយដំណើរការនោះទេ  ប៉ុន្តែវាអនុញ្ញាតឲ្យរូបរាងនោះបង្ហាញឡើងនៅក្នុងម៉ឺនុយ «ទិដ្ឋភាព» នៃវេបសាយ។ ដើម្បីដាក់ឲ្យដំណើការរូបរាងវេបសាយមួយសម្រាប់បណ្ដាញទាំងមូល សូមមើលផ្ទាំង <a href="%s">រូបរាងវេបសាយលើបណ្ដាញ</a>។','<strong>Settings</strong> &mdash; This page shows a list of all settings associated with this site. Some are created by WordPress and others are created by plugins you activate. Note that some fields are grayed out and say Serialized Data. You cannot modify these values due to the way the setting is stored in the database.'=>'<strong>ការកំណត់នានា</strong> &mdash; ទំព័រនេះបង្ហាញនូវបញ្ជីនៃគ្រប់ការកំណត់នានាមួយដែលទាក់ទងទៅនឹងវេបសាយរបស់អ្នក។ ការកំណត់ខ្លះបង្កើតឡើងដោយ WordPress និងខ្លះទៀតបង្កើតឡើងដោយកម្មវិធីបន្ថែមនានាដែលអ្នកបានដាក់ឲ្យដំណើការ។ សូមចំណាំថាប្រអប់មួយចំនួនត្រូវដាក់ឲ្យមានពណ៌ប្រផេះ និងសម្គាល់ជាទិន្នន័យដែលបានបម្លែង។ អ្នកពុំអាចកែប្រែតម្លៃទាំងនោះបានទេ ដោយសារតែរបៀបដែលការកំណត់របស់វាផ្ទុកនៅក្នុងដេតាបេស។
','folder'=>'ហ្វូលដឺ','This draft comes from your <a href="%s">unpublished customization changes</a>. You can edit, but there&#8217;s no need to publish now. It will be published automatically with those changes.'=>'ប្រកាសព្រាងនេះបានមកពី <a href="%s">ការកែប្រែដែលពុំទាន់បានចុះផ្សាយ</a> របស់អ្នក។ អ្នកអាចកែបាន ប៉ុន្តែពុំចាំបាច់ចុះផ្សាយភ្លាមៗក៏បានដែរ។ វានឹងចុះផ្សាយដោយស្វ័យប្រវត្តិជាមួយនឹងកំណែទាំងនោះ។','Uploaded on: %s'=>'អាប់ឡូដនៅ: %s','Unable to initiate confirmation request.'=>'ពុំអាចបង្កើតសំណើសម្រាប់ការបញ្ជាក់បានទេ។','Confirmation request sent again successfully.'=>'សំណើដើម្បីបញ្ជាក់ត្រូវបានផ្ញើម្ដងទៀតដោយជោគជ័យ។','Unable to add this request. A valid email address or username must be supplied.'=>'ពុំអាចបញ្ចូលសំណើនេះបានទេ។ អាសយដ្ឋានអ៊ីមែលដែលត្រឹមត្រូវ ឬឈ្មោះអ្នកប្រើប្រាស់ត្រូវតែផ្ដល់ឲ្យ។','Confirmation request initiated successfully.'=>'សំណើដើម្បីបញ្ជាក់ត្រូវបានបង្កើតដោយជោគជ័យ។','Add Data Export Request'=>'បន្ថែមសំណើនាំចេញទិន្នន័យ','An email will be sent to the user at this email address asking them to verify the request.'=>'អ៊ីមែលមួយនឹងត្រូវផ្ញើទៅកាន់អ្នកប្រើតាមយៈអាសយដ្ឋានអ៊ីមែលនេះ ដើម្បីសូមឲ្យគាត់បញ្ជាក់នូវសំណើនោះ។','Username or email address'=>'ឈ្មោះអ្នកប្រើ ឬអាសយដ្ឋានអ៊ីមែល','Send Request'=>'ផ្ញើសំណើ','Requester'=>'អ្នកស្នើ','Requested'=>'ដែលបានស្នើ','Resend email'=>'ផ្ញើអ៊ីមែលម្ដងទៀត','Deleted %d request'=>'លុបសំណើ %d','Re-sent %d request'=>'ផ្ញើសំណើ %d ម្ដងទៀត','Download Personal Data'=>'ដោនឡូដទិន្នន័យផ្ទាល់ខ្លួន','Downloading Data...'=>'កំពុងដោនឡូដទិន្នន័យ...','Retry'=>'ព្យាយាមម្ដងទៀត','Waiting for confirmation'=>'រង់ចាំការបញ្ជាក់','Remove request'=>'លុបសំណើ','Force Erase Personal Data'=>'បង្ខំឲ្យលុបទិន្នន័យផ្ទាល់ខ្លួន','Download Personal Data Again'=>'ដោនឡូដទិន្នន័យផ្ទាល់ខ្លួនម្ដងទៀត','Sending Email...'=>'កំពុងផ្ញើអ៊ីមែល...','Email sent.'=>'អ៊ីមែលបានផ្ញើចេញ។','Copy suggested policy text from %s.'=>'ចម្លងគោលការណ៍ដែលបានណែនាំពី %s។','privacy-policy'=>'privacy-policy','Sorry, you are not allowed to export personal data on this site.'=>'សូមទោស អ្នកពុំមានសិទ្ធិក្នុងការនាំចេញនូវព័ត៌មានផ្ទាល់ខ្លួនបានទេនៅលើវេបសាយនេះ។','Sorry, you are not allowed to erase data on this site.'=>'សូមទោស អ្នកពុំមានសិទ្ធិក្នុងការលុបទិន្នន័យនៅលើវេបសាយនេះទេ។','Email could not be sent.'=>'អ៊ីមែលពុំអាចផ្ញើចេញបានទេ។','Force Erase has failed.'=>'ការបង្ខំអោយលុបបានទទួលបរាជ័យ។','Erasing Data has failed.'=>'ការលុបទិន្នន័យបានទទួលបរាជ័យ។','Hello,'=>'សួស្ដី,','This text template will help you to create your web site&#8217;s privacy policy.'=>'គម្រូអត្ថបទនេះនឹងជួយអ្នកក្នុងការបង្កើតគោលការណ៍ឯកជនភាពនៅលើវេបសាយរបស់អ្នក។','Please edit your privacy policy content, making sure to delete the summaries, and adding any information from your theme and plugins. Once you publish your policy page, remember to add it to your navigation menu.'=>'សូមធ្វើការកែសម្រួលខ្លឹមសារនៃគោលការណ៍ឯកជនភាពរបស់អ្នក។ សូមប្រាកដថាអ្នកបានលុបនូវសេចក្ដីសង្ខេបនានា និងបញ្ចូលនូវព័ត៌មានផ្សេងៗពីរូបរាងវេបសាយ និងកម្មវិធីបន្ថែមរបស់អ្នក។ នៅពេលដែលអ្នកសម្រេចចេញផ្សាយនូវទំព័រគោលការណ៍ឯកជនភាពនេះ សូមកុំភ្លេចដាក់វាចូលទៅក្នុងម៉ឺនុយរបស់អ្នកផង។','It is your responsibility to write a comprehensive privacy policy, to make sure it reflects all national and international legal requirements on privacy, and to keep your policy current and accurate.'=>'វាជាការទទួលខុសត្រូវរបស់អ្នកក្នុងការសរសេរគោលការណ៍ឯកជនភាពដ៏ទូលំទូលាយមួយ ដើម្បីឲ្យប្រាកដថា វាឆ្លើយតបទៅនឹងរាល់តម្រូវការផ្នែកច្បាប់ទាំងជាតិ និងអន្តរជាតិលើឯកជនភាពនេះ ហើយក៏ដើម្បីរក្សានូវគោលការណ៍របស់អ្នកឲ្យទាន់សម័យ និងត្រឹមត្រូវផងដែរ។','Who we are'=>'តើយើងជានរណា','In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.'=>'នៅក្នុងផ្នែកនេះ អ្នកគួរតែបង្ហាញនូវអាសយដ្ឋានវេបសាយរបស់អ្នក ជាមួយនឹងឈ្មោះរបស់ក្រុមហ៊ុន អង្គការ ឬក៏រូបវ័ន្តបុគ្គលណាម្នាក់ដែលស្ថិតនៅពីក្រោយ រួមទាំងព័ត៌មានជាក់លាក់អំពីការទំនាក់ទំនងទៅកាន់អ្នកផងដែរ។','The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.'=>'ទំហំនៃព័ត៌មានដែលទាមទារឲ្យអ្នកត្រូវបង្ហាញអាចនឹងខុសៗគ្នា ដោយផ្អែកទៅលើបទបញ្ញត្តិនៃអាជីវកម្មក្នុងមូលដ្ឋាន ឬថ្នាក់ជាតិរបស់អ្នក។ ឧទាហរណ៍, អ្នកនឹងត្រូវបានទាមទារឲ្យបង្ហាញនូវអាសយដ្ឋានពិតប្រាកដ អាសយដ្ឋានអាជីវកម្មដែលបានចុះបញ្ជី ឬក៏លេខសម្គាល់ការចុះបញ្ជីក្រុមហ៊ុនរបស់អ្នក។','Our website address is: %s.'=>'អាសយដ្ឋាននៃវេបសាយរបស់យើងគឺ៖ %s។','What personal data we collect and why we collect it'=>'តើព័ត៌មានផ្ទាល់ខ្លួនអ្វីខ្លះដែលយើងប្រមូល និងហេតុអ្វីយើងប្រមូលវា','You should also note any collection and retention of sensitive personal data, such as data concerning health.'=>'អ្នកគួរតែកត់សម្គាល់ពីការប្រមូល និងរក្សាទុកនូវព័ត៌មានផ្ទាល់ខ្លួនដែលសំខាន់ៗ ដូចជាទិន្នន័យដែលពាក់ព័ន្ធនឹងសុខភាពជាដើម។','Contact forms'=>'ទម្រង់ទំនាក់ទំនង','Cookies'=>'ឃុកឃីស','Embedded content from other websites'=>'មាតិកាដែលបានភ្ជាប់មកពីវេបសាយដទៃ','Analytics'=>'ការវិភាគ','Who we share your data with'=>'អ្នកដែលយើងចែករំលែកព័ត៌មានរបស់អ្នកជាមួយ','In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.'=>'បន្ថែមពីលើការចុះបញ្ជីនូវទិន្នន័យផ្ទាល់ខ្លួនណាដែលអ្នកប្រមូល អ្នកត្រូវតែកត់សម្គាល់ថាហេតុអ្វីបានជាអ្នកប្រមូលវា។ ការពន្យល់ទាំងនេះ ត្រូវតែកត់សម្គាល់ ទាំងមូលដ្ឋានផ្លូវច្បាប់សម្រាប់ទិន្នន័យដែលអ្នកប្រមូល និងរក្សាទុក ឬក៏ការយល់ព្រមដែលអ្នកប្រើប្រាស់បានផ្ដល់ឲ្យហើយកំពុងដំណើរការ។','Personal data is not just created by a user&#8217;s interactions with your site. Personal data is also generated from technical processes such as contact forms, comments, cookies, analytics, and third party embeds.'=>'ទិន្នន័យផ្ទាល់ខ្លួនមិនត្រឹមតែបានបង្កើតដោយអន្តរកម្មរបស់អ្នកប្រើជាមួយនឹងវេបសាយរបស់អ្នកនោះទេ។ ទិន្នន័យផ្ទាល់ខ្លួនក៏ជាលទ្ធផលនៃការបង្កើតដោយស្វ័យប្រវត្តិពីដំណើរបេច្ចេកទេសនានាដូចជា ទម្រង់ទំនាក់ទំនង, ការបញ្ចេញមតិ, ឃុកឃីស, ការវិភាគ, និងរួមទាំងការភ្ជាប់នានាពីភាគីទី៣ថែមទៀតផង។','By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.'=>'តាមលំនាំដើម WordPress ពុំប្រមូលនូវទិន្នន័យផ្ទាល់ខ្លួនអំពីអ្នកទស្សនាឡើយ គឺគ្រាន់តែប្រមូលនូវទិន្នន័យដែលបានបង្ហាញនៅលើអេក្រង់ព័ត៌មានអ្នកប្រើប្រាស់នៃអ្នកប្រើដែលបានចុះបញ្ជីប៉ុណ្ណោះ។ ទោះជាយ៉ាងនេះក្ដី កម្មវិធីបន្ថែមខ្លះរបស់អ្នកអាចនឹងប្រមូលទិន្នន័យផ្ទាល់ខ្លួនបានផងដែរ។ អ្នកគួរបន្ថែមនូវព័ត៌មានដែលជាប់ទាក់ទងនៅខាងក្រោមនេះ។','If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.'=>'ប្រសិនបើអ្នកអាប់ឡូដរូបភាពណាមួយទៅកាន់វេបសាយនេះ អ្នកគួរចៀសវាងអាប់ឡូដនូវរូបណាដែលមានបង្កប់នូវទិន្នន័យនៃទីតាំង (EXIF GPS)។ អ្នកប្រើប្រាស់នៅលើវេបសាយនេះអាចដោនឡូដ និងទាញយកទិន្នន័យពីទីតាំងនៃរូបភាពនេះពីលើវេបសាយនេះបានគ្រប់ពេល។','By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.'=>'តាមលំនាំដើម WordPress ពុំបានបញ្ចូលទម្រង់ទាក់ទងទេ។ ប្រសិនបើអ្នកប្រើនូវកម្មវិធីបន្ថែមសម្រាប់ទម្រង់ទាក់ទងណាមួយ នោះសូមប្រើផ្នែករងនេះដើម្បីបញ្ជាក់ពីទិន្នន័យផ្ទាល់ខ្លួនដែលបានប្រមូលនៅពេលដែលមាននរណាម្នាក់បញ្ជូនទម្រង់ទាក់ទងនោះមក និងពីរបៀបដែលអ្នករក្សាទុកទិន្នន័យទាំងនោះ។ ឧទាហរណ៍ថា អ្នកអាចនឹងសរសេរថា អ្នករក្សាទុកព័ត៌មានដែលគេបានផ្ញើមកក្នុងរយៈពេលណាមួយច្បាស់លាស់សម្រាប់គោលបំណងសេវាកម្មអតិថិជន ប៉ុន្តែអ្នកមិនប្រើព័ត៌មានទាំងនោះសម្រាប់គោលបំណងទីផ្សារណាមួយឡើយ។','By default WordPress does not share any personal data with anyone.'=>'តាមលំនាំដើម WordPress ពុំមានចែកចាយព័ត៌មានផ្ទាល់ខ្លួនណាមួយរបស់អ្នកជាមួយអ្នកណាទេ។','How long we retain your data'=>'រយៈពេលដែលយើងរក្សាទុកទិន្នន័យរបស់អ្នក','When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.'=>'នៅពេលដែលអ្នកទស្សនាបញ្ចេញមតិនៅលើវេបសាយ យើងប្រមូលនូវទិន្នន័យដែលបង្ហាញនៅក្នុងបែបបទបញ្ចេញមតិ រួមជាមួយទាំងអាសយដ្ឋាន IP និងឈ្មោះនៃកម្មវិធីបើកអ៊ិនធឺណិតដើម្បីជាជំនួយដល់ការរុករកស្ប៉ាម។','An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.'=>'អក្សរអនាមិកមួយត្រូវបានបង្កើតពីអាសយដ្ឋានអ៊ីមែលរបស់អ្នក (ឬហៅម្យ៉ាងទៀតបានថា hash) អាចនឹងត្រូវផ្ដល់ឲ្យទៅសេវាកម្ម Gravatar ដើម្បីរកមើលថាតើអ្នកកំពុងប្រើប្រាស់វាឬទេ។ គោលការណ៍ឯកជនភាពនៃសេវាកម្ម Gravatar អាចរកបាននៅទីនេះ៖ https://automattic.com/privacy/។ បន្ទាប់ពីមតិរបស់អ្នកត្រូវបានអនុម័ត រូបភាពប្រូហ្វាល់របស់អ្នកនឹងត្រូវបង្ហាញជាសាធារណៈនៅក្នុងបរិបទនៃការបញ្ចេញមតិរបស់អ្នក។','In this subsection you should list the cookies your web site uses, including those set by your plugins, social media, and analytics. We have provided the cookies which WordPress installs by default.'=>'នៅក្នុងផ្នែករងនេះ អ្នកគួរបញ្ជាក់ពីបញ្ជីនៃឃុកឃីសដែលវេបសាយរបស់អ្នកប្រើ ដែលរួមមានដូចជាឃុកឃីសដែលបានកំណត់ដោយកម្មវិធីបន្ថែមនានា បណ្ដាញសង្គម និងការវិភាគនានា។ យើងបានផ្ដល់នូវឃុកឃីសដែល WordPress បង្កើតជាទូទៅរួចហើយ។','If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.'=>'ប្រសិនបើអ្នកបានបញ្ចេញមតិនៅលើវេបសាយរបស់យើង អ្នកនឹងជ្រើសយកការរក្សាទុកនូវឈ្មោះរបស់អ្នក អាសយដ្ឋានអ៊ីមែល និងអាសយដ្ឋានវេបសាយនៅក្នុងឃុកឃីស។ ការនេះគឺដើម្បីសម្រួលដល់អ្នក ដោយអ្នកពុំចាំបាច់បំពេញនូវព៌ត័មានផ្ទាល់ខ្លួនរបស់អ្នកម្ដងទៀតនៅពេលដែលអ្នកបញ្ចេញមតិបន្តបន្ទាប់ទៀត។ ឃុកឃីសនេះនឹងមានអាយុដល់ ១ឆ្នាំ។','When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.'=>'នៅពេលដែលអ្នកចូលប្រើ យើងនឹងបង្កើតនូវឃុកឃីសមួយចំនួនដើម្បីរក្សានូវព័ត៌មាននៃការចូលប្រើរបស់អ្នកនេះ រួមទាំងជម្រើសនៃការបង្ហាញនៅលើអេក្រង់ផងដែរ។ ឃុកឃីសនៃការចូលប្រើនេះមានអាយុកាល ២ថ្ងៃ និងជម្រើសនៃការបង្ហាញនៅលើអេក្រង់មានអាយុកាល ១ឆ្នាំ។ ប្រសិនបើអ្នកជ្រើសយក &quot;ចងចាំខ្ញុំ&quot; នោះឃុកឃីសនៃការចូលប្រើរបស់អ្នកនឹងមានអាយុ ២សប្ដាហ៍។ ប្រសិនបើអ្នកចាកចេញពីគណនី នោះឃុកឃីសនៃការចូលប្រើនឹងត្រូវលុបចេញ។','What rights you have over your data'=>'សិទ្ធិអ្វីខ្លះដែលអ្នកមានលើទិន្នន័យរបស់អ្នក','In this section you should explain what rights your users have over their data and how they can invoke those rights.'=>'នៅក្នុងផ្នែកនេះអ្នកគួរតែពន្យល់ពីសិទ្ធិអ្វីខ្លះដែលអ្នកចូលទស្សនាវេបសាយរបស់អ្នកមាននៅលើទិន្នន័យរបស់ពួកគេ និងថាតើពួកគេអាចប្រើសិទ្ធិទាំងនោះបានយ៉ាងដូចម្ដេចខ្លះ។','If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.'=>'ប្រសិនបើងអ្នកធ្វើការកែ ឬចុះផ្សាយអត្ថបទណាមួយ ឃុកឃីសមួយទៀតនឹងត្រូវបានរក្សាទុកនៅក្នុងកម្មវិធីបើកអ៊ិនធឺណិតរបស់អ្នក។ ឃុកឃីសនេះ ពុំមានបញ្ចូលនូវទិន្នន័យផ្ទាល់ខ្លួនរបស់អ្នកទេ និងគ្រាន់តែបញ្ជាក់ពី ID នៃប្រកាសរបស់អត្ថបទដែលអ្នកបានកែតែប៉ុណ្ណោះ។ វានឹងត្រូវលុបវិញពេលហួសពី ១ថ្ងៃ។','Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.'=>'អត្ថបទនានានៅក្នុងវេបសាយនេះអាចនឹងមាននូវមាតិកាបង្កប់ (ឧទាហរណ៍ដូចជា វីដេអូ រូបភាព កម្រងអត្ថបទ ។ល។)។ មាតិកាបង្កប់ពីវេបសាយផ្សេងទៀតមានភាពដូចគ្នានឹងរបៀបដែលអ្នកទស្សនា ចូលមើលវេបសាយផ្សេងទៀតដែរ។','These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.'=>'វេបសាយទាំងនេះអាចនឹងប្រមូលទិន្នន័យអំពីអ្នក ដោយប្រើឃុកឃីស ដោយភ្ជាប់នូវកូដសម្រាប់តាមដានបន្ថែមពីភាគីទី៣ និងកត់ត្រានូវរាល់សកម្មភាពរបស់អ្នកដោយប្រើមាតិកាដែលបានភ្ជាប់នោះ ដោយមានបញ្ចូលទាំងការកត់ត្រាសកម្មភាពរបស់អ្នកជាមួយនឹងមាតិកានោះ ប្រសិនបើអ្នកមានគណនី និងបានចូលប្រើក្នុងវេបសាយនោះ។','By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.'=>'តាមលំនាំដើម WordPress ពុំប្រមូលទិន្នន័យវិភាគនោះទេ។ ទោះជាយ៉ាងណាក៏ដោយ គណនីបង្ហោះវេបសាយខ្លះ បានប្រមូលនូវទិន្នន័យវិភាគអនាមិកមួយចំនួនផងដែរ។ អ្នកប្រហែលជាបានដំឡើងកម្មវិធីបន្ថែមរបស់ WordPress មួយដែលផ្ដល់នូវសេវាកម្មវិភាគទិន្នន័យ។ នៅក្នុងករណីនេះ សូមបញ្ចូលព័ត៌មានពីកម្មវិធីបន្ថែមនោះនៅទីនេះ។','In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.'=>'នៅក្នុងផ្នែកនេះ ង្នកគួរដាក់ឈ្មោះជាបញ្ជីនូវអ្នកផ្ដល់សេវាដែលជាភាគីទី៣ដែលជាអ្នកទទួលបានទិន្នន័យបន្ត ដែលមានរួមបញ្ចូលទាំងដៃគូនានា សេវាកម្មផ្អែកលើខ្លោដ សេវាកម្មទិញលក់ និងអ្នកផ្ដល់សេវាដែលជាភាគីទី៣ផ្សេងៗទៀត ហើយសូមបញ្ជាក់នូវប្រភេទទិន្នន័យណាដែលអ្នកបានចែករំលែកជាមួយពួកគេជាមួយនឹងមូលហេតុ។ សូមដាក់តំណទៅកាន់គោលការណ៍ឯកជនភាពនៃភាគីទី៣ទាំងនោះផង ប្រសិនបើអាច។ ','Where we send your data'=>'ទីដែលយើងបញ្ជូនទិន្នន័យរបស់អ្នកទៅ','Your contact information'=>'ព័ត៌មានទំនាក់ទំនងរបស់អ្នក','Additional information'=>'ព័ត៌មានបន្ថែម','How we protect your data'=>'របៀបដែលយើងការពារទិន្នន័យរបស់អ្នក','In this section you should explain how long you retain personal data collected or processed by the web site. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.'=>'នៅក្នុងផ្នែកនេះ អ្នកគួរពន្យល់ពីរយៈពេលដែលអ្នករក្សាទុកនូវទិន្នន័យផ្ទាល់ខ្លួនដែលអ្នកបានប្រមូល ឬក៏ដំណើរការដោយវេបសាយ។ ខណៈពេលដែលវាជាការទទួលខុសត្រូវរបស់អ្នកក្នុងការរកមើលកាលវិភាគនៃរយៈពេលដែលអ្នករក្សាទុកសំណុំទិន្នន័យនីមួយៗ និងមូលហេតុដែលអ្នករក្សាទុកវា។ ព័ត៌មានទាំងនោះចាំបាច់ត្រូវតែមាននៅទីនេះ។ ឧទាហរណ៍ថា អ្នកចង់និយាយថា អ្នករក្សាទុកបែបបទទំនាក់ទំនងសម្រាប់រយៈពេលប្រាំមួយខែ, កំណត់ត្រាវិភាគសម្រាប់មួយឆ្នាំ, និងកំណត់ត្រាទិញដូររបស់អតិថិជនសម្រាប់រយៈពេលដប់ឆ្នាំ។','If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.'=>'ប្រសិនបើអ្នកបញ្ចេញមតិ មតិទាំងនោះ និងទិន្នន័យមេតារបស់វានឹងត្រូវរក្សាទុកជារៀងរហូត។ ធ្វើដូចនេះដើម្បីឲ្យយើងអាចស្គាល់ និងអនុម័តបាននូវរាល់ការបញ្ចេញមតិតប ក្រោយៗមកទៀតដោយស្វ័យប្រវត្តិ ជំនួសឲ្យការបង្កកពួកវាទៅក្នុងបញ្ជីរង់ចាំសម្រាប់ការពិនិត្យ។','For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.'=>'សម្រាប់អ្នកប្រើដែលបានចុះបញ្ជីនៅលើវេបសាយរបស់យើង (ប្រសិនបើមាន) យើងក៏រក្សាទុកផងដែរនូវព័ត៌មានផ្ទាល់ខ្លួនដែលពួកគេបានផ្ដល់ឲ្យនៅលើទំព័រព័ត៌មានផ្ទាល់ខ្លួនរបស់ពួកគេ។ អ្នកប្រើទាំងអស់អាចមើល កែប្រែ ឬក៏លុបនូវព័ត៌មានផ្ទាល់ខ្លួនរបស់ពួកគេបានគ្រប់ពេលវេលា (លើកលែងតែចំណុចមួយដែលថាគេពុំអាចប្ដូរឈ្មោះសម្រាប់ចូលប្រើបានទេ)។ អ្នកអភិបាលគេហទំព័រអាចមើល ឬក៏កែប្រែនូវព័ត៌មានទាំងនោះផងដែរ។','If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.'=>'ប្រសិនបើអ្នកមានគណនីមួយនៅលើវេបសាយនេះ ឬមួយអ្នកធ្លាប់បានបញ្ចេញមតិពីមុន អ្នកអាចស្នើសុំឲ្យមានការនាំចេញនូវទិន្នន័យផ្ទាល់ខ្លួនរបស់អ្នកដែលយើងបានរក្សាទុក ដោយរួមបញ្ចូលទាំងទិន្នន័យនានាដែលអ្នកបានផ្ដល់ឲ្យយើង។ អ្នកក៏អាចស្នើសុំឲ្យយើងធ្វើការលុបនូវទិន្នន័យផ្ទាល់ខ្លួនរបស់អ្នកដែលមាននៅយើងផងដែរ។ នេះមិនរាប់បញ្ចូលទិន្នន័យណាមួយដែលយើងមានកាតព្វកិច្ចរក្សាទុកសម្រាប់គោលបំណងរដ្ឋបាល ច្បាប់ ឬសន្តិសុខឡើយ។','What data breach procedures we have in place'=>'តើនីតិវិធីនៃការរំលោភទិន្នន័យអ្វីខ្លះដែលយើងមាន','What third parties we receive data from'=>'តើទិន្នន័យណាខ្លះដែលយើងទទួលបានពីភាគីទីបី','What automated decision making and/or profiling we do with user data'=>'តើការធ្វើសេចក្ដីសម្រេចចិត្ត ឬការធ្វើប្រវត្តិរូបអ្វីខ្លះ ដែលយើងធ្វើលើទិន្នន័យរបស់អ្នក','In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.'=>'នៅក្នុងចំណុចនេះ អ្នកគួរតែរៀបរាប់ពីគ្រប់ការផ្ទេរទិន្នន័យពីវេបសាយរបស់អ្នកចេញក្រៅសហភាពអឺរ៉ុប និងពិពណ៌នាអំពីមធ្យោបាយដែលទិន្នន័យត្រូវបានការពារតាមស្តង់ដារនៃការការពារទិន្នន័យរបស់សហភាពអឺរ៉ុប។ ការនេះអាចរាប់បញ្ចូលទាំងម៉ាស៊ីនបង្ហោះវេបសាយរបស់អ្នក កន្លែងផ្ទុកទិន្នន័យនៅក្នុងខ្លោដ ឬក៏សេវាកម្មនានាដែលជាភាគីទី៣។','European data protection law requires data about European residents which is transferred outside the European Union to be safeguarded to the same standards as if the data was in Europe. So in addition to listing where data goes, you should describe how you ensure that these standards are met either by yourself or by your third party providers, whether that is through an agreement such as Privacy Shield, model clauses in your contracts, or binding corporate rules.'=>'ច្បាប់សហគមន៍អឺរ៉ុបស្ដីពីការការពារទិន្នន័យអ្នកប្រើប្រាស់ ទាមទារឲ្យការពារទិន្នន័យណាដែលមកពីតំបន់អឺរ៉ុបដែលត្រូវបានបញ្ជូនចេញក្រៅសហភាពអឺរ៉ុប ឲ្យមានសុវត្ថិភាពត្រឹមត្រូវទៅតាមស្តង់ដារដូចដែលទិន្នន័យទាំងនោះស្ថិតនៅអឺរ៉ុបដូច្នោះដែរ។ ដូច្នេះ បន្ថែមពីលើបញ្ជីនានាដែលទិន្នន័យត្រូវបានបញ្ជូន អ្នកគួរតែបរិយាយពីរបៀបដែលស្តង់ដារទាំងនេះត្រូវបានធានា ទោះជាដោយរូបអ្នកផ្ទាល់ ឬដោយអ្នកផ្គតផ្គង់ដែលជាភាគីទី៣ មិនថាតែតាមរយៈកិច្ចព្រមព្រៀងណាមួយដូចជា «ខែលនៃឯកជនភាព», ម៉ូដែលក្នុងឃ្លានៃកិច្ចសន្យារបស់អ្នក ឬក៏កម្រងនៃក្បួនសាជីវកម្ម។','In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.'=>'នៅត្រង់ចំណុចនេះ អ្នកគួរតែផ្ដល់នូវមធ្យោបាយទំនាក់ទំនងសម្រាប់ករណីព្រួយបារម្ភពីបញ្ហាឯកជនភាពជាក់លាក់ណាមួយ។ ប្រសិនបើអ្នកត្រូវទាមទារឲ្យមានមន្ត្រីការពារទិន្នន័យ សូមបញ្ជាក់ពីឈ្មោះរបស់គេ ព្រមទាំងព័ត៌មានលម្អិតស្ដីពីរបៀបដែលអាចទាក់ទងគេបាននៅនេះផងដែរ។','If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.'=>'ប្រសិនបើអ្នកប្រើវេបសាយរបស់អ្នកក្នុងគោលបំណងពាណិជ្ជកម្មណាមួយ ហើយអ្នកជាប់ពាក់ព័ន្ធនឹងការប្រមូល និងបម្លែងទិន្នន័យរបស់អ្នកតាមបែបស្មុគស្មាញ អ្នកគួរតែកត់សម្គាល់នូវព័ត៌មានខាងក្រោមនៅក្នុងគោលការណ៍ឯកជនភាពរបស់អ្នកបន្ថែមទៅលើព័ត៌មានដែលយើងបានពិភាក្សារួចមកហើយ។','Industry regulatory disclosure requirements'=>'តម្រូវការនៃការបង្ហាញនិយតករឧស្សាហកម្ម','If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.'=>'ប្រសិនបើអ្នកជាសមាជិកនៃនិយតករឧស្សាហកម្ម ឬប្រសិនបើអ្នកត្រូវគោរពច្បាប់ឯកជនភាពបន្ថែមទៀត អ្នកត្រូវតែបង្ហាញនូវព័ត៌មានទាំងនោះនៅទីនេះ។','Add Data Erasure Request'=>'បន្ថែមសំណើលុបទិន្នន័យ','Erasing Data...'=>'កំពុងលុបទិន្នន័យ...','Invalid request ID when processing eraser data.'=>'ID នៃសំណើពុំត្រឹមត្រូវនៅពេលដែលដំណើរការលុបទិន្នន័យ។','In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.'=>'នៅក្នុងចំណុចនេះ អ្នកគួរតែពន្យល់ពីវិធានការដែលអ្នកបានអនុវត្តដើម្បីការពារទិន្នន័យអ្នកប្រើរបស់អ្នក។ នេះអាចរួមបញ្ចូលវិធានការបច្ចេកទេសដូចជាការអ៊ិនគ្រីប។ វិធានការសុវត្ថិភាពដូចជាការផ្ទៀងផ្ទាត់កត្តាពីរ។ និងវិធានការដូចជាការហ្វឹកហ្វឺនបុគ្គលិកក្នុងការការពារទិន្នន័យ។ ប្រសិនបើអ្នកបានអនុវត្តការវាយតំលៃផលប៉ះពាល់ឯកជនភាពបាន អ្នកក៏អាចសរសេរបញ្ជាក់អំពីវានៅទីនេះបានផងដែរ។','In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.'=>'នៅក្នុងចំណុចនេះ អ្នកគួរតែពន្យល់ពីនីតិវិធីអ្វីខ្លះដែលអ្នកមានដើម្បីដោះស្រាយជាមួយការរំលោភទិន្នន័យ ទាំងការរំលោភធ្ងន់ធ្ងរ ឬតូចតាច ដូចជាប្រព័ន្ធធ្វើរបាយការណ៍ផ្ទៃក្នុង យន្តការទំនាក់ទំនង ឬក៏រង្វាន់ក្នុងការស្វែងរកកំហុសជាដើម។','If your web site receives data about users from third parties, including advertisers, this information must be included within the section of your privacy policy dealing with third party data.'=>'ប្រសិនបើវេបសាយរបស់អ្នកទទួលទិន្នន័យអ្នកប្រើពីភាគីទីបី ដូចជាអ្នកផ្សាយពាណិជ្ជកម្មជាដើម នោះទិន្នន័យនេះត្រូវតែបញ្ចូលទៅក្នុងចំណុចណាមួយនៃគោលការណ៍ឯកជនភាពរបស់អ្នកដើម្បីដោះស្រាយជាមួយនឹងទិន្នន័យនៃភាគីទីបីនេះ។','If your web site provides a service which includes automated decision making - for example, allowing customers to apply for credit, or aggregating their data into an advertising profile - you must note that this is taking place, and include information about how that information is used, what decisions are made with that aggregated data, and what rights users have over decisions made without human intervention.'=>'ប្រសិនបើវេបសាយរបស់អ្នកផ្ដល់នូវសេវាកម្មមួយដែលមានរួមបញ្ចូលទាំងការសម្រេចចិត្តដោយស្វ័យប្រវត្តិ ឧទាហរណ៍ដូចជាការអនុញ្ញាតឲ្យអតិថិជនដាក់ពាក្យស្នើសុំឥណទាន ឬក៏ប្រមូលទិន្នន័យរបស់ពួកគេដាក់ទៅក្នុងប្រវត្តិរូបពាណិជ្ជកម្មណាមួយ នោះអ្នកត្រូវកត់សម្គាល់ថា ករណីនេះបានកើតឡើងហើយ និងសូមបញ្ចូលនូវព័ត៌មានពីរបៀបដេលព័ត៌មានទាំងនេះនឹងត្រូវប្រើ តើនឹងមានសេចក្ដីសម្រេចចិត្តអ្វីខ្លះកើតចេញពីការប្រមូលទិន្នន័យនេះ និងថាតើអ្នកប្រើមានសិទ្ធិអ្វីខ្លះទៅលើការសម្រេចចិត្តដែលពុំមានទាក់ទងនឹងការជ្រៀតជ្រែកពីមនុស្សនេះ។','Introduction'=>'សេចក្ដីផ្ដើម','Removed %s.'=>'បានដក %s ចេញ។','You deactivated this plugin on %s and may no longer need this policy.'=>'អ្នកដកមិនឲ្យដំណើរការនូវកម្មវិធីបន្ថែម %s ហើយប្រហែលជាលែងត្រូវការគោលការណ៍នេះទៀតហើយ។','Updated %s.'=>'បានអាប់ដេត %s។','Source: %s'=>'ប្រភព: %s','Suggested text:'=>'អក្សរដែលបានផ្ដល់ឲ្យ:','In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.'=>'នៅក្នុងចំណុចរងនេះ អ្នកគួរកត់សម្គាល់នូវព័ត៌មានបែបណាដែលប្រមូលមកតាមរយៈការបញ្ចេញមតិ។ យើងបានកត់សម្គាល់នូវទិន្នន័យដែល WordPress ធ្វើការប្រមូលតាមលំនាំដើម។','We have suggested the sections you will need. Under each section heading you will find a short summary of what information you should provide, which will help you to get started. Some sections include suggested policy content, others will have to be completed with information from your theme and plugins.'=>'យើងបានណែនាំនូវចំណុចនានាដែលអ្នកនឹងត្រូវការ។ នៅពីក្រោមនូវចំណងជើងនៃផ្នែកនីមួយៗ អ្នកនឹងឃើញការសង្ខេបខ្លីមួយស្ដីអំពីព័ត៌មានអ្នកគួរផ្ដល់ ដែលនឹងជួយអ្នកដើម្បីចាប់ផ្ដើម។ ផ្នែកខ្លះមានបញ្ចូលនូវមាតិកាគោលកាណ៍ដែលបានណែនាំ ចំណែកឯផ្នែកខ្លះទៀតនឹងទាមទារឲ្យអ្នកបំពេញជាមួួនឹងព័ត៌មានពីរូបរាងនៃវេបសាយ និងពីកម្មវិធីបន្ថែមរបស់អ្នក។','In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.'=>'នៅក្នុងចំណុចនេះ អ្នគួរកត់សម្គាល់នូវព័ត៌មានផ្ទាល់ខ្លួនណាខ្លះដែលអ្នកប្រមូលពីអ្នកប្រើ និងពីអ្នកចូលទស្សនាវេបសាយ។ ការនេះអាចរាប់បញ្ចូលព័ត៌មានផ្ទាល់ខ្លួន ដែលមានដូចជា ឈ្មោះ អាសយដ្ឋានអ៊ីមែល ចំណង់ចំណូលចិត្តផ្ទាល់ខ្លួនលើគណនី ទិន្នន័យនៃការធ្វើប្រតិបត្តិការទិញលក់ ដូចជាព័ត៌មាននៃការទិញ និងទិន្នន័យបច្ចេកទេស ដូចជាព័ត៌មានអំពីឃុកឃីសជាដើម។','In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.'=>'នៅក្នុងចំណុចរងនេះ អ្នកគួរកត់សម្គាល់នូវព័ត៌មានបែបណាដែលអ្នកប្រើដែលអាចអាប់ឡូដហ្វាល់មេឌាបានផ្ដល់។ ជាទូទៅគ្រប់ហ្វាល់ដែលបានអាប់ឡូដតែងតែអាចចូលមើលបានជាសាធារណៈ។','In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.'=>'នៅក្នុងចំណុចរងនេះ អ្នកគួរកត់សម្គាល់នូវកញ្ចប់វិភាគមួយណាដែលអ្នកប្រើ របៀបដេលអ្នកប្រើអាចចេញផុតពីការតាមដានសម្រាប់វិភាគ រួមជាមួយនឹងតំណទៅកាន់គោលការណ៍ឯកជនភាពនៃអ្នកដែលផ្ដល់សេវាវិភាគនេះដល់អ្នកប្រសិនបើមាន។','Visitor comments may be checked through an automated spam detection service.'=>'មតិរបស់អ្នកអានអាចនឹងត្រូវត្រួតពិនិត្យតាមរយៈសេវាកម្មរុករកស្ប៉ាមដោយស្វ័យប្រវត្តិ។','The suggested privacy policy text has changed. Please <a href="%s">review the guide</a> and update your privacy policy.'=>'អក្សរដែលផ្ដល់ឲ្យសម្រាប់គោលកាណ៍ឯកជនភាពត្រូវបានកែ។ សូម <a href="%s">ពិនិត្យឡើងវិញនូវលំណែនាំ</a> ហើយអាប់ដេតគោលការណ៍ឯកជនភាពរបស់អ្នក។','%s (Draft)'=>'%s (ពង្រាង)','Privacy Policy'=>'គោលការណ៍ឯកជនភាព','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!'=>'សូមស្វាគមន៍មកកាន់ WordPress។ នេះគឺជាប្រកាសដំបូងរបស់អ្នក។ ធ្វើការកែប្រែ ឬក៏លុបវាចោល បន្ទាប់មកចាប់ផ្ដើមសរសេរតែម្ដង!','...or something like this:'=>'...ឬក៏អ្វីមួយដូចខាងក្រោម៖','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:'=>'នេះគឺជាទំព័រឧទាហរណ៍។ វាមានភាពខុសប្លែកគ្នាពីប្រកាសរបស់ប្លក់ ពីព្រោះវានឹងស្ថិតនៅមួយកន្លែង ហើយក៏នឹងបង្ហាញនៅលើម៉ឺនុយនៃវេបសាយរបស់អ្នកដែរ (ចំពោះរូបរាងវេបសាយភាគច្រើន)។ មនុស្សភាគច្រើនចាប់ផ្ដើមធ្វើការនៅលើទំព័រ «អំពី» មុនគេ ដែលជាកន្លែងសម្រាប់ណែនាំខ្លួនគេចំពោះអ្នកចូលទស្សនាវេបសាយសំខាន់ៗ។ វាគួរតែជាការសរសេរអ្វីមួយដូចខាងក្រោមនេះ៖','Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)'=>'សួស្ដីបាទ! ខ្ញុំគឺជាអ្នកជិះកង់នាំសារនៅពេលថ្ងៃ ជាតារាសម្ដែងដែលពោរពេញដោយមហិច្ឆតានៅពេលយប់ ហើយនេះគឺជាវេបសាយរបស់ខ្ញុំ។ ខ្ញុំរស់នៅក្នុងរដ្ឋ Los Angeles។ ខ្ញុំមានឆ្កែដ៏គួរឲ្យស្រឡាញ់មួយឈ្មោះ Jack ហើយខ្ញុំចូលចិត្ត pi&#241;a coladas។ (And gettin\' caught in the rain.)','The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.'=>'ក្រុមហ៊ុន XYZ Doohickey Company ត្រូវបានបង្កើតឡើងនៅឆ្នាំ ១៩៧១ និងបានបន្តផ្ដល់នូវ doohickeys ដែលមានគុណភាពខ្ពស់ទៅកាន់សាធារណជនចាប់តាំងពីពេលនោះមក។ ដោយមានទីតាំងស្ថិតនៅក្នុងទីក្រុង Gotham, XYZ មានបុគ្គលិកជាង ២០០០ នាក់ ហើយបានបង្កើតនូវផលិតផលសដ៏អស្ចារ្យជាច្រើនគ្រប់មុខសម្រាប់សហគមន៍ក្នុងទីក្រុង Gotham នេះ។','As a new WordPress user, you should go to <a href="%s">your dashboard</a> to delete this page and create new pages for your content. Have fun!'=>'ក្នុងនាមជាអ្នកប្រើប្រាស់ WordPress ថ្មីម្នាក់ អ្នកគួរតែចូលទៅកាន់ <a href="%s">ផ្ទៃតាប្លូរបស់អ្នក</a> ដើម្បីលុបទំព័រនេះចោល និងបង្កើតទំព័រថ្មីៗសម្រាប់មាតិការបស់អ្នក។ to delete this page and create new pages for your content. សូមរីករាយ!','A post ID mismatch has been detected.'=>'ID នៃប្រកាសមួយដែលពុំត្រូវគ្នា ត្រូវបានរកឃើញ។','Manage your plugins'=>'គ្រប់គ្រងកម្មវិធីបន្ថែមរបស់អ្នក','Update your plugins'=>'អាប់ដេតកម្មវិធីបន្ថែមរបស់អ្នក','Manage inactive plugins'=>'គ្រប់គ្រងកម្មវិធីបន្ថែមដែលមិនដំណើរការរបស់អ្នក','Manage your themes'=>'គ្រប់គ្រងរូបរាងវេបសាយរបស់អ្នក','https://wordpress.org/about/requirements/'=>'https://wordpress.org/about/requirements/','Sorry, you are not allowed to edit comments on this post.'=>'សូមទោស អ្នក​មិន​ត្រូវ​បាន​អនុញ្ញាត​ឲ្យ​កែ​មតិ​លើ​ប្រកាស​នេះ​ទេ។','Custom Background'=>'ផ្ទៃ​ក្រោយ​ផ្ទាល់​ខ្លួន','Custom Header'=>'ក្បាលទំព័រ​ផ្ទាល់​ខ្លួន','Edit &#8220;%s&#8221;'=>'កែ &#8220;%s&#8221;','This <a href="%1$s">child theme</a> requires its parent theme, %2$s.'=>'<a href="%1$s">រូបរាង​កូន</a>​នេះ​ត្រូវការ​រូបរាង​មេ (%2$s) របស់​វា។','Filter'=>'តម្រង','Slug'=>'Slug','The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'&#8220;Slug&#8221; គឺ​ជា​ឈ្មោះ​ដែល​មាន​ភាព​សមស្រប​សម្រាប់ URL។ វា​តែងតែ​ជា​អក្សរ​តូច ហើយ​មាន​តែ​តួ​អក្សរ លេខ និង​សញ្ញា​ដក តែ​ប៉ុណ្ណោះ។','The description is not prominent by default; however, some themes may show it.'=>'ជាទូទៅ ការ​ពណ៌នា​មិន​សំខាន់​នោះ​ទេ ប៉ុន្តែ​មាន​រូបរាង​ខ្លះ​អាច​នឹង​បង្ហាញ​វា​ដែរ។','The name is how it appears on your site.'=>'ឈ្មោះ​ដែល​ត្រូវ​បង្ហាញ​លើ​វេបសាយ​របស់​អ្នក។','Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have children categories for Bebop and Big Band. Totally optional.'=>'ខុស​ពី​ស្លាក, ចំណាត់​ក្រុម​មាន​លំដាប់​ថ្នាក់។ អ្នក​អាច​មាន​ចំណាត់​ក្រុម "សត្វ" ហើយ​មាន​កូន​ចំណាត់​ក្រុម​ជា "ថនិក​សត្វ" និង "មំសាសត្វ" ជាដើម។ និយាយ​រួម គឺ​វា​អាស្រ័យ​លើ​ការ​សម្រេច​ចិត្ត​របស់​អ្នក។','Sorry, you are not allowed to delete this item.'=>'សុំទោស អ្នក​មិន​ត្រូវ​បាន​អនុញ្ញាត​ឲ្យ​លុប​របស់​នេះ​ទេ។','Try Again'=>'ព្យាយាមម្ដងទៀត','Select %s'=>'រើស %s','You can delete Link Categories in the Bulk Action pull-down, but that action does not delete the links within the category. Instead, it moves them to the default Link Category.'=>'អ្នក​អាច​លុប​ចំណាត់​ក្រុម​នៃ​តំណ​បាន​តាម សកម្មភាព​ជា​បណ្ដុំ ក៏ប៉ុន្តែ​សកម្មភាព​នេះ​មិន​លុប​តំណ​ទាំងឡាយ​ដែល​ស្ថិត​នៅ​ក្នុង​ចំណាត់ក្រុម​នោះ​ទេ។ ដោយឡែក វា​នឹង​ផ្លាស់ទី​តំណ​ទាំង​នោះ​ទៅ​កាន់​ចំណាត់ក្រុម​លំនាំដើម​វិញ។','Could not update link in the database'=>'មិន​អាច​ធ្វើ​បច្ចុប្បន្នភាព​តំណ​ក្នុង​មូលដ្ឋាន​ទិន្នន័យ','Could not insert link into the database'=>'មិន​អាច​បញ្ចូល​តំណ​ទៅ​ក្នុង​មូលដ្ឋាន​ទិន្នន័យ','The ftp PHP extension is not available'=>'មិន​មាន​ផ្នែក​បន្ថែម​នៃ ftp PHP','FTP hostname is required'=>'ត្រូវការ​ឈ្មោះ​ម៉ាស៊ីន FTP','FTP username is required'=>'ត្រូវ​ការ​ឈ្មោះ​អ្នក​ប្រើ FTP','FTP password is required'=>'ត្រូវការ​ពាក្យ​សម្ងាត់ FTP','Failed to connect to FTP Server %s'=>'បរាជ័យ​ក្នុង​ការភ្ជាប់​ទៅ FTP នៃ​ម៉ាស៊ីន​មេ %s','Username/Password incorrect for %s'=>'ឈ្មោះ​អ្នកប្រើ/ពាក្យសម្ងាត់ គឺ​មិន​ត្រឹម​ត្រូវ​សម្រាប់ %s','Could not access filesystem.'=>'មិន​អាច​ចូល​ទៅ​កាន់​ឯកសារ​ប្រព័ន្ធ។','Filesystem error.'=>'កំហុស​ឯកសារ​ប្រព័ន្ធ។','The plugin is at the latest version.'=>'កម្មវិធី​បន្ថែម​នេះ​ស្ថិត​នៅ​កំណែ​ចុង​ក្រោយ​ហើយ។','Unpacking the update&#8230;'=>'កំពុង​ស្រាយ​កញ្ចប់​បច្ចុប្បន្នភាព&#8230;','Removing the old version of the plugin&#8230;'=>'កំពុង​ដក​ចេញ​កំណែ​ចាស់​នៃ​កម្មវិធី​បន្ថែម&#8230;','Could not remove the old plugin.'=>'មិន​អាច​ដក​កម្មវិធី​បន្ថែម​ចាស់​ចេញ។','Installation package not available.'=>'មិន​មាន​កញ្ចប់​ដំឡើងទេ។','Unpacking the package&#8230;'=>'កំពុង​ស្រាយ​កញ្ចប់&#8230;','Installing the plugin&#8230;'=>'កំពុង​ដំឡើង​កម្មវិធី​បន្ថែម&#8230;','Plugin installed successfully.'=>'បាន​ដំឡើង​កម្មវិធី​បន្ថែម​ដោយ​ជោគជ័យ។','The theme is at the latest version.'=>'រូបរាង​នេះ​ស្ថិត​នៅ​ក្នុង​កំណែ​ថ្មី​បំផុត​ហើយ។','Removing the old version of the theme&#8230;'=>'កំពុង​លុប​កំណែ​ចាស់​នៃ​រូបរាង&#8230;','Could not remove the old theme.'=>'មិន​អាច​ដក​ស្បែក​ចាស់​ចេញ។','Installing the theme&#8230;'=>'កំពុង​ដំឡើង​ស្បែក&#8230;','Theme installed successfully.'=>'បាន​ដំឡើង​ស្បែក​ដោយ​ជោគជ័យ។','Activate Plugin'=>'បើក​ដំណើរ​ការ​កម្មវិធី​បន្ថែម','Return to Plugins page'=>'ត្រឡប់​ទៅ​ទំព័រ​កម្មវិធី​បន្ថែម','Return to Plugin Installer'=>'ត្រឡប់ទៅ​កម្មវិធី​ដំឡើង​កម្មវិធី​បន្ថែម','Successfully installed the theme <strong>%1$s %2$s</strong>.'=>'បាន​ដំឡើង​រូបរាង <strong>%1$s %2$s</strong> ដោយ​ជោគជ័យ។','Activate &#8220;%s&#8221;'=>'បើក​ដំណើរ​ការ &#8220;%s&#8221;','Return to Theme Installer'=>'ត្រឡប់​ទៅ​កម្មវិធី​ដំឡើង​ស្បែក','Return to Themes page'=>'ត្រឡប់​ទៅ​ទំព័រ​ស្បែក','Image data does not exist. Please re-upload the image.'=>'មិនមាន​ទិន្នន័យ​រូបភាព។ សូម​ផ្ទុក​រូបភាព​ឡើង​ម្ដង​ទៀត។','Crop'=>'ច្រិប','Rotate counter-clockwise'=>'បង្វិល​ទៅ​ឆ្វេង','Rotate clockwise'=>'បង្វិល​ទៅ​ស្ដាំ','Flip vertically'=>'ត្រឡប់​បញ្ឈរ','Flip horizontally'=>'ត្រឡប់​ផ្ដេក','Scale Image'=>'ប្ដូរ​ខ្នាត​រូបភាព','Original dimensions %s'=>'វិមាត្រ​ដើម %s','Restore Original Image'=>'ស្ដារ​រូបភាព​ដើម​មក​វិញ','Discard any changes and restore the original image.'=>'លុប​បន្លាស់​ប្ដូរ​ទាំង​ឡាយ ហើយ​ស្ដារ​រូបភាព​ដើម​មក​វិញ។','Restore image'=>'ស្ដារ​រូបភាព','Image Crop'=>'ច្រិប​រូបភាព','Crop Aspect Ratio'=>'ច្រិប​សមាមាត្រ','Crop Selection'=>'ច្រិប​ការ​រើស','Aspect ratio:'=>'សមាមាត្រ:','Selection:'=>'ការ​រើស:','Thumbnail Settings'=>'ការ​កំណត់​រូបតូច','Current thumbnail'=>'រូបតូច​បច្ចុប្បន្ន','Apply changes to:'=>'អនុវត្ត​បន្លាស់​ប្ដូរ​ទៅ:','All image sizes'=>'ទំហំ​រូបភាព​ទាំងអស់','All sizes except thumbnail'=>'គ្រប់​ទំហំ​ទាំង​អស់ លើក​លែង​តែ​រូបតូច','Cannot load image metadata.'=>'មិន​អាច​ផ្ទុក​ទិន្នន័យ​មេតា​របស់​រូបភាព។','Cannot save image metadata.'=>'មិន​អាច​រក្សា​ទុក​ទិន្នន័យ​មេតា​របស់​រូបភាព។','Image metadata is inconsistent.'=>'ទិន្នន័យ​មេតា​របស់​រូបភាព​គឺ​មិន​ស្រប​គ្នា​ទេ។','Image restored successfully.'=>'បាន​ស្ដារ​រូបភាព​មក​វិញ​ដោយ​ជោគជ័យ។','Unable to create new image.'=>'មិន​អាច​បង្កើត​រូបភាព​ថ្មី​បាន។','Nothing to save, the image has not changed.'=>'គ្មាន​អ្វី​ដែល​ត្រូវ​រក្សាទុក ព្រោះ​រូបភាព​មិន​ត្រូវ​បាន​ផ្លាស់ប្ដូរ​ទេ។','Unable to save the image.'=>'មិនអាច​រក្សា​ទុក​រូបភាព។','Image saved'=>'បាន​រក្សា​ទុក​រូបភាព','WordPress'=>'WordPress','You are about to delete this link \'%s\'
  \'Cancel\' to stop, \'OK\' to delete.'=>'អ្នក​រៀបនឹង​លុប​តំណ \'%s\'
