our content.'=>'ទំព័រ​នេះ​មាន​ការ​កំណត់​ទៅ​លើ​ទិដ្ឋភាព​នៃ​មាតិកា​របស់​អ្នក។','Return to Importers'=>'ត្រឡប់​ទៅ​កម្មវិធី​នាំចូល','You must click the Save Changes button at the bottom of the screen for new settings to take effect.'=>'អ្នក​ត្រូវ​តែ​ចុច​ប៊ូតុង "រក្សា​ទុក​បន្លាស់​ប្ដូរ" នៅ​ផ្នែក​ខាង​ក្រោម​ទំព័រ ដើម្បី​ធ្វើ​ឲ្យ​ការ​កំណត់​ថ្មី​មាន​សុពលភាព។','Activate Plugin &amp; Run Importer'=>'បើក​ដំណើរ​ការ &amp; បើក​កម្មវិធី​នាំចូល','You can add links here to be displayed on your site, usually using <a href="%s">Widgets</a>. By default, links to several sites in the WordPress community are included as examples.'=>'អ្នក​អាច​បន្ថែម​តំណ​នៅ​ទីនេះ ដើម្បី​ឲ្យ​បង្ហាញ​នៅ​លើ​វេបសាយ​របស់​អ្នក ដែល​ជា​ទូទៅ​ប្រើ​តាម <a href="%s">វិដជិត</a>។ តាម​សភាព​ដើម មាន​តំណ​ទៅ​កាន់​វេបសាយ​នានា​នៃ​សហគមន៍ WordPress ដែល​ត្រូវ​បាន​ដាក់​បញ្ចូល​ជា​ឧទាហរណ៍​ស្រាប់។','If you delete a link, it will be removed permanently, as Links do not have a Trash function yet.'=>'តំណ​នឹង​ត្រូវ​បាន​លុប​ចោល​ជា​អចិន្ត្រៃយ៍ បើ​អ្នក​ចុច​លុប​វា ព្រោះ​ផ្នែក​គ្រប់គ្រង "តំណ" មិន​ទាន់​មាន​មុខងារ "ធុង​សំរាម" ទេ។','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>.'=>'នៅ​ពេលនេះ​មាន​ជំនាន់​ថ្មី​របស់ %1$s ហើយ។ <a href="%2$s" %3$s>មើល​ជំនាន់ %4$s លម្អិត</a>។','Editor Style'=>'រចនាបថ​កម្មវិធី​កែ​សម្រួល','Plugin updated successfully.'=>'បាន​ធ្វើ​បច្ចុប្បន្នភាព​កម្មវិធី​បន្ថែម​ដោយ​ជោគជ័យ។','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this plugin.</em>'=>'នៅ​ពេលនេះ​មាន​ជំនាន់​ថ្មី​របស់ %1$s ហើយ។ <a href="%2$s" %3$s>មើល​ជំនាន់ %4$s លម្អិត</a>។ <em>រូបរាងនេះ​មិនមាន​ការអាប់ដេត​ដោយ​ស្វ័យ​ប្រវត្តិ​ទេ។</em>','Plugin update failed.'=>'ធ្វើ​បច្ចុប្បន្នភាព​កម្មវិធី​បន្ថែម​មិន​បាន​សម្រេច។','Theme update failed.'=>'អាប់ដេត​រូបរាង​មិន​បាន​សម្រេច។','Theme updated successfully.'=>'បាន​អាប់ដេត​រូបរាង​ដោយ​ជោគជ័យ។','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this theme.</em>'=>'នៅ​ពេលនេះ​មាន​កំណែ​ថ្មី​របស់ %1$s ហើយ។ <a href="%2$s" %3$s>មើល​កំណែ %4$s លម្អិត</a>។ <em>រូបរាង​នេះ​មិនមាន​ការ​អាប់ដេត​ដោយ​ស្វ័យ​ប្រវត្តិ​ទេ។</em>','Update package not available.'=>'មិនមាន​កញ្ចប់​បច្ចុប្បន្នភាព។','Default Post Format'=>'ទ្រង់ទ្រាយ​ប្រកាស​លំនាំដើម','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%1$s">enable</a> more themes.'=>'នៅ​ខណៈ​ពេល​នេះ អ្នក​មាន​តែ​រូបរាង​មួយ​ប៉ុណ្ណោះ​ដែល​បាន​បើក​សម្រាប់​វេបសាយ​មួយ​នេះ។ ចូល​ទៅ ការ​គ្រប់គ្រង​បណ្ដាញ ដើម្បី<a href="%1$s">បើក</a>​រូបរាង​ដទៃ​ទៀត។','Full Width Template'=>'ពុម្ពគម្រូ​ទំហំ​ទទឹង​ពេញ','Lead Developer'=>'អ្នកអភិវឌ្ឍ​ឈានមុខ','Translate this to be the equivalent of English Translators in your language for the credits page Translators sectionTranslators'=>'អ្នក​បក​ប្រែ','Layout'=>'ប្លង់​ទំព័រ','Want to see your name in lights on this page? <a href="%s">Get involved in WordPress</a>.'=>'តើ​ចង់​ឃើញ​ឈ្មោះ​របស់​អ្នក​លើ​ទំព័រ​នេះ​ទេ? <a href="%s">ចូលរួម​ជាមួយ WordPress</a>។','Credits'=>'កិត្តិយស','Cofounder, Project Lead'=>'សហ​ស្ថាបនិក, អ្នក​ដឹក​នាំ​គម្រោង','Core Contributors to WordPress %s'=>'អ្នក​រួមចំណែក​សំខាន់ៗ​ដល់ WordPress %s','Freedoms'=>'សេរីភាព','WordPress is created by a <a href="%1$s">worldwide team</a> of passionate individuals. <a href="%2$s">Get involved in WordPress</a>.'=>'WordPress ត្រូវ​បាន​បង្កើត​ដោយ <a href="%1$s">ក្រុម​ទាំង​ឡាយ​ជុំវិញ​ពិភពលោក</a> ដែល​ស្រលាញ់​ភាព​ឯករាជ្យ។ <a href="%2$s">ចូលរួម​ជាមួយ WordPress</a>។','Project Leaders'=>'អ្នក​ដឹកនាំ​គម្រោង','term nameName'=>'ឈ្មោះ','Post Formats'=>'ទ្រង់ទ្រាយ​ប្រកាស','External Libraries'=>'បណ្ណាល័យ​ខាង​ក្រៅ','Featured Image Header'=>'រូប​សំខាន់​នៅ​បឋមកថា','Featured Images'=>'រូប​សំខាន់','Site Language'=>'ភាសា​របស់​វេបសាយ','Update Available <span class="count">(%s)</span>'=>'មាន​បច្ចុប្បន្នភាព <span class="count">(%s)</span>','Deactivate'=>'បិទ​ដំណើរ​ការ','Version %s'=>'ជំនាន់ %s','By %s'=>'ដោយ %s','Overview'=>'ទិដ្ឋភាព​ទូទៅ','For more information:'=>'សម្រា