ently installed.'=>'រូបរាង​មេ​ឈ្មោះ <strong>%1$s %2$s</strong> ត្រូវ​បាន​ដំឡើង​រួច​ហើយ។','Successfully installed the parent theme, <strong>%1$s %2$s</strong>.'=>'បាន​ដំឡើង​រូបរាង​មេ <strong>%1$s %2$s</strong> ដោយ​ជោគជ័យ។','Version'=>'កំណែ','Plugin'=>'កម្មវិធី​បន្ថែម','Version:'=>'កំណែ៖','Scale'=>'មាត្រដ្ឋាន','pluginInstalled'=>'បាន​ដំឡើង','Plugin InstallerFavorites'=>'ដែល​ពេញចិត្ត','Search Engine Visibility'=>'ភាពមើលឃើញចំពោះម៉ាស៊ីនរុករក','Allow search engines to index this site'=>'អនុញ្ញាត​ម៉ាស៊ីន​ស្វែង​ដើម្បី​ធ្វើ​លិបិក្រម​វេបសាយ​នេះ','Discourage search engines from indexing this site'=>'បិទមិនអោយម៉ាស៊ីនរុករកអ៊ិនដិចវេបសាយរបស់អ្នក','It is up to search engines to honor this request.'=>'វាអាស្រ័យទៅលើម៉ាស៊ីនរុករកដើម្បីឆ្លើយតបនឹងសំណើរនេះ។','$image needs to be an WP_Image_Editor object'=>'$image ត្រូវ​តែ​ជា​វត្ថុ WP_Image_Editor','If you are looking to use the link manager, please install the <a href="%s">Link Manager</a> plugin.'=>'ប្រសិន​បើ​អ្នក​ចង់​ប្រើ​កម្មវិធី​គ្រប់គ្រង​តំណ, សូម​ដំឡើង​កម្មវិធី​បន្ថែម <a href="%s">Link Manager</a> ។','Image rotation is not supported by your web host.'=>'ម៉ាស៊ីន​ផ្ទុក​វេបសាយ​របស់​អ្នក​មិន​បាន​ផ្ដល់​ឲ្យ​មាន​ការ​បង្វិល​រូបភាព​ទេ។','To crop the image, click on it and drag to make your selection.'=>'ដើម្បី​ច្រឹប​រូបភាព អ្នក​អាច​ចុច​លើ​វា​ហើយ​អូស ដើម្បី​ជ្រើសរើស។','Loading&hellip;'=>'កំពុង​ផ្ទុក&hellip;','The theme contains no files.'=>'គ្មាន​ឯកសារ​នៅ​ក្នុង​រូបរាង​ឡើយ។','http://wordpress.org/plugins/hello-dolly/'=>'http://wordpress.org/plugins/hello-dolly/','WordPress %1$s running %2$s theme.'=>'WordPress %1$s កំពុង​ប្រើ​រូបរាង %2$s ។','Update Available'=>'មាន​បច្ចុប្បន្នភាព','Show previous theme'=>'បង្ហាញ​រូបរាង​មុន','Show next theme'=>'បង្ហាញ​រូបរាង​បន្ទាប់','Accessibility Ready'=>'ផ្ដល់​មធ្យោបាយងាយ​ស្រួល​រួច​ជា​ស្រេច','This is a child theme of %s.'=>'នេះជា​រូបរាង​កូន​របស់ %s ។','Welcome to WordPress&nbsp;%s'=>'ស្វាគមន៍​មក​កាន់ WordPress&nbsp;%s','https://make.wordpress.org/'=>'https://make.wordpress.org/','Once you have made your sele